INSERT INTO `forum` VALUES (1164,0,1,'nicolas','Nico','Welcome to the forum!','0000-00-00','00:00:00','[May 19, 03:05] - ...or welcome back!','2012-05-19 22:15:00',0),(1165,0,1,'nicolas','Nico','Squads','0000-00-00','00:00:00','[May 20, 06:05] - Official squad lists haven\'t been published yet, so you may not be able to select the player you want as a top scorer. Patience my friends!','2012-05-21 01:42:51',0),(1166,0,53,'aliocha','FRANCE WILL WIN THE ','Wouhouuuuuuuuuuuuu!','0000-00-00','00:00:00','[May 21, 04:05] - Only 17 more days! Website looks great! ','2012-05-26 19:51:58',2),(1167,1166,27,'augustin','Gugusse','','0000-00-00','00:00:00','Yeaaaaaaaah!!!!!!!','2012-05-21 21:49:57',0),(1168,1166,37,'rico','Americo','','0000-00-00','00:00:00','YES. The best ever.','2012-05-26 19:51:58',0),(1169,0,37,'rico','Americo','Oh Ranis where art thou ?','0000-00-00','00:00:00','[May 26, 01:05] - haven\'t seen yet your traditional magnifiscent opening message...','2012-05-28 14:30:28',2),(1170,1169,11,'kimbel','pui pui','','0000-00-00','00:00:00','he might be in Baku right now cheerin: EUPHORIAAA!','2012-05-26 20:38:52',0),(1171,1170,8,'ranis','Ranis','','0000-00-00','00:00:00','I have been busy \'producing\' the latest Rednex video - <a href=\'http://www.youtube.com/watch?v=tu0vQ6apEsQ\' target=\'new\'>http://www.youtube.com/watch?v=tu0vQ6apEsQ</a><br/><br/>I am sure to be annoying ya\'ll soon with my useless predictions :)<br/><br/>EUPHORIAAAAAAAAAAA!!! This is Sweden\'s year, all the way baby!!','2012-05-28 14:30:28',0),(1175,0,11,'kimbel','pui pui','$10,-','0000-00-00','00:00:00','[May 31, 02:05] - what\'s the bet? 10 euro?','2012-06-02 21:12:39',4),(1176,1175,1,'nicolas','Nico','','0000-00-00','00:00:00','Ranis used to organize that part in the past; I don\'t know whether he\'ll do it this time...','2012-05-31 22:00:29',0),(1177,1176,8,'ranis','Ranis','','0000-00-00','00:00:00','Sure, we can do it via my Paypal account - payhere@hitquarters.com . So everyone who wants to be in it, please put 10 EUR into it before kick-off. 60% to No.1, 30% to No.2 and 10% to No.3. Any thoughts...? <br/>Please make sure to cover the Paypal charge yourselves.','2012-06-02 20:47:45',0),(1178,1177,8,'ranis','Ranis','','0000-00-00','00:00:00','Nico, do you mind sending an email about this info to everyone in case many of the betters don\'t read the forum?','2012-06-02 20:48:30',0),(1179,0,8,'ranis','Ranis','This year\'s France...','0000-00-00','00:00:00','[Jun 02, 02:06] - And this year\'s France is likely to be... Portugouch!<br/><br/>I was reading during the week the same prediction at some web site. Among other things, Bosingwa and Ricardo Carvalho are not in the squad due to off-field reasons. The coach Paulo Bento, the man behind that, has been heavily critized.<br/><br/>Tonight I watched their friendly at home against Turkey. Turkey won 1-3. The portuguese goal was their first this year. The turkish goals came thanks to a very insecure and messy portuguese defense, lowsy communication where three players are all standing just watching the ball. On two of the goals were poor goalkeeping mistakes, made by two different goalkeepers... ! (oh god, how I wish that would have been England... :)<br/><br/>As always, Portugal has a lot of ball but no striker. Almeida was terrible, bad on the ball, lowsy finish, oozing low self-esteem. The players were bitching at each other, Cristiano Ronaldo missed a badly shot penalty and coach Bento looks like an old heroinist that someone dressed up in clean clothes as a feature in some reality-show...<br/><br/>Destined for disaster...<br/><br/>An irrelevant fact is that Bento is also a very tasty fish-snack in Thailand. Could be a sign... though I am not sure of what ...','2012-06-03 10:16:58',2),(1180,1177,1,'nicolas','Nico','','0000-00-00','00:00:00','That sounds good to me! That\'s how we\'ve done it in the past. Though now I\'d like 95%,3% and 2% as I will obviously win the pool this time. ','2012-06-02 21:12:39',0),(1181,1179,1,'nicolas','Nico','','0000-00-00','00:00:00','What about Italy? They lose their preparation matches, the team is young and new, the coach was fired from Monaco...yet some say that because most players are from one club - the Old Lady\'s - it is likely to go far. ','2012-06-03 04:01:26',0),(1182,1181,8,'ranis','Ranis','','0000-00-00','00:00:00','Yes, and then there is the \'corruption scandal with nine lives\' that seemed to have kicked in again... Coach Prandelli even said he is ok with Italy withdrawing from the whole tournament (!?). However, the build up was similar to when they won WC in 2006, wasn\'t that when Juventus was dropped to Serie B. <br/><br/>Anyway, Italy is definitely a strong contender for this year\'s France (even though they came pretty close last time as well :)','2012-06-03 10:16:58',0),(1183,0,8,'ranis','Ranis','This year\'s England...','0000-00-00','00:00:00','[Jun 03, 03:06] - I watched this year\'s England play a friendly against Belgium yesterday. They won 1-0, Welbeck scored on what might have been England\'s only goal attempt for 80 minutes until Defoe hit the post.<br/><br/>Belgium is a funny team. The commentator called them \'Barcelona light\'. They have the ball all the time, passing it around but when it came to the finish it was almost as if they didn\'t really want to do it, as if it was something that had to be done in the game of football out of necessity... \'do I really have to???\'. \'Ok, I\'ll do it this time...\' and then they would blast it 16 meters too high with the wrong foot. Needless to say, they wern\'t threatening. <br/><br/>The game reminded a lot about Barcelona-Chelsea but without the constant danger that there would be a goal. England was very defensive and I seriously doubt that England will charm anyone this year with a forceful attacking style of play. France-England, ball possession 72-28, something like that... though I am not saying that they can\'t get the right results. Remember Greece? I am sure Hodgson does.<br/><br/>Cahill and Terry picked up injuries but unfortunately not severe enough to keep them out of the tournaments. Well, well, the joys of watching friendlies don\'t come easy...<br/><br/>They were also experimenting with goal cameras in this game so maybe, maybe, maybe in WC 2038...','2012-06-03 22:24:46',1),(1184,1183,1,'nicolas','Nico','','0000-00-00','00:00:00','Playing in Flanders is fun, though, because most players are concerned with making sure they have a solid defense, and they all focus on keeping their positions. Sure, they don\'t have many strikers, but that\'s still better than playing in France where everyone wants to score a goal and no one wants to defend, and it\'s a big mess. It does not surprise me that the Belgian team plays that way; it is a pity though, because they have E. Hazard and other good players.','2012-06-03 22:24:46',0),(1185,0,163,'pawel','Pawel','Extra points...','0000-00-00','00:00:00','[Jun 04, 04:06] - If not this time, then maybe during 2014 World Cup or 2036 Olympics betting we can add extra points for predicting the EXACT score of the games, what do you think?','2012-06-05 03:37:01',1),(1186,1185,1,'nicolas','Nico','','0000-00-00','00:00:00','I tried that in the beginning (8 years ago!); but this requires that everyone enters a score, when most just want to predict a certain winner or a tie, and I decided in favor of simplicity in the end.','2012-06-05 03:37:01',0),(1187,0,1,'nicolas','Nico','Website','0000-00-00','00:00:00','[Jun 06, 08:06] - The router crashed last night; as I wake up at 4pm European time (at best!) it may be that it takes time before I correct the issue. If this router problem keeps surfacing, I\'ll take drastic steps. In the meantime if you have an urgent need to correct a bet, either send me an email at vilnico@gmail.com or send me a text at +1 949 340 4061. Thanks!','2012-06-06 15:57:27',0),(1188,0,17,'derek','Derek','A stroll down memory lane','0000-00-00','00:00:00','[Jun 06, 01:06] - <a href=\'http://www.youtube.com/watch?feature=player_embedded&amp;v=9wALiyDM_Nk\' target=\'new\'>http://www.youtube.com/watch?feature=player_embedded&amp;v=9wALiyDM_Nk</a>','2012-06-07 11:47:46',1),(1189,1188,8,'ranis','Ranis','','0000-00-00','00:00:00','Oh, I remember this great day as if it was yesterday... :)<br/>Sweeeet memories... Two teams I dislike, beating each other up, can it get any better? I remember exactly which German pizzeria I watched it at.<br/><br/>Unfortunately, since then, Holland has resorted to stop the physical play and now only show technical brilliance... NOT!<br/><br/>I am much looking forward to their new game, especially since I now dislike Portugal even more. Hoping for a feast...','2012-06-07 11:47:46',0),(1190,0,8,'ranis','Ranis','Bananotelli','0000-00-00','00:00:00','[Jun 07, 05:06] - Anyone up for foruming a bit about racism? Not the most uplifting subject perhaps but now I read that Platini (French born, Italian descent) has said that games will be discontinued if the crowd will make racist remarks to the players...<br/><br/>The possible interesting situations that can come from this are endless... can keep one up all night making up all kinds of fun scenarios :) Does anyone think this will actually discourage any potential racists?<br/><br/>Anyway, you probably heard that Mario Bananotelli angrily said that he will walk off the pitch if someone will again throw bananas at him. Well, Mario, saying this publicly will SURELY help... try the reverse psychology next time... I don\'t consider myself particularly racist, and I actually like Bananotelli both as a player and instigator, but now even I would love to throw him some bananas just to watch the entertainment unfold before my eyes. Must poke in the wound, must poke in the wound...<br/><br/>I also read that if Bananotelli will walk off the pitch without being told so, he will get a yellow card... :) How about that, huh? Do it twice and you get a red! It\'s moments like this when I can\'t make up my mind if I should love or hate this kind of soap-opera championships. For now, I\'ll settle with both.','2012-06-08 15:23:14',8),(1191,1190,8,'ranis','Ranis','','0000-00-00','00:00:00','There has been a lot of talk in media about the racism in Poland &amp; Ukraine, so I will feed you some info since I live here... In my region in Poland I see a black person not even once a year. This is not the reason I came here, I would gladly trade the Dutch here to Africans any day ;), but when I see black people I react with quite a surprise since it is a rare sight over here. However, I would not call the Polish people racists though I might not know enough to make a fair call.<br/><br/>Poland has relatively open immigration laws, they won\'t really stop anyone but they will also not support anyone finanically which makes immigrants a rare sight, but in my opinion there is no real resentment based on race or looks (I am an unusually looking immigrant myself here, you know), mostly only reserved curiousity. Though, last year I had a black friend here from Costa Rica and while visiting a Polish friend\'s family, the 80 year old grandma said she didn\'t want him in her house because he was black (!), so I guess at some (generation?) level it exists. I am not sure if the grandma will go to the games of England and France, I hope not...<br/>','2012-06-07 15:50:59',0),(1192,1190,1,'nicolas','Nico','','0000-00-00','00:00:00','I find that the best way to deal with racism is ignoring it...I have often made fun of it, but that just feeds it. And Platini is such an idiot, though I guess anybody at the head of UEFA is likely to be. I\'ll consider changing my mind when they implement the video in refereeing.','2012-06-07 18:50:45',0),(1193,1191,17,'derek','Derek','','0000-00-00','00:00:00','French politicians say the same thing as grandma all the time now.','2012-06-07 18:52:34',0),(1194,1190,11,'kimbel','pui pui','','0000-00-00','00:00:00','just practising: <a href=\'http://www.youtube.com/watch?v=aZ5ALFRJkkw\' target=\'new\'>http://www.youtube.com/watch?v=aZ5ALFRJkkw</a>','2012-06-07 21:25:12',0),(1195,1194,8,'ranis','Ranis','','0000-00-00','00:00:00','Polish fans singing monkey chants yesterday to the black players of Holland - <a href=\'http://www1.skysports.com/football/news/19692/7800110/Van-Bommel-disgusted-by-abuse\' target=\'new\'>http://www1.skysports.com/football/news/19692/7800110/Van-Bommel-disgusted-by-abuse</a>','2012-06-08 08:47:02',0),(1196,1195,7,'etienne','Etienne','','0000-00-00','00:00:00','In France there is much worse than Racism : it\'s an association called \'\'SOS Racism\'\', and the people there just want to send everyone to court. Looks like they spend their days listening to policitians, actors, business people, and each time someone says something that could be interpreted as racism, they sue the person. Probably the worse way to fight racism... and totally ridiculous. Soon, I guess, they will also send to trial people who said something that could be interpreted as demeaning to fat people, people with glasses, short people, redhair people... And it\'s a shame, because there are a lot of funny mean jokes about redhair people, right Ranis ? ;) (I want to throw carrots at you)','2012-06-08 09:25:08',0),(1197,1195,11,'kimbel','pui pui','','0000-00-00','00:00:00','The word for un homme noire in the Irish language is fear gorm, which literally means \'\'blue man\'\'. We could consider penalty points for those not chosing un homme de couleur as top scorer... Unless one of them scores the decisive goal en final.','2012-06-08 13:41:44',0),(1198,0,53,'aliocha','France: Winner of th','T - 1 h!!!!!!!!!!!!!!!!!!!!!','0000-00-00','00:00:00','[Jun 08, 08:06] - WOUHOUUUUUUUUUUUUUU! ONE MORE HOUR !!!!!!!!!!!!!! <br/>France will win this Euro!!!!!!<br/><br/>','2012-06-08 15:26:31',1),(1199,1191,11,'kimbel','pui pui','','0000-00-00','00:00:00','<a href=\'http://www.youtube.com/watch?v=h5OGjhlrYxo\' target=\'new