ctis, maseurabitanis, unotrepastis, to be compeletis...<br/><br/>RUSSIA<br/>jetiralacarabin, jenculpoutin, cebonlemandarin, mepaleclemetin, paskiatrodpepin, jesuifilosov, celapoukifilosov, to be completov','2012-06-17 01:24:58',2),(1294,1292,37,'rico','Americo','','0000-00-00','00:00:00','AND THEY DID ! (btw, it appears to me this new point system is a little hectic / unfair: when you don\'t bet well, the only way you can recover is by betting on big underdogs...)','2012-06-16 22:46:55',0),(1295,1293,37,'rico','Americo','','0000-00-00','00:00:00','Anozeurbirplis, fishandshipsis, pippaisverysexis... (not so easy to do for english speaking)<br/>Well, the big news is that Greece stays in the Euro...<br/>','2012-06-16 22:53:42',0),(1296,1295,11,'kimbel','pui pui','','0000-00-00','00:00:00','if they end up like in 2004, I will eat ,  and my shoes! unbelievable!','2012-06-17 01:24:58',0),(1297,1294,1,'nicolas','Nico','','0000-00-00','00:00:00','Well it is true but at the same time, Milie won once 11 points and another time 13.75 points, she has 10 correct bets (whereas Ranis has 12) and she is not first... so it still looks fair. A few have been betting on the underdogs (like Patate Sauzee) for a while and it didn\'t pay off...','2012-06-17 01:51:26',0),(1298,0,7,'etienne','Etienne','the Greeks','0000-00-00','00:00:00','[Jun 16, 10:06] - I had done my deep survey, backed up by my team of Swiss statisticians. A 10-page analysis of different kind of data (can be sent upon request). And the results was, to my surprise, Russia. Russia would win this Euro. Numbers don\'t lie.<br/><br/>First game, 4-1 against the Czechs. All goes according to plan. They are clearly the strongest in the group. Journalists say they are well organized and determined.<br/><br/>Second game, they dominate Poland, but Chzwszywzsewschzki scores the goal of his life. 1-1. No big deal. They still lead the group, and the last opponent has lost against the Czechs (that Russia massacred), so must be pretty weak.<br/><br/>A few days later, Russia is out.<br/><br/>What happened ??<br/>THE GREEKS.<br/><br/>It\'s always the Greeks.<br/><br/>Whenever there is trouble in Europe, don\'t look too much for the guilty. Currency is in danger ? Your food tastes like dead goat ? Your wife cheats on you ? Your holidays plan is a scam ? It\'s the Greeks. Always.<br/><br/>Well, at least Greece plays a very entertaining and beautiful football.<br/>(just kidding)<br/><br/>I have now to fire my team of statisticians, who will sadly join the 3% of the Swiss population who is looking for a job. YOU HEARD THAT, GREECE ?! Yes, 3 percent unemployment rate !! Not sure you can stomach that, you damn dream killers with your defensive football that prevents me from winning this Euro bet contest !!<br/><br/>Aaaah, I feel better already. ;)','2012-06-17 21:40:18',2),(1299,0,1,'nicolas','Nico','Scoring error','0000-00-00','00:00:00','[Jun 17, 01:06] - Hm, it looks like the scoring for the last match didn\'t run.. I am working on it.','2012-06-17 20:50:52',1),(1300,1299,1,'nicolas','Nico','','0000-00-00','00:00:00','Fixed! Not sure what happened.','2012-06-17 20:50:52',0),(1301,1298,37,'rico','Americo','','0000-00-00','00:00:00','Well, Etienne, I know the defeat of your Russians hurts your pride (well, mine has suffered too, Netherlands out with 0 point, can you believe it), but in everything, there is always a SILVER LINING.<br/>We all know how crazy the Greeks are about football, so I am pretty sure that their morale and their fondness about Europe have been positively influenced by their 1-0 victory against the Russians (btw, these guys, when they win, it\'s always 1-0).<br/>And when you see that the pro-Euro conservative party won today\'s elections by only a 1% margin (only 40,000 voters in Greece - one stadium), it appears to me that football has changed the destiny of hundreds of millions of Europeans...  ','2012-06-17 21:05:00',0),(1302,1301,1,'nicolas','Nico','','0000-00-00','00:00:00','Hurray for football! ','2012-06-17 21:40:18',0),(1303,0,1,'nicolas','Nico','Rankings','0000-00-00','00:00:00','[Jun 18, 12:06] - Mile is ahead! And she had the kindness to remind me that she knows so much about football, she picked Iker Casillas as a top scorer! That says a lot about how the rest of us have performed so far!','2012-06-29 05:31:06',13),(1304,1216,11,'kimbel','pui pui','','0000-00-00','00:00:00','they call it The Riddle of Kharkiv! 3 losses after playing a world cup final! it seems that behind the scenes alot of the dutch players were fighting, throwing chairs, tables, scissors and injection needles! Sneijder stated that he was disgusted by his position he had to play at, he rather would like to have keep the system old skool than change the shit like this! Van Marwijk has a contract til 2016, so we\'ll see the same nothingness in Rio!','2012-06-18 19:53:57',0),(1305,1304,11,'kimbel','pui pui','','0000-00-00','00:00:00','a relative who was in the stadium at the HOL-GER game stated that Affelay and more players were completely out of condition, standing alot with their hands in their sides, so it was even worse than on television! anyhow, economical crisis in Holland; supermarkets and cafes out of bizniz, elections on september 12, out of euro! ','2012-06-18 19:57:55',0),(1306,0,11,'kimbel','pui pui','Bananotelli ou (Hou)Wel(le)beck(q)','0000-00-00','00:00:00','[Jun 18, 01:06] - what\'s more beautiful? behind the standing leg along, or a tumbling bicycle kick?','2012-06-25 21:31:40',3),(1307,1306,1,'nicolas','Nico','','0000-00-00','00:00:00','Balotelli\'s is very elegant as he is so balanced when he executes it, but Welbeck\'s is pure instinct, I find it more beautiful!','2012-06-18 23:20:33',0),(1308,1303,107,'przemek','Przemek','','0000-00-00','00:00:00','Seems to me that the new point system passed its exam :D','2012-06-19 00:33:35',0),(1309,1303,17,'derek','Derek','','0000-00-00','00:00:00','Mile is obviously trying to prove she can win without any points from predicting the top scorer.','2012-06-19 05:16:24',0),(1310,0,1,'nicolas','Nico','Penalties','0000-00-00','00:00:00','[Jun 19, 11:06] - Isn\'t it impressive that there has been no penalty yet? Not so many red or yellow cards either, right?','2012-06-20 08:16:49',4),(1311,1310,0,'','','','0000-00-00','00:00:00','Great competition too: goals for every game, right? <br/>','2012-06-19 19:35:31',0),(1312,0,39,'stephane','Stephane','Rules for the next bet (quarter final ...)  ?','0000-00-00','00:00:00','[Jun 19, 01:06] - If there is 0-0 at the end of the extended time and then, one team wins on penalties. What is the right bet ?','2012-06-19 20:59:05',1),(1313,1312,1,'nicolas','Nico','','0000-00-00','00:00:00','As always - you bet on the final winner. There can\'t be a tie between the teams, one of them has to win - no matter whether there is extra time or penalties.','2012-06-19 20:59:05',0),(1314,1311,11,'kimbel','pui pui','','0000-00-00','00:00:00','and even unrewarded ones! was the unrewarded Ukraine-goal off-side?','2012-06-19 21:08:51',0),(1315,0,39,'stephane','Stephane','The only good news for FRA','0000-00-00','00:00:00','[Jun 19, 02:06] - - being qualified (really deserved...? not sure with 1.5 good game in the first round)<br/>- Hugo Lloris<br/>- Philippe Mexes will miss the quarter final<br/>- Thierry Rolland did not see that game','2012-06-20 19:51:18',1),(1316,1314,1,'nicolas','Nico','','0000-00-00','00:00:00','I am actually surprised that coaches aren\'t saying anything about the referees... there were a few decisions whose outcome could have tipped a match over, and no one said anything after the match. Or maybe they did but I didn\'t read about it. Offsides, handballs...','2012-06-19 22:29:41',0),(1317,1310,107,'przemek','Przemek','','0000-00-00','00:00:00','There was a penalty kick during the opening game POL-GRE and the goalie saved it. Still, no goals from 11m is impressive.','2012-06-20 08:16:49',0),(1318,0,11,'kimbel','pui pui','ENG-ITA','0000-00-00','00:00:00','[Jun 20, 06:06] - a cracker on Sunday at midnite in Kiev! dont miss!','2012-06-20 13:08:24',0),(1319,1315,11,'kimbel','pui pui','','0000-00-00','00:00:00','LebLanc just stated something happened in the dressing room... Ribery hit another uppercut...Black&amp;LeBlue... in Paris yesterday just before the game, there was not one person wearing a blue shirt or carrying bottles of beer or cot comme un coq sportiv! I\'m sure Spain is trembling like grain in a storm de Biscaye! I need France in the final, would have been perfect to see Ribery against Robben, bah, helas!','2012-06-20 19:51:18',0),(1320,0,37,'rico','Americo','SURVEY : is there anyone in the forum who likes CR7?','0000-00-00','00:00:00','[Jun 21, 01:06] - Amazing talent, but everyone I know hates the guy...','2012-06-23 15:01:06',5),(1321,1320,39,'stephane','Stephane','','0000-00-00','00:00:00','I\'ll like him when he finishes top scorer of this tournament, leading him team to the final victory...','2012-06-21 21:03:10',0),(1322,1320,1,'nicolas','Nico','','0000-00-00','00:00:00','He\'s the reason I lost my bet: I thought Portugal was slightly better than the Czech Republic, but I really didn\'t want them to win. What annoys me is the combination \'high skills - technical and physical- that require no brain\', and no brain.','2012-06-22 03:27:59',0),(1323,1320,107,'przemek','Przemek','','0000-00-00','00:00:00','I love his football skills but hate his attitude on the pitch, if he could only stop diving and crying all around..','2012-06-22 12:22:45',0),(1324,0,9,'karine','Bou','Filming director','0000-00-00','00:00:00','[Jun 22, 12:06] - I really like the way this championship and the audience is filmed. You feel that whoever is directing it is really considering his job as an art. ','2012-06-24 19:41:18',3),(1325,1320,9,'karine','Bou','','0000-00-00','00:00:00','Yeah, i hate the guy. Portugal winning would not be so bad if he wasn\'t the one scoring. ','2012-06-22 19:57:16',0),(1326,1303,9,'karine','Bou','','0000-00-00','00:00:00','I don\'t think anybody can do scores like 11 or 13 anymore. I think that the top ranking will not change much. This way of distributing points i feel is the worse since we started this betting. Though, i have to admit that it was fun to see people getting 13 points at once!  Now however , it\' s  a little pointless. ','2012-06-22 20:04:03',0),(1327,1324,19,'sylvain','Patate Sauze','','0000-00-00','00:00:00','Si a t\'intresse, les cahiers du Foot (le meilleur site de foot de l\'univers) a fait une tude l-dessus :<br/><a href=\'http://tinyurl.com/7v9zryy\' target=\'new\'>http://tinyurl.com/7v9zryy</a><br/>','2012-06-23 01:09:44',0),(1328,1325,11,'kimbel','pui pui','','0000-00-00','00:00:00','<a href=\'http://www.julibri.nl/files/images/1666.jpg\' target=\'new\'>http://www.julibri.nl/files/images/1666.jpg</a>','2012-06-23 15:01:06',0),(1329,1327,1,'nicolas','Nico','','0000-00-00','00:00:00','Excellent!','2012-06-23 16:01:12',0),(1330,0,11,'kimbel','pui pui','Ressource toi!','0000-00-00','00:00:00','[Jun 23, 12:06] - <a href=\'http://www.youtube.com/watch?v=dWssk_Jw1Hs\' target=\'new\'>http://www.youtube.com/watch?v=dWssk_Jw1Hs</a>','2012-06-23 19:50:05',0),(1331,1326,8,'ranis','Ranis','','0000-00-00','00:00:00','Iker Casillas as top scorer... mon dieu!<br/><br/>I am trying to remember our previous point systems but hasn\'t it always been a bit lame in the last 7 games unless you are Top 10? What point system did we have that gave big opportunities towards the end?','2012-06-23 21:28:47',0),(1332,1307,8,'ranis','Ranis','','0000-00-00','00:00:00','I will go for Houllebeq (the real one, the one and only!) any day. For me, he should have played in the French squad by himself. He would not have needed more than 90 minutes to convince the Spanish that spending your whole life kicking a pointless ball is a complete waste of time, so they would\'ve left the pitch...','2012-06-23 21:33:32',0),(1333,0,8,'ranis','Ranis','predictability ita-eng','0000-00-00','00:00:00','[Jun 23, 02:06] - So far, the games of this championship have been embarrassingly easy to predict. Perhaps not always the score, but the play... and what do we have left, exciting teams like Spain, Portugal and England... zzzzzzzzz... no hero-teams in sight... <br/><br/>However, Italy-England is difficult. It could be anything from a boring 0-0 and penalties to one of the teams (probably Italy, who would\'ve thought...) pushing madly from the start, gearing up the adrenaline levels to maximum after 5 minutes and getting the whole game into end to end stuff. It feels like it could go either way, though my guess is unfortunately the 0-0 version.<br/><br/>','2012-06-24 21:46:54',6),(1334,1331,8,'ranis','Ranis','','0000-00-00','00:00:00','When Anita won in 2004 I think she came back from being No.30 or something after the groups...','2012-06-23 21:40:52',0),(1335,1326,1,'nicolas','Nico','','0000-00-00','00:00:00','The fact is that there are 4 matches left out of 31, so indeed it won\'t change much anymore. It will still change, though. Milie is ahead but has bet on Spain as a final winner whereas her competitors have bet on Germany. I haven\'t checked the top scorers picks but I have seen a few with Mario Gomez and he\'s likely to be it. We can\'t have a point system that is both fair and keeps the competition alive for most. There are a few with the same amount of correct bets, and the ones ahead are the ones who made moves that were both bold and successful. Isn\'t that fair that they are ahead?','2012-06-23 21:57:38',0),(1336,1335,8,'ranis','Ranis','','0000-00-00','00:00:00','One idea arising from my insomnia is to increase the amounts of alternatives in the final phase. Now there is only two alternatives so the score one will get is quite low, but instead of choosing between Win A or Win B, we could have 7 options - Win A 90 min / Win B 90 min / Win A Extra-time / Win B Extra-time / Win A Penalties / Win B Penalties / Houllenbecq convinces the players to quit and go to Pattaya instead. That way it would increase the points threefold (yet, still be \'fair\'?).','2012-06-24 00:48:20',0),(1337,1336,1,'nicolas','Nico','','0000-00-00','00:00:00','I like that! Even though, as the amount of points would increase (not necessarily 3-fold as the most likely scenarios remain win A/B - 90 min), the amount of people benefiting it would go down. But indeed, there would be the odd chance of winning a lot of points at once, which would keep the hopes of most up.','2012-06-24 03:40:27',0),(1338,1333,1,'nicolas','Nico','','0000-00-00','00:00:00','I hope England scores in the first 15 minutes. That is the only valid opening if we want a thrilling match.','2012-06-24 03:48:43',0),(1339,1336,1,'nicolas','Nico','','0000-00-00','00:00:00','Another way would be to change the coefficients for the second round: instead of 1.25, 1.5 and 2, we\'d take 2, 4 and 6 for instance. Anyone in favor?','2012-06-24 04:02:06',0),(1340,1339,8,'ranis','Ranis','','0000-00-00','00:00:00','I am in favour. To make it matter more towards the end is a good thing. Though, between you and me, seeing that it is only you and me on the forum right now, maybe we can wait until 2014, ok :) I dont mind the rankings to be veeery stagnant at the moment.','2012-06-24 09:05:07',0),(1341,1340,1,'nicolas','Nico','','0000-00-00','00:00:00','With you there! I am not sure that next time the race will be so clear-cut: you and Milie are safely there for the first two spots, but the 3rd place race is rather tight, and I think England-Italy will have a big impact. I am afraid I am following the same strategy as with Czech Republic - Portugal there.','2012-06-24 17:47:26',0),(1342,1341,9,'karine','Bou','','0000-00-00','00:00:00','You guys find it fair because you are ahead and milie has not bet money ;-)','2012-06-24 18:11:44',0),(1343,1327,9,'karine','Bou','','0000-00-00','00:00:00','Merci sylvano!','2012-06-24 19:41:18',0),(1344,1338,9,'karine','Bou','','0000-00-00','00:00:00','I am surprised more people voted for England! They are my only hope for a little more points. Go England!','2012-06-24 19:42:47',0),(1345,1338,11,'kimbel','pui pui','','0000-00-00','00:00:00','almost... terrific tension in classic Kyiv confrontation... Terry defending trustfully... Viper-Sniper Balotelli blasting away, but will miss his penalty... Cash-ley Cole at the leftwing controls... Right from the start offensive open and opportunistic... football is coming home... Rancoon Rooney says more \'fuck\' in 90 minutes than Tony Montana in 170... Welbeck philosophying his way into... Brits playing good outlet, building their new Atlantic Wall... 1Hart 1Love lets get 2gether and feel alright... 0-0','2012-06-24 19:43:51',0),(1346,1344,1,'nicolas','Nico','','0000-00-00','00:00:00','I thought Italy was more likely to win, too! I just didn\'t feel like betting on them. Had I known they\'d be the underdogs...','2012-06-24 21:35:12',0),(1347,1345,11,'kimbel','pui pui','','0000-00-00','00:00:00','vaffanculo! vai in culo! testa di merda! non mi rompere le palle, non mi scazzare i coglioni! Chistu picciotto  spacchiusu, Chista machina  spacchius! Vaffanculo a Lei, la sua moglie, e\' la sua madre. Lei e\' un cafone stronzo. Io non mangio in questo merdaio! Vada via in culo! che cazzo vuoi!  Hart should have known! Remember 2003! <a href=\'http://www.youtube.com/watch?v=trILHXaRnjg&amp;feature=related\' target=\'new\'>http://www.youtube.com/watch?v=trILHXaRnjg&amp;feature=related</a>','2012-06-24 21:44:10',0),(1348,1346,8,'ranis','Ranis','','0000-00-00','00:00:00','Seems as if everyone is so tactical in the betting that it is more tactical to be untactical...','2012-06-24 21:46:54',0),(1349,0,1,'nicolas','Nico','points','0000-00-00','00:00:00','[Jun 24 2012, 08:06] - Alright, time to poll the opinion before the last 3 matches. The next world cup takes place in Brazil. 48 group matches, then 8 matches, then quarters, semis, final &amp; third place match. I still think this point system, based on odds for the match, is better than the previous one. The question is: which coefficients to give the second round matches? If the first 48 matches have a coefficient of 1. What about 2 for the round of 16, 3 for the quarter finals, 5 for the semis, 8 for the final and 2 for the 3rd place match? That way, the sum of the coefficients for the second round is 48, too. I don\'t want to give too much for the second round as I don\'t want to make the first 48 matches unimportant. Every match counts!<br/>As for other options - extra time, penalty kicks... I can implement them but it will mean fantastic odds if someone bets on \'Italy winning after extra-time, no penalty kicks\' and wins. Any suggestions welcome of course!','2014-06-15 07:54:40',18),(1350,1349,7,'etienne','Etienne','','0000-00-00','00:00:00','Not an easy task ! Finding a \'\'fair\'\' system. I think you have done a wonderful job so far.<br/><br/>In this Euro, Milie is ahead, and that\'s what would have happened in any professional betting website (bwin, betclic, etc) : she found some good results (like many of us) + she predicted Denmark (against Holland) and Greece (against Russia). It would be unfair if she only had bet on the underdogs (which could be a strategy) but that\'s not the case. Had she bet only on the underdogs, she would have received good points with Denmark and Greece, but she would not be leading. It\'s like betting all the time against Nadal, Djokovic and Federer : it will bring me a nice amount of cash one day, but in the meantime I will lose a lot of money, and not sure that what I win later will compensate all my losses...<br/><br/>So, it\'s really difficult to prepare a fair system for the World Cup because you want to keep the suspense going in the ranking, even after the group games. And it\'s true that, with this \'\'odds\'\' system, it will be very tempting to bet for North Korea against Brazil : at worse you lose 1.3 points against the rest, and maybe you can get 18 points... BUT then everybody will do the same and Brazil will be the underdogs on our website ! :)<br/><br/>All in all, your suggestion here above sounds pretty good to me... but I did not think about it for 2 hours, I am sure other people have suggestions. ','2012-06-25 07:59:39',0),(1351,1332,37,'rico','Americo','','0000-00-00','00:00:00','Thank you Ranis for your Houellebecq jokes, my first laughters in this difficult-for-French-people(...again) Euro','2012-06-25 21:31:40',0),(1352,1350,37,'rico','Americo','','0000-00-00','00:00:00','Well, personally I had more fun in the old point system, in which you had to do your best prediction for all the games, and optimize your capital of points. Whereas in the new system, there is always a strong temptation to try to make a \'\'big score\'\' by betting for the underdogs, without other considerations...<br/>But actually, perhaps the problem is only me, and my too tactical betting mindset.<br/>So I suggest a survey \'\'Old System ++, Old System+, neutral, New Systme +, new System ++\'\': <br/>my vote &gt; Old System ++...<br/><br/>anyone else to vote? ','2012-06-25 21:37:21',0),(1353,1352,37,'rico','Americo','','0000-00-00','00:00:00','Sorry the window didn\'t capture the \'\'plus\'\' sign, so for the vote, I would propose 5 categories:<br/>-Old System Plus Plus<br/>-Old System Plus<br/>-Neutral<br/>-New System Plus<br/>-New System Plus Plus\'\'<br/><br/>My vote goes for \'\'Old System Plus Plus\'\',<br/>but OK Ranis, I know you go for \'\'New System Plus Plus\'\', since you love being on top for the first time...','2012-06-25 21:42:04',0),(1354,1353,107,'przemek','Przemek','','0000-00-00','00:00:00','Old System Plus Plus all the way baby!','2012-06-25 23:55:21',0),(1355,1352,1,'nicolas','Nico','','0000-00-00','00:00:00','I\'d say New System ++ (I am also testing whether this will fix the display of the + sign).<br/>The old system seems like a smarter one: the more confident you are on the outcome of a game, the more tokens you bet. But in the end, no one really knows who is ahead and who is not. I had stats like \'remaining tokens\', \'tokens per correct pick\', \'tokens lost per incorrect pick\', and who is winning is someone who does well on the last two. The remaining tokens give an idea of the potential change, which of course can mean anything.<br/>So whether you win or you lose, you are not sure of what happens during the whole tournament. <br/>I like the odds system because what you get is associated with the risk you take. If there are 40 players, 40 points will be distributed among the winners of the bet. No tomfoolery there! :)','2012-06-26 15:25:18',0),(1356,1355,1,'nicolas','Nico','','0000-00-00','00:00:00','Ok, fixed!','2012-06-26 15:35:31',0),(1357,1352,19,'sylvain','Patate Sauze','','0000-00-00','00:00:00','New System ++. I\'ve always found old system too complicated...  ','2012-06-26 19:40:36',0),(1358,1357,27,'augustin','Gugusse','','0000-00-00','00:00:00','ouaiiis pareil. Chuis d\'accord avec Serge pour les coeffs.<br/><br/>Bises les turfistes.','2012-06-27 13:02:16',0),(1359,0,27,'augustin','Gugusse','History','0000-00-00','00:00:00','[Jun 27, 06:06] - By the way, would it be possible to have our position in rankings 2004-2010 ? I would like to know if that UEFA Championship is my worst bets ever !','2012-06-27 15:33:01',1),(1360,1359,1,'nicolas','Nico','','0000-00-00','00:00:00','I\'ll try and do that. The difficulty resides in finding the data: it is on a hard drive somewhere (not sure), but I need to find it. And today we are driving to San Francisco (stopping at Santa Barbara on the way), so I hope my RSS Feed provider will not fail me so that the rankings update properly.','2012-06-27 15:33:01',0),(1361,0,11,'kimbel','pui pui','Iberian derby','0000-00-00','00:00:00','[Jun 27, 01:06] - well, that was rubbish! only 1 shot on target! 8 yellow cards! are they working for it? winning squad in the final gets 300.000 Ukrainian euros per player TAX FREE!!! Iker on penalties... lets watch!','2012-06-28 17:35:34',3),(1362,1355,9,'karine','Bou','','0000-00-00','00:00:00','I vote old system++','2012-06-27 21:19:50',0),(1363,1361,39,'stephane','Stephane','','0000-00-00','00:00:00','I saw great football, with 2 teams willing to score, and defending in front of the adverse goal-keeper.<br/>No doubt, great teams, great individual &amp; collective skills...<br/>Long time since I saw a football game with 2 teams at this high level at the same time','2012-06-27 21:38:37',0),(1364,1349,42,'mache','Mache','','0000-00-00','00:00:00','my first and last post this year... some background information:<br/>although I was 1.5 hours early in the airport, I managed to miss the flight (hands up who is more ridiculous than me). So now I\'m stuck in a cheap hotel, and because of my romanian raising(nothing should be wasted) I had to drink the entire bottle of Frascati wine which I bought from the airport and which for some stupid EU regulations reasons could not pass the security check tomorrow morning.<br/><br/>...you should invent a system where everybody is a winner. In fact I think it\'s quite simple if there is no money involved, you just show a fake ranking to everybody. I\'m too drunk to imagine a system that works even when money is involved, but maybe you can invent something. Or maybe Zita knows some tricks... ','2012-06-27 22:09:22',0),(1365,1361,1,'nicolas','Nico','','0000-00-00','00:00:00','Portugal should have won. I missed the second half but from the first half, Spain wasn\'t playing better than Portugal, and they are the better team, so they didn\'t deserve to win so much as Portugal. And yes, I cheered for Portugal, as I realized that I had sympathy for the 10 teammates of CR7.','2012-06-27 23:50:22',0),(1366,1364,1,'nicolas','Nico','','0000-00-00','00:00:00','Drink some more, Mache! I feel this is going somewhere.','2012-06-27 23:50:51',0),(1367,1304,11,'kimbel','pui pui','','0000-00-00','00:00:00','it\'s official: Holland coach Van Marwijk got the sack! Orange will have a brand new team and coach before August! <a href=\'http://www.artikel255.nl/2012/06/do-not-care-in-stadium.html\' target=\'new\'>http://www.artikel255.nl/2012/06/do-not-care-in-stadium.html</a>','2012-06-28 13:19:29',0),(1368,1366,66,'anders','Friberg','','0000-00-00','00:00:00','I like your idea, Nico. sounds fine to me. I still think there should be more options in the play-off, maybe 4 options is enough - Win A 90 / Win B 90 / Win A x-time / Win B x-time, or 3 options, Win A, Win B or draw ? Now, when it is only 2 options, it is less exciting.<br/><br/>Another thing that could be improved is the fact that in the play-offs more and more people stop betting on what they believe but instead tactically to be happy to catch a surprise. So many people do it that in the end the odds don\'t make a big difference. But I am too hangover to come up with an idea on how to adjust this...','2012-06-28 17:30:59',0),(1369,1365,66,'anders','Friberg','','0000-00-00','00:00:00','The teams were good but the entertainment in the end still became really low. At the bar where we were watching, half of the people left after 90 min and some were even angry about the lack of real chances and excitement. Sure, the teams are packed with great skills but this is clearly not enough.<br/><br/>Though, Spain looks a bit more human this time around. I always thought that Germany will win unless they meet Spain. Now they will probably meet Spain but I am increasingly optimistic that Germany actually could win this time, but it will be a thriller... unless Italy spoils the party, though it seems unlikely.','2012-06-28 17:35:34',0),(1370,0,11,'kimbel','pui pui','SUPER MARIO CLASSIC','0000-00-00','00:00:00','[Jun 28, 11:06] - SUPER MARIO B (in the blue jersey) vs SUPER MARIO G (in the white jersey) <a href=\'http://www.youtube.com/watch?v=eEbRegeZrTI&amp;feature=related\' target=\'new\'>http://www.youtube.com/watch?v=eEbRegeZrTI&amp;feature=related</a>','2012-06-28 20:41:44',3),(1371,1370,27,'augustin','Gugusse','','0000-00-00','00:00:00','First half : seems That B si winning','2012-06-28 19:48:08',0),(1372,1371,17,'derek','Derek','','0000-00-00','00:00:00','So, how many games has Italy actually won to get to this point?  One?','2012-06-28 20:24:54',0),(1373,1372,11,'kimbel','pui pui','','0000-00-00','00:00:00','Did Germany ever won from Italia in a decider? HE IS BANANOTELLI, and he knows it! el esto es final!','2012-06-28 20:41:44',0),(1374,0,27,'augustin','Gugusse','Milie !!','0000-00-00','00:00:00','[Jun 28, 01:06] - Allleeeeeez Milie ! Le champ est libre !!<br/>J\'espre que t\'as particip au pot !','2012-07-02 17:42:06',3),(1375,1326,1,'nicolas','Nico','','0000-00-00','00:00:00','Now there was a good opportunity to get points, with Italy against Germany! That would have changed the rankings somewhat.','2012-06-29 05:31:06',0),(1376,1368,8,'ranis','Ranis','','0000-00-00','00:00:00','fyi, The above was written by Ranis. Didnt notice that Friberg had logged in to my computer.','2012-06-29 08:24:06',0),(1377,1368,1,'nicolas','Nico','','0000-00-00','00:00:00','I think the only way to resolve this is to increase the coefficients in the second stage - so that most have a fair chance of being in the top three still, if they do it right; and cap the maximum amount of points to 10 or 15, so that no one is tempted to do a \'hail mary\'. ','2012-06-29 15:58:19',0),(1378,0,1,'nicolas','Nico','Balotelli','0000-00-00','00:00:00','[Jul 01, 08:07] - <a href=\'http://a2.sphotos.ak.fbcdn.net/hphotos-ak-snc7/292414_331957063551081_1403075373_n.jpg\' target=\'new\'>http://a2.sphotos.ak.fbcdn.net/hphotos-ak-snc7/292414_331957063551081_1403075373_n.jpg</a>','2012-07-02 08:04:14',2),(1379,1378,7,'etienne','Etienne','','0000-00-00','00:00:00','Splendid :)','2012-07-01 18:34:30',0),(1380,1374,19,'sylvain','Patate Sauze','','0000-00-00','00:00:00','Bravo Milie !!!','2012-07-01 21:13:16',0),(1381,0,11,'kimbel','pui pui','