ten them, if you had picked him...you picked JuanFran Torres!','2012-07-02 23:29:58',0),(1390,1389,9,'karine','Bou','','0000-00-00','00:00:00','But I thought it was Fernando Torres ! I only know one of them ! I thought his first name was weird but never imagined it could be another one. <br/>I\'ll award my points in my head then because that was my intention and it does not change anything anyway !<br/>','2012-07-04 12:50:31',0),(1391,1382,1,'nicolas','Nico','','0000-00-00','00:00:00','Actually he is the ONLY top scorer for the Euro 2012, according to the UEFA, so I will change the list and re-count the points.<br/>And Karine, one would think that you don\'t deserve to get the points if you don\'t know your top scorer\'s first name ;)... but I can correct that if you want!','2012-07-04 15:14:02',0),(1403,1400,1,'nicolas','Nico','','0000-00-00','00:00:00','Actually I\'ve left the old posts from the Euro 2012... this is such glorious litterature...','2014-05-14 16:49:09',0),(1404,0,39,'stephane','Stephane','Greek &amp; Russians Players - for French speaking people','0000-00-00','00:00:00','[May 14, 12:05] - Je rigole encore de mon post d\'il y a 2 ans en le relisant<br/><br/>GREECE<br/>Jabitanis, Inptipastis, jabitpahanis, deuptipastis, interstis, cetuneviktoirfactis, maseurabitanis, unotrepastis, to be completis...<br/><br/>RUSSIA<br/>jetiralacarabin, jenculpoutin, cebonlemandarin, mepaleclemetin, paskiatrodpepin, jesuifilosov, celapoukifilosov, to be completov','2014-05-14 19:05:18',0),(1400,0,7,'etienne','Etienne','Testouille','0000-00-00','00:00:00','[May 11, 10:05] - As a beta tester I am placing the FIRST message on the Forum and I feel f****g proud!','2014-05-14 16:49:09',2),(1401,1400,27,'augustin','Gugusse','','0000-00-00','00:00:00','DEUZE !!<br/><br/>Merci Nico ! <br/>Je perdais pas assez de temps comme a, BISOUS','2014-05-12 09:34:36',0),(1402,0,1,'nicolas','Nico','the Nasri case ','0000-00-00','00:00:00','[May 14, 09:05] - I\'ve read that Nasri was playing well for City; and yet the French coach, Didier Deschamps, has not included him in the French squad. <br/>Personally, I trust Deschamps. I like Nasri, I think he\'s a great player, but if he does not fit with the team, because he does not get along with other players, then it makes sense to leave him out. What do you think?','2014-05-14 19:12:22',1),(1405,1402,39,'stephane','Stephane','','0000-00-00','00:00:00','I agree<br/>So glad Nasri will watch the WC on TV<br/>Would have appreciated that Evra sit on the same couch during this WC...<br/><br/>I saw that Tevez is not in the Argentinian squad. Lavezzi and Higuain preferred to Tevez ??<br/>Franco di Santo also (Werder Breme) ? Who knows him (except his mother) ?','2014-05-14 19:12:22',0),(1406,0,1,'nicolas','Nico','Timezones','0000-00-00','00:00:00','[May 20, 02:05] - I have added a timezone field to your profile, so that you can get matches times for your zone. I have set timezones for you, but I have often had to guess... so if the timezone is not correct, please go to your profile-&gt;edit and change it.<br/><br/>So far we have people located in North America, Europe, Asia, and New-Zealand...but there is at least one Argentine among us, so South America is also represented. ','2014-05-20 21:21:17',0),(1407,0,8,'ranis','Ranis','Party starts soon!!!','0000-00-00','00:00:00','[Jun 06, 02:06] - Greetings Earthlings!<br/>I am really first on the forum, what an honor!<br/>I don\'t really have much to say, newly awaken as I am, but I know this... I am TOTALLY looking forward to this feast! It is gonna be so much fun, so great - YEAH!!!<br/>I have forgotten all about last WC. This one will be as a WC should :)','2014-06-06 23:24:09',2),(1408,0,8,'ranis','Ranis','Italy - now the big favorite!','0000-00-00','00:00:00','[Jun 06, 02:06] - Everyone knows the inevitable fact, the slower Italy starts the more dangerous will they get...<br/><br/>So what happened last night in the friendlies? They play 1-1, against.... LUXEMBOURG!!<br/><br/>The warning flags in the football world were passed on like sour soup.<br/><br/>Italy is looking sharper than ever!','2014-06-06 09:11:49',0),(1409,1407,8,'ranis','Ranis','','0000-00-00','00:00:00','WOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOOWWWWWWWWEEEEEEEEEE!!!!!<br/>PARTYYYYYYYYYYYYYYYY!!!!<br/>(when reading this, picture some guy from the muppet show and you will get it, probably Kermit)<br/><br/>This reply was simply to see if it replying works.','2014-06-06 09:14:06',0),(1410,1407,1,'nicolas','Nico','','0000-00-00','00:00:00','Ranis, I was getting worried. Glad to see you are warming up!','2014-06-06 23:24:09',0),(1411,0,1,'nicolas','Nico','Ribry out - good or bad?','0000-00-00','00:00:00','[Jun 06, 04:06] - I like Ribry - I think he\'s a great player and he often made a difference, turning ties into wins.<br/>On the other hand, France needs to play as a team... we rely too much on individual talents. So I don\'t think it\'s that bad that Ribry is out, maybe they will actually get more confident by playing together.','2014-06-08 15:14:08',5),(1412,1411,8,'ranis','Ranis','','0000-00-00','00:00:00','And Reus... plus Suarez &amp; Ronaldo are injured. Falcao already gone... pity<br/><br/>Isn\'t Ribery one of those players that doesn\'t really help a \'\'good atmosphere\'\'?','2014-06-07 21:26:31',0),(1413,0,8,'ranis','Ranis','early signs','0000-00-00','00:00:00','[Jun 07, 02:06] - For all superstitious people... here is a present for you:<br/><br/>Tonight, the friendly England-Honduras was interrupted for 30 min due to lightning, and friendly Belgium-Tunisia was interrupted for 40 min due to a hail storm with ping pong ball sized hail (the player to last leave the pitch was... you guessed it... Fellaini :)<br/><br/>What do you make out of that!? (apart from that it is beneficial having an inbuilt airbag on top of your head when it is hailing) ','2014-06-07 21:31:18',0),(1414,1412,8,'ranis','Ranis','','0000-00-00','00:00:00','(ESPN\'s prediction of France:)<br/><br/>How far will France go? <br/><br/>All we can be certain of is they will cross the Atlantic. Going farther than that depends on Deschamps keeping his squad together.','2014-06-07 21:53:08',0),(1415,1414,8,'ranis','Ranis','','0000-00-00','00:00:00','Right now I\'m watching the game... sorry, BATTLE between England-Honduras...<br/><br/>Better tell the French players to borrow some hockey gear, knee pads, helmets etc. PLayers are lying down more often than passing the ball, it is a miracle that no one is injured for life (yet). Only one red card.','2014-06-07 23:05:54',0),(1416,1415,1,'nicolas','Nico','','0000-00-00','00:00:00','Yes they aren\'t choir boys... I am hoping referees will act quickly and calm them down.','2014-06-08 02:48:40',0),(1417,1412,1,'nicolas','Nico','','0000-00-00','00:00:00','Maybe Suarez will play, though, who knows. I wanted to write that I wouldn\'t miss Ronaldo, but he has such an odd combination of super skills and super idiocy, it\'s almost worth having him.','2014-06-08 15:14:08',0),(1418,0,8,'ranis','Ranis','Men in blazers','0000-00-00','00:00:00','[Jun 09, 11:06] - Bonjour froglovers!<br/><br/>For all you froggies that can\'t wait to see some Hondurans break some french legs, this might cheer you up - <br/><a href=\'http://www.youtube.com/watch?v=JMcv2yD4Xjg&amp;index=17&amp;list=PLQK6nu7nx46zRn3v89fNFHh8ogW3YmLfI\' target=\'new\'>http://www.youtube.com/watch?v=JMcv2yD4Xjg&amp;index=17&amp;list=PLQK6nu7nx46zRn3v89fNFHh8ogW3YmLfI</a><br/><br/>It is quite a nice you tube series on the World Cup and good tips for you who need good tips for your tips.','2014-06-09 20:08:52',2),(1419,1418,37,'rico','Americo','','0000-00-00','00:00:00','Super cool. Let\'s hope the men in blazers get it right...<br/><br/>Merci Ranis.','2014-06-09 20:01:54',0),(1420,1419,37,'rico','Americo','','0000-00-00','00:00:00','Hey btw, Ranis, when will you publish your traditional \'\'end-to-end WC prediction message\'\'?<br/>You may have it all right this time...','2014-06-09 20:08:52',0),(1421,0,8,'ranis','Ranis','Favorite team','0000-00-00','00:00:00','[Jun 09, 01:06] - Nico, here is an idea for a new feature if you have the time. I would like to know which team people are cheering for (among the teams in WC),and also the second favorite team (and/or third?). It would be cool to see where people\'s sympathies lay. <br/><br/>I guess Belgium is pretty high up this time for instance. Perhaps Bosnia, Chile...? But I am just guessing.','2014-06-10 17:26:26',3),(1422,1421,1,'nicolas','Nico','','0000-00-00','00:00:00','Indeed that would be a nice feature! Currently, the \'final winner\' will be displayed next to the player\'s name in the rankings, once the matches have started. I could add a second one... if I have time I\'ll do it (we are in the process of moving to Pennsylvania).','2014-06-09 22:09:58',0),(1423,1422,8,'ranis','Ranis','','0000-00-00','00:00:00','And where in Pennsylvania might that be? I will be brushing it September.','2014-06-10 08:45:00',0),(1424,0,8,'ranis','Ranis','me, the winner?','0000-00-00','00:00:00','[Jun 10, 04:06] - Nico, didn\'t I win the money pool last time or do I remember incorrect?','2014-06-10 17:28:42',2),(1425,1424,107,'przemek','Przemek','','0000-00-00','00:00:00','Nope mate, I am pretty sure you are dead wrong. If my memory serves me right, it was me who won the Euro 2012 money pool. Can this be checked and confirmed please? :-)','2014-06-10 17:05:29',0),(1426,1423,1,'nicolas','Nico','','0000-00-00','00:00:00','State college... Which is almost exactly in the middle of nowhere. It\'s mostly academics who wander through these parts of the woods... But you would be must welcome!','2014-06-10 17:26:26',0),(1427,1425,1,'nicolas','Nico','','0000-00-00','00:00:00','I vaguely remember it was not me. Maybe it was Liesbeth? I\'ll check,  there are remnants of that website on the server.','2014-06-10 17:28:42',0),(1428,0,38,'arnaud_c','Arnolito','Bookie','0000-00-00','00:00:00','[Jun 11, 04:06] - Wait, didn\'t we use to have the odds in front of the game before the bets were closed? Or was it only once bets were closed and games started? I am looking for a coup or two.','2014-06-11 13:42:36',1),(1429,1428,1,'nicolas','Nico','','0000-00-00','00:00:00','They show once the game is started. The added uncertainty should encourage you to play with your gut :)','2014-06-11 13:42:36',0),(1430,0,8,'ranis','Ranis','----- The SUPER-prediction -----','0000-00-00','00:00:00','[Jun 11, 10:06] - (sound FX  drum roll....)<br/><br/>Hence... The SUPER-Prediction !!!<br/><br/>(sound FX  beautiful people being in awe, as when God transcends from the sky... oooooooohh....)<br/><br/>It is an unread, unwanted and repeatedly forgotten tradition that I make an ambitious forecast of the ENTIRE Cup, so - ... here it is!!!<br/><br/>You can think of me much as the family father who holds his traditional grand speech on the family\'s chronicle every New Years Eve. Though I am in fact telling you  how things happened even BEFORE they happened, plus I have a much bigger cock than him.<br/><br/>Almost no one asks me...  why does he do it? <br/><br/>Well... I will tell you...<br/><br/>Right now I am reading a book which is called (ironically) a lady-novel by the female author herself. She explains in the book that a lady-novel is about women\'s dreams of being a princess for one day in their lives. Well, I am a man and we dream of becoming a genius for one day. And, when the super-prediction will come true, you will have no choice but to call me a genius, ha, ha, ha... (sound FX  manical laughter and a choking kitten)<br/><br/>For all you people who have better things to do with your lives but for some reason can\'t stop staring at the screen, here follows the short summary:<br/><br/>FINAL:<br/>Brazil-Argentina 2-0<br/><br/>3rd price:<br/>Uruguay-Germany 2-1<br/><br/>Surprise packages: No one really, but Switzerland will reach the quarterfinals without anyone really paying attention, much like Ukraine went to quarters in 2006.<br/><br/>Big teams going out in groups: Netherlands, Italy. Russia<br/><br/>I have divided this thread in many different posts. Feel free to bookmark all of them.<br/>(jokes end here, only football from now on... seriously)<br/>','2014-06-12 11:12:30',13),(1431,1430,8,'ranis','Ranis','','0000-00-00','00:00:00','Group A <br/><br/>Croatia and Mexico might end up on top of the list of least memorable teams from this World Cup. A year from now, people will ask did Mexico really qualify, can\'t remember. Croatia will only be remembered for the opening game. They have a  new coach with no experience and will feel awkward in Brazil, they will do a decent first game but loose anyway. Cameroon will be a surprise 2nd. It will be over even before the last games as Cameroon will beat first Mexico and then Croatia. Cameroon are flying under the radar, they have stronger player than people think and they will feel more at home in Brazil than the others. Mexico seems to have been really crap in the build-up and go with shit confidence.<br/><br/>1. BRA 2. CAM 3. MEX 4. CRO<br/>Bra-Cro 2-0, Mex  Cam 0-2, Bra-Mex 4-0, Cro-Cam 1-3, Bra-Cam 1-0, Mex-Cro 2-1<br/><br/>Group B<br/><br/>The World Cup final replay Spain-Netherlands will be exactly as boring as everyone expects. Spain will win 1-0 and make it look like nothing happened in 4 years. The crunch of the group will come down to one single game  NL-Chile, and here is where the changes will take place. Van Gaal, with an uneven squad and his mind on Manchester United, won\'t manage to prevent Chile from showing that they are an upcoming football power. This will be the World Cup that re-defines Netherlands and Chile\'s status. A week after that game people will wonder which team was the 4th one.<br/><br/>1. SPA 2. CHI 3. NL 4. AUS<br/>ESP-NED 1-0, CHI-AUS 3-1, Esp-CHI 2-0, NED-AUS 4-1, NED-CHI 1-3, ESP-AUS 0-0<br/>','2014-06-11 17:02:54',0),(1432,1431,8,'ranis','Ranis','','0000-00-00','00:00:00','Group C<br/><br/>Amazingly tight group, especially since Colombia is overrated and Greece as always underrated, Japan as always overachievers and Ivory Coast underachievers. People might be surprised when Japan will beat Ivory Coast due to the known Japanese skills  organization and hard work. Ivory Coast will hate playing Japan, they have all the pressure and won\'t know how to deal with a fiersome Japan (it always feels as if the Asian teams have prepared for so much longer than everyone else). Ivory Coast even had a hard time beating North Korea in 2010 and Japan played well in Confederation Cup last year. IC will enter the cup on a bad foot and not get a chance to recover. Drogba is has-been and have too much influence. Japan will run out of steam towards the end and lose big to Colombia in the last game, whereby Colombia win the group.<br/><br/>1. COL 2. JPN 3. GRE 4. IC<br/>COL-GRE 0-0, IVO-JPN  0-1, Col-IVO 3-3, JPN-GRE 1-1, COL-JPN 3-0, IVO-GRE 1-1<br/><br/>Group D<br/><br/>It starts with the most likely 0-0 game ever in history of football  England-Italy. Both teams want desperately not to lose, that\'s all that matters and they are good at it. What mostly decided this group was the draw on who will meet Costa Rica when. England has the upper hand as they meet CR last, which means that all they have to do is draw in the first two games (a Roy Hodgson speciality) and then do an insane attack against a CR who by then is already out of the group. Costa Rica will lose big to Uruguay, then make a decent effort against Italy as a last attempt and since Italy won\'t be able to beat Uruguay, simply because Uruguay has so much more stamina than Italy, it is another group exit for Italy.<br/><br/>1. URU 2. ENG 3. ITA 4. CR<br/>ENG-ITA 0-0, URU-COS 3-0, ENG-URU 0-0, ITA-COS 3-2, ENG-COS 4-1, ITA-URU 1-2<br/>','2014-06-11 17:03:11',0),(1433,1432,8,'ranis','Ranis','','0000-00-00','00:00:00','Group E<br/><br/>France will scrape through this group without impressing much as they did in 2006. Their opening game against Honduras should be a thriller as Honduras will be after breaking bones, which will be the only entertaining event in this group. It should be entertaining in a red-card grudgy kind of way. Ecuador seems to be uncapable to deal with playing at a normal altitude so out they go. Switzerland will win the group without really understanding how it happened. France will play 0-0 against both Suisse and Ecuador.<br/><br/>1. SWI 2. FRA 3. HON 4. ECUA<br/>SCH-ECU 2-1, FRA-HON 1-0, SCH-FRA 0-0, ECU-HON 1-2, SCH-HON 2-0, FRA-ECU 0-0<br/><br/>Group F<br/><br/>Wouldn\'t it be great to see a country like Bosnia go really far? I have been there and I really like the Bosnians, so much enthusiasm to hear about what\'s outside of their country, very friendly, cheerful, totally into their teams. Go Bosnia! They will come last in the group. Here is how it will (unfortunately) go down. The draw is against them, the first game is Argentina at the legendary (and huge and imposing) stadium Maracana. This is a tough WC debut for anyone. Argentina will be very eager to show their abilities this time and it will simply be too much for the poor Bosnians. 3-0. Findign their balance will be next to impossible. <br/><br/>At the same time, Nigeria, who seems like a great side at present (won Africans Cup, they have a domestic coach and balanced squad) will crush Iran 3-0. Second round is Nigeria-Bosnia so all of a sudden all the pressure is on Bosnia, they have to beat Nigeria who impressed everyone in the first round. Once again, it\'s too much for the Bosnians, when they will concede the first goal they will feel slight panic and from there it is just bitter disappointment. The dream turning into a nothingness. On top of this Iran will see their chance to snatch a three-pointer in the last game. Sorry. Bye bye Bosnia!<br/>1. ARG 2. NIG 3. IRAN 4. BOS<br/>BOS-ARG 0-3, IRN-NIG 0-3, IRN-ARG 0-4, NIG-BOS 3-1, NIG-ARG 1-1, ','2014-06-11 17:03:58',0),(1434,1433,8,'ranis','Ranis','','0000-00-00','00:00:00','Group G<br/><br/>Germany has looked a bit shaky so they will need a game or two to get into it. Thus the draw in the opening game to Portugal with Ronaldo being in an exceptionally good form as always. Ghana has beaten USA in the last 2 World Cups and looked good in friendlies, that is why USA will shock them with a fighting game. Ghana will be stunned and USA will win on fighting spirit. Germany will look better and crush Ghana in second game whilst USA will be a bit exhausted from the Ghana-revenge and lose to a focused Portugal.  <br/><br/>1. GER 2. POR 3. USA 4. GHA <br/>GER-POR 2-2, GHA-USA 1-2, GER-GHA 5-0, POR-USA 2-0, GER-USA 2-0, POR-GHA 0-0<br/><br/>Group H<br/><br/>Belgium, perhaps the most interesting team this year. They are strong enough to win, which they won\'t, but they will be very focused and win the group. Start out a bit nervous and barely win to Algeria 1-0, but then loosen up. The main surprise will be that Russia will lose to South Korea and never find themselves again. Looking at Russia\'s away record in qualifications, it is quite poor. Can you seriously see Russia travel to Brazil and deliver? Then as arrogant Capello is incompetent to turn his player around Russia will become a failure and the rest of the world will smear.<br/><br/>1. BEL 2. S.KOR 3. RUS 4. ALG<br/>BEL-ALG 1-0, RYS-SYDK 1-2, BEL-RYS 1-1, ALG-SYDK 0-0, BEL-SYDK 5-2, RYS-ALG 0-0<br/>','2014-06-11 17:04:15',0),(1435,1434,8,'ranis','Ranis','','0000-00-00','00:00:00','8th FINALS<br/><br/>Switzerland and Nigeria will be happy to meet each other. Very defensive and boring Switzerland will keep a creative Nigeria at bay and win the penalties. England, who impressed no one in 15 years, will succumb to the usual  domestic pressure. They will underachieve and lose to a fiercer and more creative Colombia. Easy wins for Brazil (-Chile), Germany (-South Korea), Spain (-Cameroon), Uruguay (-Japan, and this will be the game where one of the Uruguayan strikers will claim the golden boot as Suarez or Cavani will play around with the confused Japanese defense 5-0).<br/><br/>The thrillers will be Argentina-France and Belgium-Portugal. Very tight games and all of a sudden (as in 2006) France will come to life after a poor group. Difference though being that France these days are a much lesser team, and Argentina is not, so in spite of a heroic game by France, Argentina will edge them out. The French team is bereft of confidence so being the underdog is something that they can do but when it comes to a WC play-off game, they won\'t hold all the way and lose in extra time. Je suis desole (though not really)...<br/><br/>A similar scenario is expected in Belgium-Portugal. Two very close teams. Portugal\'s experience will see them through. The difference is that Portugal will never be happy with an 8th final, while Belgium doesn\'t really know what they can be happy with or not. In the end of the game, this difference will show in penalties when everyone is exhausted but Portugal still not content. Keep in mind that Belgium is a possession team that has had difficulty scoring, this is very Portugal-friendly.<br/><br/>BRA-CHI 4-2, COL-ENG 2-1, SCH-NIG 0-0 p 4-2, GER-SYDK 3-1, SPA-CAME 1-0, URU-JPN 5-0, ARG-FRA 2-2 x 3-2, BEL-POR 0-0 p 2-4<br/>','2014-06-11 17:04:36',0),(1436,1435,8,'ranis','Ranis','','0000-00-00','00:00:00','Quarterfinals<br/><br/>Up until now Spain has looked like a copy of 2010 - uninspired, boring, ball-obssessive, 1-0 winning... zzzzz... But it ends here cause it is actually true what they say, Spain is not what they used to be, they are one level lower and that will be a juicy bite for a driven, powerful and hungry team such as Uruguay. They will fight down the Spanish. Keep in mind that Spain has motivational problems. The squad is pretty much the same as have already won everything. This will not show in the beginning as they are determined to not show this but it is the case, especially after 3-4 weeks of tournament this will start to tear. They have already proven themselves, they don\'t need to do it again, whereas Uruguay has all to prove and have the players to do it too. Spanish era ends here. SPA-URU 1-3<br/><br/>Argentina and Portugal will come out of exhausting 8th finals. Ronaldo will be so desperate to prove himself better than Messi that he will overdo it. This is where Argentina will step up to show that they are really a capable world class team, as oppose to Portugal. This is the game that defines Argentina\'s World Cup. Portugal will fight well but when it comes to the crunch, they will have problem scoring as always when Ronaldo is not on top.<br/><br/>Brazil (-Colombia) and Germany (-Switzerland) will have easy cruising to their semifinals and looking in good shape, gearing up for the big clash. Sure, Switzerland and Colombia will fight hard to overcome their inferiority complex and handsome neighbours but here is where player quality will show. You don\'t get sloppy in a World Cup quarterfinal. There isn\'t just any way that Brazil and Germany could NOT meet in the semifinal on 8th June in Belo Horizonte.<br/><br/>BRA-COL 4-0, SCH-GER 2-4, SPA  URU 1-3, ARG-POR 2-1<br/>','2014-06-11 17:04:52',0),(1437,1436,8,'ranis','Ranis','','0000-00-00','00:00:00','Semifinals<br/><br/>Joachim Low\'s Germany has shown a weakness at this precise stage of the major tournaments four times in a row now. They rock through the group and look amazing and vibrant, playing their own beautiful game. Then comes a tough opponent in a semi or final and for some odd reason, Germany stop playing their game and adjust to their opponent. They make themselves weaker than they are. Same thing will happen here and here is where the German association will finally get it and get rid of their nose-picking coach. He does not have what it takes to make his player take that final step. Also, Germany lacks that old slugger Olli Kahn, Matthaus, Ballack type player. That guy that just never bend. Schweinsteiger is ok, but apart from that they are all too cute. They will need it here. Brazil will control the game, look the better team and win even though it will be tight.<br/><br/>Argentina-Uruguay will be a real slugger game, neighbor-rivals as they are. A crushing 0-0 with injuries and cards stacking up. In the same way that Portugal willl beat Belgium, by just not being too content in the last minutes of an exhausting 120 minute game in the end of a long tournament, will Argentina win on extra time. Argentina just simply can NOT lose to Uruguay in a WC semi, it is not allowed. While Uruguay can be pretty happy anyway with a semi.<br/><br/>BRA-GER 1-0, URU  ARG 0-0 ext 0-2<br/><br/>Uruguay will revenge Germany in 3rd final. Germany will look beaten and hopeless.<br/><br/>URU  GER 2-1, BRA  ARG 2-0<br/>','2014-06-11 17:05:10',0),(1438,1437,8,'ranis','Ranis','','0000-00-00','00:00:00','Final<br/><br/>I realised with clarity how the final will play out when I saw that it is Messi that is made captain of Argentina. Rarely have I heard about a player lesser suitable to lead on his team. To lead on their attack, sure, but the team...? He is 26 years and 1,40 cm, what the hell kind of authority is that on a pitch. He has no persona at all for a captain. Gattuso, who is 1,42 cm, would have made a good captain at 26, but Messi... A captain should be a leader who will keep his team tight, know when to yell at a player who needs to be yelled at, know when to cheer someone up, know how to squeeze that last drop of sweat out of his team. Did he learn that in Barcelona? The thought is ridiculous. Picture this, you are in a World Cup final after many exhausting weeks, who do you want to lean on to make sure your team performs to the height of their ability. Messi or Thiago Silva?','2014-06-11 17:05:50',0),(1439,1438,8,'ranis','Ranis','','0000-00-00','00:00:00','(final cont) Brazil will have had a rather easy road to the final and will have energy to spare, they will have one more day to rest than Argentina. The home advantage could just as well be negative as positive and both teams are quite equal in player quality. Argentina perhaps better offensively, Brazil defensively, but it is the ability to round up the troops that will determine the end of the cup. Brazil will have what it takes as they will keep their focus through out the tournament and Scolari knows exactly how this shall be portioned out. People will expect a tight game but it will be similar to the final in -98, there will never really be anyh question about it.<br/><br/>Brazil  the Mona Lisa of football, the Mozart of football, the Michelangelo of football, the Don Juan of football  will win!<br/><br/>The whole world will cheer with Brazil and join the party and everything will end well and everyone will be happy!<br/><br/>Next! <br/><br/>(preview...Russia will not win the next one)<br/><br/>There were hardly any jokes at all in my text and and still you are reading... Wow! You are a good friend, a VERY good friend. I feel sorry for you. Reply me and I send you 20 points.<br/><br/>NOW... LET THE SHOW BEGIN!!!! :)','2014-06-11 17:06:16',0),(1440,1439,37,'rico','Americo','','0000-00-00','00:00:00','Waouh Ranis,<br/>Thank you for this MASTER class of football WC psychology. As always, the reality will prove you all wrong but your prediction theories are profoundly right...','2014-06-11 21:56:48',0),(1441,0,37,'rico','Americo','John Oliver Explains The World Cup And FIFA To Americans','0000-00-00','00:00:00','[Jun 11, 03:06] - Warm up before the party begins...<br/><br/><a href=\'http://www.huffingtonpost.co.uk/2014/06/09/world-cup-brazil-john-oliver_n_5471605.html?utm_hp_ref=tw\' target=\'new\'>http://www.huffingtonpost.co.uk/2014/06/09/world-cup-brazil-john-oliver_n_5471605.html?utm_hp_ref=tw</a>','2014-06-12 17:48:41',5),(1442,1440,8,'ranis','Ranis','','0000-00-00','00:00:00','Same procedure as every year, James ... :)','2014-06-11 22:45:12'