lariochka.','2014-06-14 22:05:37',2),(1592,1587,8,'ranis','Ranis','','0000-00-00','00:00:00','Yep, Sepp should have a word in this. Nishimura should also have  a vote, he seems to know what is wrong or right.','2014-06-14 21:53:58',0),(1593,1592,8,'ranis','Ranis','','0000-00-00','00:00:00','But you are certain that Fabz is NOT in the pool? ','2014-06-14 21:55:45',0),(1594,0,1,'nicolas','Nico','Marga','0000-00-00','00:00:00','[Jun 14, 02:06] - My sympathy goes to our friend Marga, who not only has got all her bets wrong so far, but is also Spanish. Be strong Marga! And who knows, Algeria might win the World Cup?...(ok, I\'m pushing it)','2014-06-14 21:56:41',0),(1595,1586,1,'nicolas','Nico','','0000-00-00','00:00:00','Right! I remember that! Where was it? gmail? I\'ll find it.','2014-06-14 21:57:25',0),(1596,1591,163,'pawel','Pawel','','0000-00-00','00:00:00','So the verdict is that Claire\'s in? What about Fabz? Just askin\'...','2014-06-14 21:57:51',0),(1597,1593,1,'nicolas','Nico','','0000-00-00','00:00:00','yes I am certain Fabz isn\'t in the pool. ','2014-06-14 21:57:55',0),(1598,1596,1,'nicolas','Nico','','0000-00-00','00:00:00','Yes Claire\'s in. I do remember the conversation - but there have been a gazillion emails and I haven\'t had much time. I also forgot to send one or two their login info...that tells how swamped I was.','2014-06-14 22:05:37',0),(1599,0,11,'kimbel','Kimbel','Rumble in the Jungle','0000-00-00','00:00:00','[Jun 14, 03:06] - no need to get nervous... they\'re playing on Dutch grass, weaved by Alexander Collot d\'Escury for a sum of half a million per pitch, which is 6 million for all stadiums, he will put the same stuff which is 3% artificial grass in Munich, Paris and London and has requests from Russia and Qatar, now Super mario will score 5 times and Engulllanddd will score 5 times also but Bjorn wont see it so he will cancel those, it\'s only 31 degrees Celsius in Manaus right now, it will rain on Monday','2014-06-15 16:39:01',13),(160