achieved so far and just minus them from the future total. Hopefully, this is easily done.<br/><br/>And, as an excitement-proof, maybe we should set a ceiling of max 15 points per win?','2014-06-15 11:27:09',0),(1631,1607,11,'kimbel','Kimbel','','0000-00-00','00:00:00','Gary Lewin got an ankle injury while cheering. He landed on a bottle of water, it hurt a lot.','2014-06-15 14:52:57',0),(1632,0,11,'kimbel','Kimbel','Saturday, June 16','0000-00-00','00:00:00','[Jun 15, 07:06] - the 1st round match between Argentina and Bosnia in Group F, in Rio de Janeiro, is set on Saturday June 16, which has to be Monday June 16','2014-06-15 16:10:10',4),(1633,1632,1,'nicolas','Nico','','0000-00-00','00:00:00','Thanks Kimbel; I\'ve fixed it (the date was correct but with year 2015...)','2014-06-15 15:48:59',0),(1634,0,1,'nicolas','Nico','Point counting','0000-00-00','00:00:00','[Jun 15, 08:06] - Ranis pointed to my attention that my odds weren\'t correct: sometimes not all players make a pick on a given match, but I assume they do. <br/>For instance, if 6 people pick team1, 1 person picks tie, and 3 people pick team2, the odds should be 10/6, 10, and 10/3 respectively. If 5 people haven\'t picked anything, that becomes 15/6, 15, and 5. (current system). <br/>I will be working on correcting this.','2014-06-15 16:59:45',2),(1635,1633,11,'kimbel','Kimbel','','0000-00-00','00:00:00','merci beaucoup!','2014-06-15 15:58:27',0),(1636,1635,11,'kimbel','Kimbel','','0000-00-00','00:00:00','oops... it says: Friday June 15 now...','2014-06-15 16:01:04',0),(1637,1636,1,'nicolas','Nico','','0000-00-00','00:00:00','Thanks! I am NOT a morning person! SO glad I\'m moving 3 hours East.','2014-06-15 16:10:10',0),(1638,1631,8,'ranis','Ranis','','0000-00-00','00:00:00','They should make laws against the use of dangerous water bottles!','2014-06-15 16:39:01',0),(1639,0,8,'ranis','Ranis','Second pool','0000-00-00','00:00:00','[Jun 15, 09:06] - This is an offer of a second betting pool. Deadline is tomorrow before the Iran-Nigeria game. Please tell the others.<br/><br/>Since Claire knocked us out already in the first round, some of us has been worried that the excitement of the betting has already ended.<br/><br/>Thus, I am starting a second pool. You are invited. Do you want to join?<br/><br/>The bet is 10 EUR, pay at Paypal at payhere@hitquarters.com or let me know that you intend to pay.<br/><br/>We will use the same points as the original site with the exception that all points acquired before Iran-Nigeria will be withdrawn. All will be at zero before that game. If Nico does not have time to implement this to the site, I will administer the rankings of this pool on the forum every day.<br/><br/>There will also be a ceiling of max 15 points per game during the group games as an excitement-proof (to avoid a similar scenario). Otherwise we will follow the same rules.<br/><br/>The pool will only come into existence if we are at least 15 people. Now we are 9.','2014-06-15 21:58:45',15),(1640,1634,1,'nicolas','Nico','','0000-00-00','00:00:00','I\'ve corrected the odds - thank you Ranis for pointing this discrepancy to me! I am less behind now. ','2014-06-15 16:56:02',0),(1641,1640,8,'ranis','Ranis','','0000-00-00','00:00:00','me too :)<br/>should we re-count again? just a few more times ... LOL','2014-06-15 16:59:45',0),(1642,1639,8,'ranis','Ranis','','0000-00-00','00:00:00','Some math after 8 games:<br/><br/>The difference between Claire and No.2 is 38 points. <br/>The difference between No.3 Etienne and No.35 Benjip is 10 points.<br/>Let\'s assume that Claire is betting bad from now on (as No.35) and Etienne is betting good (as No.3), it will take 32 (!) games for them to get equal... That\'s a hint of how likely it is for anyone to catch Claire (not very).<br/><br/>Unless of course someone gets a lot of points from a single game in the same fashion, which will trigger a lot of us to, for tactical sake, bet on all the underdogs, which in turn will mean that it will be impossible to get a lot of points since too many will make tactical bets so the odds will never get that high. We have what the military would call a situation :)<br/><br/>I hope you want to join the second pool! <br/><br/>(I wrote this before the re-count, but it is soon second half so I won\'t bother adjusting it)','2014-06-15 17:00:50',0),(1643,0,18,'claire','Clariochka','Sorry guys !!!','0000-00-00','00:00:00','[Jun 15, 10:06] - I just went on the forum and discovered what an earthquake I caused, sorry guys !!!<br/><br/>Of course I am in the money pool, no doubt about it! ;))<br/><br/>Oups Switzerland just scored a second time before the end and won the match, I think I bet on Switzerland. <br/><br/>Cheers everyone ! ','2014-06-16 18:11:55',10),(1644,1642,1,'nicolas','Nico','','0000-00-00','00:00:00','I hope everyone bets on the underdogs, given the favorites inflated odds. It should help me catch up. There are 48 matches left, and high coefficients for the second round matches.','2014-06-15 18:23:37',0),(1645,1644,8,'ranis','Ranis','','0000-00-00','00:00:00','Correction: Second pool will start with Germany-Portugal. Sorry, I mixed up the schedule. ','2014-06-15 18:26:36',0),(1646,1643,1,'nicolas','Nico','','0000-00-00','00:00:00','I want to come up a snappy retort but I think of you smiling and that makes me smile. That and I can\'t think of any retort anyway, I am too nervous before France\'s game.','2014-06-15 18:27:51',0),(1647,1643,9,'karine','Bou','','0000-00-00','00:00:00','Like!','2014-06-15 18:32:00',0),(1648,1645,9,'karine','Bou','','0000-00-00','00:00:00','Ok, We are in the second pool! It was just too depressing to be knocked out so early!','2014-06-15 18:40:07',0),(1649,1645,163,'pawel','Pawel','','0000-00-00','00:00:00','Is Claire welcome to join in? ;)','2014-06-15 18:42:50',0),(1650,1647,8,'ranis','Ranis','','0000-00-00','00:00:00','I am not nervous, but I couldn\'t think of a retort. I shut up when I know when I am beaten :)','2014-06-15 19:10:58',0),(1651,1649,8,'ranis','Ranis','','0000-00-00','00:00:00','Much welcome. Revenge will be sweeeeet.','2014-06-15 19:11:29',0),(1652,0,8,'ranis','Ranis','France-Honduras 10-16','0000-00-00','00:00:00','[Jun 15, 12:06] - Honduras had to play 16 competitive games to reach WC, France only 10. I want this statistics to count somehow.<br/><br/>Mexico &amp; Uruguay played 18 games. Spain and the African teams only 8.','2014-06-15 21:01:32',4),(1653,1652,163,'pawel','Pawel','','0000-00-00','00:00:00','Btw, d\'you still play Football Manager, Ranis?','2014-06-15 19:28:08',0),(1654,1653,8,'ranis','Ranis','','0000-00-00','00:00:00','only during fasting.<br/><br/>I think we will have French-free forum for the coming hour.','2014-06-15 19:53:28',0),(1655,1654,11,'kimbel','Kimbel','','0000-00-00','00:00:00','mistake margin is 0,5 to 1,5 centimeter','2014-06-15 20:11:59',0),(1656,1651,11,'kimbel','Kimbel','','0000-00-00','00:00:00','what will happen to the 10 Euro of the first pool? can\'t we use it for the second one?','2014-06-15 20:14:01',0),(1657,1656,11,'kimbel','Kimbel','','0000-00-00','00:00:00','because we will withdraw from the first pool?! or can someone write out the rules for the second in comparison to the first, and who gets to be beheaded due to the mess of odds ?','2014-06-15 20:18:49',0),(1658,1657,11,'kimbel','Kimbel','','0000-00-00','00:00:00','or will Nicolas transfer the 10-er into the second and erase the first?','2014-06-15 20:20:33',0),(1659,1658,9,'karine','Bou','','0000-00-00','00:00:00','Come on Kimbel! You cannot withdraw your 10\'euros from the first pool! That would be too easy!','2014-06-15 20:35:15',0),(1660,1659,11,'kimbel','Kimbel','','0000-00-00','00:00:00','aha okay, then I dont get it yet... we will have 2 pools in which one of them no one can win...','2014-06-15 20:58:01',0),(1661,0,1,'nicolas','Nico','points','0000-00-00','00:00:00','[Jun 15, 01:06] - It looks like the points display is incorrect... The count seems right though... I\'m