Messi hear us and bless us Oh Lord!','2014-06-15 22:07:43',0),(1671,0,1,'nicolas','Nico','Bosnia','0000-00-00','00:00:00','[Jun 15, 03:06] - Is Argentina that much better than Bosnia to have those odds? I thought Bosnia was first of their group during the qualifying phase. In any case Argentina isn\'t dominating so far. ','2014-06-15 23:56:43',3),(1672,1671,8,'ranis','Ranis','','0000-00-00','00:00:00','Surprising, yes.<br/>It is a close game. Bosnia is pretty good and Arg looks uninspired','2014-06-15 23:19:10',0),(1673,1671,1,'nicolas','Nico','','0000-00-00','00:00:00','60 minutes in and Bosnia deserves an equalizer. Of course Argentina can score at any time as Bosnia will take more risks now...','2014-06-15 23:21:59',0),(1674,1673,11,'kimbel','Kimbel','','0000-00-00','00:00:00','make sure you\'re at least 2-0 up before the 70th minute, then Argentines will show their skills, then you\'ve the last 10 minutes left to score your winner!','2014-06-15 23:56:43',0),(1675,1667,18,'claire','Clariochka','','0000-00-00','00:00:00','Hey Alex, unfortunately for me I don\'t have such a strategical mind. My bets were made the same way I did in the past : quickly, \'\' la louche et au feeling\'\'. Don\'t get so nasty ;)  ','2014-06-16 07:41:56',0),(1676,1675,25,'alex','Alex','','0000-00-00','00:00:00','Sorry Claire, you pissed a bunch of us off with this bet ;-)) (so much they wanna do a second pool ;-))<br/>I dont care, I dont do it for the money...  I\'ll be glad to know that next time we meet the drinks will be on you ;-) X','2014-06-16 09:57:07',0),(1677,0,25,'alex','Alex','Stats about final winner','0000-00-00','00:00:00','[Jun 16, 04:06] - Here are some stats about the chosen final winner. (% have been rounded up)<br/><br/>PER COUNTRY<br/>Brazil		23	35%<br/>Argentina	        11	17%<br/>Germany		  9	14%<br/>Spain		  5	  8%<br/>Portugal	          3	  5%<br/>France		  3	  5%<br/>Belgium		  2	  3%<br/>NO ONE!!	          2	  3%<br/>Italy		          1	  2%<br/>Chile		          1	  2%<br/>Columbia	          1	  2%<br/>Cameroon	          1	  2%<br/>Netherlands	  1	  2%<br/>Algeria		  1	  2%<br/>Mexico		  1	  2%<br/><br/><br/>66% of use have chosen a \'\'big\'\' team as final winner. The top 3 has won 10 of the 19 editions!<br/>England &amp; Uruguay are the only previous winner that didn\'t get a pick.<br/><br/>6 of the 14 chosen teams already won the title once. <br/>8 of 14 already made it to the top 3.<br/><br/><br/>PER REGION<br/>Latin America	37	57%<br/>Europe		24	37%<br/>Africa		  2	  3%<br/>NO ONE!!		  2 	  3%<br/><br/>In the last 20 years, only Brazil succeeded as Latin American team to win the title. But they did it twice.<br/><br/><br/>My view on these stats is that we could maybe introduce the odds as a coefficient for the extra points. Then the one of us who went for an outsider as winner would get more extra points... That could make the knock-out phase even more exciting!<br/><br/><br/><br/><br/><br/>','2014-06-16 16:25:11',4),(1678,1677,25,'alex','Alex','','0000-00-00','00:00:00','Damn I had made sort of table to have things nicely.. but the post is now all text-like...<br/><br/>first number is the amount of people who selected the country and then obviously as a %<br/>','2014-06-16 11:14:50',0),(1679,1678,1,'nicolas','Nico','','0000-00-00','00:00:00','Thanks Alex. Yes there is a lot of post-handling of text for special characters, so that I can store the text in the database with accents and all. At some point I should allow for posting pics - so that you could make a screenshot of your table, but I\'m afraid Derek would instantly abuse this :)','2014-06-16 15:14:50',0),(1680,1677,1,'nicolas','Nico','','0000-00-00','00:00:00','Good point - we do that for the matches, why not for the winner too? Though in this case, would someone who picked Brazil get only 3 points? They wouldn\'t have much hope of catching up (which is in a way what almost everyone wants except the ones who are at the top). And if Algeria wins, Marga gets 50 points? I mean why not... if Algeria wins she\'ll have deserved those points...','2014-06-16 15:17:38',0),(1681,1680,107,'przemek','Przemek','','0000-00-00','00:00:00','Algeria winning the World Cup should be worth much much more than 50 points actually, William Hill\'s odds are 2000/1 in this particular case. Costa Rica beating Urugway was only 9/1 for instance, go figure! :-)','2014-06-16 16:25:11',0),(1682,0,25,'alex','Alex','GER v POR','0000-00-00','00:00:00','[Jun 16, 09:06] - It\'s funny, the Germans are falling like Portuguese\'s... Looks like Portuguese are being beaten at their own game... And meanwhile they are 3 goals behind... And I\'m about to lose some points here... ','2014-06-16 20:06:05',10),(1683,1682,107,'przemek','Przemek','','0000-00-00','00:00:00','Pepe gonna Pepe, no surprises here..','2014-06-16 16:50:28',0),(1684,1682,11,'kimbel','Kimbel','','0000-00-00','00:00:00','plzplzplz, don\'t let Germania become world champion plzplzplz, Ronaldo will score 4 goals, I\'m sure about that, plzplzplz','2014-06-16 16:52:34',0),(1685,1676,7,'etienne','Etienne','','0000-00-00','00:00:00','She just thought Costa Rica had a chance and that\'s it... don\'t be silly. Otherwise she would have bet on Croatia, Cameroon, Bosnia etc etc. When Costa Rica won she was already at the top with many correct bets. And yes sometimes it\'s about personal strategy. I know some French friends who have bet on a draw as well, so if they are disappointed by the result at least they have some consolation with the points... it\'s for fun for everyone and if you think other people do it for the money you are on the wrong path buddy. And last, you mean you will never ever bet on the underdog? A bit boring, don\'t you think? ;)','2014-06-16 17:11:39',0),(1686,1685,9,'karine','Bou','','0000-00-00','00:00:00','Yes we\'re here for fun! But i got scared for france when i saw that claire had bet the draw....she was the god of predictions and i started to believe in her... \' -)','2014-06-16 17:24:53',0),(1687,1684,163,'pawel','Pawel','','0000-00-00','00:00:00','I\'m afraid it\'s already done. Ze Germanz are the world champions. What did I think betting on Brazil! Even Reus-less they\'ll kick everybody\'s ass till blood will drip out of their anuses.','2014-06-16 17:25:12',0),(1688,1687,47,'avi','Avi','','0000-00-00','00:00:00','Muller, the bane of Portugal','2014-06-16 17:41:39',0),(1689,1688,19,'sylvain','Sylvain','','0000-00-00','00:00:00','Looks like nobody chose Mller as the top scorer','2014-06-16 17:43:23',0),(1690,0,7,'etienne','Etienne','1984','0000-00-00','00:00:00','[Jun 16, 10:06] - Like the last words in George Orwell\'s book, \'\'HE LOVED BIG BROTHER\'\', I can say after 32 years of dark deelings (I was born to football in 1982) that I finally love the Germans.<br/><br/>That look on CR7 face... priceless.','2014-06-16 17:46:23',0),(1691,1689,8,'ranis','Ranis','','0000-00-00','00:00:00','If Germany can evoke all these strong feelings, then I will prepare for the flood of emotions that will follow during the next game: Iran-Nigeria ... phew ... think I will read that forum thread from a distance','2014-06-16 18:04:27',0),(1692,1691,7,'etienne','Etienne','','0000-00-00','00:00:00','It\'s because you don\'t have Nigerian parents, like me.','2014-06-16 18:08:13',0),(1693,1685,1,'nicolas','Nico','','0000-00-00','00:00:00','And we are simply to blame for CRC: they beat the US 3-1 during the qualifying phase. It\'s not like they are a team like Buthan or San Marino.','2014-06-16 18:11:55',0),(1694,0,8,'ranis','Ranis','Second pool','0000-00-00','00:00:00','[Jun 16, 11:06] - Second pool, a.k.a. The Elite-Pool, is up and running. <br/><br/>We are 16. The winner will get 96 EUR, No.2 48 EUR and No.3 16 EUR. Results will show on the forum at least once per day.','2014-06-16 22:52:15',8),(1695,1694,8,'ranis','Ranis','','0000-00-00','00:00:00','The first rankings follows. Claire is on top.<br/><br/>1	 Clariochka	1.59<br/>2	 Derek	1.59<br/>3	 anita	1.59<