ke their football team. The faking, and everything. I love german football! They are not the sum of individuals , they are a real team, efficient and truer than the rest.','2014-06-17 05:11:50',0),(1735,0,8,'ranis','Ranis','Elite pool post GHA-USA','0000-00-00','00:00:00','[Jun 17, 01:06] - 1	 Peter	11.70<br/>2	 Luci	3.70<br/>3	 Bou	3.69<br/>4	 Etienne	3.69<br/>5	 Derek	3.69<br/>6	 Avi	3.69<br/>7	 Nico	3.69<br/>8	 Ranis	2.10<br/>9	 Clariochka	1.59<br/>10	 anita	1.59<br/>11	 JanP	1.59<br/>12	 Lena	1.59<br/>13	 Friberg	0.00<br/>14	 Kimbel	0.00<br/>15	 Pawel	0.00<br/>16	 Przemek	0.00<br/>','2014-06-17 08:00:21',0),(1736,0,25,'alex','Alex','Betclic','0000-00-00','00:00:00','[Jun 17, 06:06] - Are there some of you that also use this website? I\'m considering...<br/>On betclic.fr the first bet has a cashback guarantee... I\'m thinking about registering and take a big risk on a high odd game... ;-)<br/>Just would like to know if people have experience with this site.<br/>','2014-06-19 14:35:58',1),(1737,0,8,'ranis','Ranis','Belgacom','0000-00-00','00:00:00','[Jun 17, 09:06] - Only odds 8 on an Algeria-win.<br/><br/>I have seen a few games with Belgium last year, incl last friendly at home to Tunisia (1-0). They look the same, low tempo, moving sideways, ball-holding, difficult to score on. Like a Barcelona on pot. So, no surprise so far. Better should come...<br/><br/>For having the warpig coach Wilmots they are oddly much in lack of fighting-spirit.<br/><br/>Maybe we will have two new countries in the world, should they go out already in the groups.<br/><br/>If they lose, it is Belgacoms fault. I hate Belgacom.','2014-06-17 21:21:44',11),(1738,1737,1,'nicolas','Nico','','0000-00-00','00:00:00','I hate Belgacom too, they are incompetent and abusive of their power. I put Belgium winning because I like Hazard - I haven\'t seen them play... and now it\'s 1-0 Algeria... oh boy..','2014-06-17 16:44:04',0),(1739,1738,8,'ranis','Ranis','','0000-00-00','00:00:00','Hazard was brill