ng someone in the back...??!! Maybe he is pissed off for the debacle of Barca/Spain.<br/><br/>I think I give up this game and go out to have a drink and cig. This is done.<br/><br/>Good news for Brazil.','2014-06-19 11:10:28',3),(1791,1790,11,'kimbel','Kimbel','','0000-00-00','00:00:00','but Song was only trying to dust off a fly from Mandzukic\'s back with his elbow!','2014-06-18 22:53:11',0),(1792,1791,11,'kimbel','Kimbel','','0000-00-00','00:00:00','biggest defeat of Les Lions Indomptables was 6-1 in 1990 and 1994, this could have been more, there seems to be a complot against Eto\'o and there was something with the plane to Manaus, some refused to fly or something due to financial conflicts','2014-06-18 23:53:27',0),(1793,0,7,'etienne','Etienne','Aftermath','0000-00-00','00:00:00','[Jun 19, 01:06] - Don\'t know if there are Spanish fans or Spanish citizens here... But just to let you know that I sympathize. I know what you feel like. Feeling desperate but not daring to express it because you had been so spoiled in the past years.<br/><br/>Thank you Spain for all the good moments! Tiki-taka was sometimes annoying, Ranis, yes, but come on... some of the games were masterpieces in football strategy and execution (you need so much work, skills, habits, speed to be able to play like that!). I know, Ranis, I know... your mentors are the Germans from the 80\'s... so we have a difference of views here. ;)<br/><br/>Good luck to the new generation (Koke...) and see you in France in 2016.','2014-06-19 20:49:54',6),(1794,0,163,'pawel','Pawel','Your missus vs. football','0000-00-00','00:00:00','[Jun 19, 03:06] - How does your missus react to you spending most of your day lately watching football on telly? Is she supportive? Doesn\'t constantly whine about such petty and unimportant things as well-being of your friends and family, your dog shitting in the corner or sex? Or did she already go away yesterday when you smashed your TV being a La Rocha fan? Mine bought me a t-shirt with an inscription \'\'On the eight day God created football.\'\' Lousy gift given that a) it has Steven Gerrard pic on it b) there is no God.<br/><br/>Anyhow, what are your thoughts?','2014-06-19 20:43:42',7),(1795,0,8,'ranis','Ranis','Elite-pool post CAM-CRO','0000-00-00','00:00:00','[Jun 19, 03:06] - 1	 Peter	23.33<br/>2	 Derek	20.24<br/>3	 Friberg	13.95<br/>4	 Avi	12.73<br/>5	 Luci	12.57<br/>6	 Etienne	12.56<br/>7	 Przemek	9.05<br/>8	 Pawel	8.87<br/>9	 Lena	7.84<br/>10	 Nico	7.65<br/>11	 Karine	7.64<br/>12	 Clariochka	5.54<br/>13	 anita	5.54<br/>14	 Ranis	3.34<br/>15	 JanP	2.76<br/>16	 Kimbel	2.41<br/>','2014-06-19 21:02:03',10),(1796,1794,8,'ranis','Ranis','','0000-00-00','00:00:00','I remember when I received an ATM card from a new bank once (Standard Chartered), and the clerk\'s disappointing look on his face, when he saw the disappointing look on my face, as it was Steven Gerrards face on the card. Was I to go around with this in my pocket...? 3 cm from my pride ..? Yuck! Get away from me... GET AWAY!<br/><br/>My missus won the Euro-betting in 2004. She could actually give me such a gift as a meta-humor statement (but it would have to been cheap)<br/><br/>Don\'t underestimate God and Jesus, they are great swear words.','2014-06-19 10:49:21',0),(1797,1793,25,'alex','Alex','','0000-00-00','00:00:00','Is the reigning EU champion automatically qualified for the EU championship? Cause if not, we\'re not even sure to see Spain during this competition!!','2014-06-19 10:50:06',0),(1798,1793,8,'ranis','Ranis','','0000-00-00','00:00:00','Same thing can be said for every champion, incl Greece. \'\'Masterpiece of strategy and execution.\'\' etc. In fact it can be said for anyone who wins any game which makes it, by default, a pretty boring analysis. <br/><br/>Therefor, I refuse to show respect to a champion just because they are champion.<br/><br/>Tiki-taka was always annoying, mostly because I wasn\'t cheering for Spain and they were much cuter when they were the constant under-achievers.<br/><br/>Still, if I would pick my favorite champions just by \'\'beauty of play\'\' Spain would be pretty low on that list.<br/><br/>What do you think, which champions are the best in terms of \'\'beauty of play\'\'?','2014-06-19 11:00:35',0),(1799,1797,8,'ranis','Ranis','','0000-00-00','00:00:00','Spain has to qualify for Euro 2016. Not France though. Catalonia in WC 2018?','2014-06-19 11:02:39',0),(1800,1790,8,'ranis','Ranis','','0000-00-00','00:00:00','Alexandre Song\'s uncle Rigobert Song got a red card in World Cup 1994 AND 1998 ... :))))<br/><br/>To be a fly on the wall on that Christmas dinner...','2014-06-19 11:10:28',0),(1801,1798,163,'pawel','Pawel','','0000-00-00','00:00:00','Brazil 1994. Most def. Great technical, consistent football, but without unnecessary and annoying cockiness or circus-like show. Don\'t remember earlier cups, I\'m too young ;) ','2014-06-19 11:26:30',0),(1802,1798,19,'sylvain','Sylvain','','0000-00-00','00:00:00','Nothing to do with the fact that they were champions. Tiki-taka in 2008 (played by Spain and Barca) was one of the most beautiful thing I\'ve ever seen in football (with the Bayern 2013 that showed how to counter tiki-taka) !!','2014-06-19 13:12:09',0),(1803,1794,19,'sylvain','Sylvain','','0000-00-00','00:00:00','Mine does not complain much... But my boss does. Somehow, he doesn\'t understand why I watch soccer in the afternoon instead of working. How rude...','2014-06-19 13:47:47',0),(1804,1736,25,'alex','Alex','','0000-00-00','00:00:00','I tested an offer on the French website. The first bet till 100 is refunded if lost! I tried with Belgium vs Algeria and put 100 on Algeria (odds of 9.00) so until the 70th minute I had potentially 900. Alas for me Belgium scored twice... Just now I got my 100 back. I\'m about to wire the money back to my bank account (free of charge) and I\'ll close my account with betclic...<br/>It\'s only available via betclic.fr not .com<br/>For those who want to try get some