ond round as you can in the first round. It\'s not so simple as in the second round, it\'s just 2 possible outcomes instead of 3, it\'s 26 games instead of 48, and each round has a different importance (we want a correct pick on the final to have a higher weight than a correct pick on a Round of 16 match). I\'ll try and find a statistician to help me with that. I happen to be surrounded by lots of very skilled statisticians.','2014-06-23 16:49:26',0),(1979,1978,8,'ranis','Ranis','','0000-00-00','00:00:00','I\'m not really into honorable things...<br/><br/>The idea with the pool was to bring back excitement to the betting which kind of worked.<br/><br/>It would have been better to change the point system but that was not realistic since someone has to program it or do it manually so the only option was to base it on the existing web site.<br/><br/>I like this scoring system, but my preference would be to have more than one pool and more than one point system next time, that would be the most exciting option I think. That way everyone should be \'\'alive\'\' for as long as possible in at least one pool.','2014-06-23 17:25:56',0),(1980,1979,1,'nicolas','Nico','','0000-00-00','00:00:00','Yes, Ranis :) I\'ll try and think of it. It should actually not be too difficult to implement. What is increasingly difficult, though, is to find time, even in small amounts.','2014-06-23 18:08:14',0),(1981,1980,25,'alex','Alex','','0000-00-00','00:00:00','I never got the point of the second pool... I mean, my cousins here can witness, I\'m far to be the biggest football fan here... And nevertheless I\'m being in the top 5 for a while...<br/>The only thing I see is that the odds of final winner could be taken in account.<br/>Maybe the total of correct bets could have an influence to counterweight a lucky call like Claire or I got with Costa Rica (you know on which team you need to bet ;)).<br/>In the end you bet on the winner between two teams.. That it is the first game of the competit