00:00','[Jun 24, 01:06] - Greece just crack me up :)<br/>I had to go to Google translate to find a word that describes them and I landed on - recalcitrance... suck on that! I\'m sure that Greeks made up that word 3500 BC and have just been waiting for today (45+3 min, 1-0) ','2014-06-24 21:15:10',1),(2015,0,163,'pawel','Pawel','','0000-00-00','00:00:00','[Jun 24, 01:06] - Ranis, you\'ll like it <a href=\'https://fbcdn-sphotos-h-a.akamaihd.net/hphotos-ak-xpf1/v/t34.0-12/10478504_588280314619282_544886918_n.jpg?oh=a1469699ecb970b6c0bf786b63832b9e&amp;oe=53ABED12&amp;__gda__=1403744015_5378ce77f47284f9499da89c9396cc90\' target=\'new\'>https://fbcdn-sphotos-h-a.akamaihd.net/hphotos-ak-xpf1/v/t34.0-12/10478504_588280314619282_544886918_n.jpg?oh=a1469699ecb970b6c0bf786b63832b9e&amp;oe=53ABED12&amp;__gda__=1403744015_5378ce77f47284f9499da89c9396cc90</a>','2014-06-24 22:15:23',3),(2016,1997,1,'nicolas','Nico','','0000-00-00','00:00:00','We could do that...The thing is basically that we have 3 (or 2) possible outcomes. If team A is favorite, then the odds on team A are low, like 1.2 or 1.5. The question then becomes : is A\'s likelihood of victory overvalued? Maybe the high odds on B are actually worth the risk. So all in all, it should be fair, except that with few players, or with not enough diversity of players, we have more extreme values. So we could cap the max odds, like 15 points no matter what. The \'correct bets\' pool is a good idea, too, as it compensates for the extreme odds. The problem is that it only compensates 1, 2 or 3 players, not all of the ones who were impacted by these extreme odds. In any case, it will most likely come down to whether I find the time to implement anything on top of the usual updates to keep up with new versions of php, java, mysql, css, and with smartphones and browsers.','2014-06-24 21:00:07',0),(2017,2015,8,'ranis','Ranis','','0000-00-00','00:00:00','HA HA HA!!! (I like that better than \'\'LOL\'\' since \'\'HA HA HA\'\' includes a