-26 10:31:43',0),(2061,0,11,'kimbel','Kimbel','Go Ghana!','0000-00-00','00:00:00','[Jun 26, 05:06] - despite the plane with 3 million dollar that was sent by the Ghana president last Wednesday some quarrels and fighting within the ranks of the Black Stars community caused head coach Appiah to wield his disciplinary axe on Boateng and Muntari for various degrees of misconduct. They have been ordered to leave the teams Palace Hotel base in Brasilia by 10:00 GMT. They are reported to have physically assaulted Medeama Football club owner, Moses Parker, after an altercation between the player and the Black Stars management committee member. The incident happened when tempers flared up during a meeting between the management committee members and the playing body. Muntari, who overly got furious over Moses Parker\'s comment on an issue they were discussing, rushed on the Medeama bankroller and punched him in the face.','2014-06-26 14:11:57',1),(2062,2058,11,'kimbel','Kimbel','','0000-00-00','00:00:00','Claudio Sulser, chairman of FIFA\'s ethics committee, has to condemn Suarez to death, but the former Grasshoppers striker is a Libra and had four knee operations, so he can\'t make a decision yet. Sulser in 2010:  \'\'The damage caused to Fifa as regards its image is very great. When one talks of Fifa there is generally a negative attitude out there, there is talk of corruption,\'\' he said. \'\'This is rather curious but on the other hand it\'s no joke because Fifa is a big organisation with many interests, and where there are many interests things can go awry. Now, we are trying to work in complete transparency.\'\'','2014-06-26 13:18:24',0),(2063,2061,11,'kimbel','Kimbel','','0000-00-00','00:00:00','Boateng had screamed four-letter expletives at Appiah in training on Sunday before he was ordered off by the coach. Boateng has been a major problem for coach Appiah at the tournament arguing over everything from hotels to questioning every decision at training.<br/>On the morning of his massive confrontation with Appiah, Boateng told him in front of the players he had benched him while others played stupid football.<br/>Boateng has insisted that he did not, as is being reported, insult Appiah. <br/>there was an incident during training where Muntari was just joking around. I said that he had played the ball with his hand. He said no. Then I laughed and said: Hey, are you the referee or what?\' The coach asked us why we had laughed. We said that everything was okay. Then he sent us to the cabin. After training I went to the coach and asked him if he had a minute for me. I asked him what he had against me? Then he started yelling at me. He insulted me.<br/><br/>Muntari went on the rampage against the Medeama SC owner as the heat over unpaid appearance fees for the Black Stars at the 2010 World Cup got out of hand.<br/>The two men exchanged punches before Muntari stormed the officials room and destroyed a laptop computer and phones, according to reports.<br/>','2014-06-26 14:11:57',0),(2064,2062,11,'kimbel','Kimbel','','0000-00-00','00:00:00','verdict: 9 games and 82.000 euro fine','2014-06-26 16:06:51',0),(2065,2064,1,'nicolas','Nico','','0000-00-00','00:00:00','Oh, now I have a good image of FIFA again then!','2014-06-26 16:35:28',0),(2066,2049,37,'rico','Americo','','0000-00-00','00:00:00','Thanks Arnaud again for the good laugh. I love this forum where we spend hours arguing about the point logarithm. All in all, I\'ve come down to this one simple proposal : keep the odds system but with a max 10 pts on one single game...<br/>Agreed everyone?','2014-06-26 21:28:37',0),(2067,2066,107,'przemek','Przemek','','0000-00-00','00:00:00','Not really.. :-)','2014-06-26 21:31:02',0),(2068,2066,1,'nicolas','Nico','','0000-00-00','00:00:00','I agree!<br/>And since I\'m kind of a dictator here anyway, I guess that has some weight.','2014-06-26 21:44:07',0),(2069,0,17,'derek','Derek','Belgium','0000-00-00','00:00:00','[Jun 26, 03:06] - I like that F