','00:00:00','What a great World Cup!<br/>Another super match.','2014-07-01 22:23:03',0),(2233,2232,11,'kimbel','Kimbel','','0000-00-00','00:00:00','certainment! every match is incredibly unpredictable, and no one seems to be able to score before the 70th minute. Gugusse could be right, Colombia is the best team so far. who will make the difference?','2014-07-01 22:39:26',0),(2234,0,39,'stephane','Stephane','Round of 16','0000-00-00','00:00:00','[Jul 01, 03:07] - The 8 teams that were 1srt in the first round won their Round of 16<br/><br/>However, what a suspense ! Only Colombia killed the suspense early in the game','2014-07-02 20:48:02',2),(2235,2234,8,'ranis','Ranis','','0000-00-00','00:00:00','High level entertainment!!','2014-07-01 22:46:04',0),(2236,2233,7,'etienne','Etienne','','0000-00-00','00:00:00','Belgium: 38 shots, 27 on target!<br/><br/>What an evening for Tim Howard. Did you know he has Tourette\'s syndrome? \'\'Watch out for DeBruyne SHIT SHIT SHIT\'\'. \'\'Hey Mr Referee there was no foul FUCK CUNT\'\'.<br/><br/>They did not notice during the year because in Everton everybody speaks like that.<br/><br/>','2014-07-02 06:12:20',0),(2237,0,8,'ranis','Ranis','The pool-pool pre 1/4 finals','0000-00-00','00:00:00','[Jul 02, 04:07] - <br/><br/>1	 Derek (Bra/Neymar)	76.51<br/>2	 Pawel (Bra/Aguero)	67.97<br/>3	 Lena (Bra)	63.04<br/>4	 Peter (Ger/Robben)	56.96<br/>5	 Luci (Germ)	56.18<br/>6	 Avi (Bra/Persie)	56.06<br/>7	 Clariochka (Bra/Persie)	53.86<br/>8	 Ranis (Bra)	53.41<br/>9	 Nico (Ger/Schurrle)	52.86<br/>10	 Kimbel (Bra/Benzema)	48.63<br/>11	 Etienne (Belg/Hazard)	47.76<br/>12	 anita (Arg/Neymar)	46.41<br/>13	 Karine (Arg/Fred)	43.80<br/>14	 Friberg	42.84<br/>15	 JanP (Robben)	38.37<br/>16	 Przemek (Arg/Messi)	26.85<br/>','2014-07-02 11:36:23',0),(2238,0,7,'etienne','Etienne','Penalty spot moved back?','0000-00-00','00:00:00','[Jul 02, 07:07] - <a href=\'http://grantland.com/the-triangle/crime-and-punishment-should-the-penalty-kick-spot-be-moved-back/\' target=\'new\'>http://grantland.com/the-triangle/crime-and-punishment-should-the-penalty-kick-spot-be-moved-back/</a><br/><br/>Interesting! Penatly sanction (80% of the times --&gt; goal) is the same for an unvoluntary hand foul, or a severe tackle. And at times where scoring a goal is so difficult, the penalty rewards the victim in a disproportionnate manner, and so often changes the course of a game, even a competition.<br/><br/>Moving back that spot would be an interesting evolution... whadayathink?','2014-07-03 09:18:41',4),(2239,0,39,'stephane','Stephane','July 8th, 1982 - France - West Germany','0000-00-00','00:00:00','[Jul 02, 09:07] - Do you remember where you were (for those who were more than a lustful feeling in the eyes of their parents) ?','2014-07-04 11:14:20',11),(2240,2238,19,'sylvain','Sylvain','','0000-00-00','00:00:00','Interesting idea, but I\'d rather see 2 kind of sanction :<br/>1 - penalty kick if the foul deliberately annihilate a scoring possibility (but it goes into conflict with the red card rule which is basically the same)<br/>2 - indirect free kick for all the other fouls (like when you pass to the keeper)','2014-07-02 16:55:28',0),(2241,2238,1,'nicolas','Nico','','0000-00-00','00:00:00','This is interesting indeed; however given the high rate of success of penalties, I wonder why defenders still tackle in the box or do anything slightly aggressive. Surely they should not do so? If they didn\'t, the rate of success of shots in the box would be higher, and that may explain why tackling is worth the risk. There may be 1 penalty instead of 7 or 8 very dangerous shots.<br/><br/>Also, I really like this smart reasoning, but is there a point when FIFA decides ultimately?','2014-07-02 19:37:54',0),(2242,2239,37,'rico','Americo','','0000-00-00','00:00:00','of course, every French guy remembers, it\'s printed somewhere, just like Noah\'s victory at RG, 12 July 1998, Zidane\'s headers...','2014-07-02 20:41:56',0),(2243,2235,37,'rico','Americo','','0000-00-00','00:00:00','The 8 Group winners make it to the quarters... This is an amazing statistics, certainly the first time ever.<br/>This WC is everything we like in football.','2014-07-02 20:48:02',0),(2244,0,37,'rico','Americo','First signs of PWCS (Post World Cup Syndrom)','0000-00-00','00:00:00','[Jul 02, 01:07] - Shit, what do I do tonight?<br/>Life is so boring.','2014-07-03 01:51:49',1),(2245,2244,11,'kimbel','Kimbel','','0000-00-00','00:00:00','<a href=\'http://darkroom.baltimoresun.com/2014/07/best-goal-celebrations-of-world-cup/#1\' target=\'new\'>http://darkroom.baltimoresun.com/2014/07/best-goal-celebrations-of-world-cup/#1</a>','2014-07-03 01:51:49',0),(2246,2240,25,'alex','Alex','','0000-00-00','00:00:00','the indirect free kick in the 16m has totally disappeared but is actually still a rule!! So maybe this could be sorta \'\'reintroduced\'\'. I can remember matches where you see a wall of players on the goal line... that was always very entertaining!!<br/>','2014-07-03 08:14:31',0),(2247,2241,8,'ranis','Ranis','','0000-00-00','00:00:00','This was well said: \'\'yesterdays events should also prompt a discussion about the underlying motivations for diving in the first place.\'\'<br/>Though I don\'t think the boards of FIFA are unsenile enough to read such a long article.','2014-07-03 09:18:41',0),(2248,2242,8,'ranis','Ranis','','0000-00-00','00:00:00','I know where I was, though what I remember most strongly was Schumacher/Battiston incident and how much I hated Germany after that.<br/><br/>Seriously though, does the French team bear any resemblance to the teams of 82 &amp; 98 ... ? I can\'t see it. Those teams had charm and playfullness, like they enjoyed what they were doing. <br/><br/>Pogba looks like a brat, a Balotelli wanna-be. Valbuena struts around like a cock with inferiority-complex, how Giroud can come from the same country that (probably) invented the word \'\'finesse\'\' is just laughable, and, seriously, who would want to sit drinking at the same bar as Evra, Benzema or Ribery...? eeeew....<br/><br/>Apart from being French, do you feel sympathy for this team? I just can\'t see it...','2014-07-03 09:31:37',0),(2249,2248,8,'ranis','Ranis','','0000-00-00','00:00:00','Teams that I do find charming and playful now are Germany, Chile and Colombia.<br/>I should also add that I didn\'t see the 5-2 against Switzerland as I had a Swedish duty of getting drunk by myself on midsummers eve.','2014-07-03 09:39:47',0),(2250,2249,8,'ranis','Ranis','','0000-00-00','00:00:00','You want to have a fun night out with buddies in good drinking, comradeship and general fun talk and stories. You go into a bar...<br/><br/>To the left sit: Evra, Benzema and Ribery<br/>To the right sit: Thomas Muller, Podolski and Marcus Reus<br/><br/>Who do you want to hang out with? ','2014-07-03 09:45:31',0),(2251,0,8,'ranis','Ranis','20 years ago','0000-00-00','00:00:00','[Jul 03, 02:07] - A quote from Swedish TV two days ago: \'\'It is now 20 years ago since the murder of the colombian back Escobar due to the own goal in the World Cup 94. For the upcoming game, the Colombian players will find strength in this.\'\'<br/><br/>Oh, really... you think?','2014-07-03 09:51:53',0),(2252,2248,27,'augustin','Gugusse','','0000-00-00','00:00:00','There is \'\'Didier la dche\'\' to generate sympathy... It is strange that we actually have sympathy for the team, not for the players !<br/><br/>In 1982 I was playing 1,2,3 SUN ! in school :-)','2014-07-03 10:52:59',0),(2253,2248,19,'sylvain','Sylvain','','0000-00-00','00:00:00','\'\'Apart from being French, do you feel sympathy for this team?\'\'<br/><br/>Yes without a doubt : Matuidi, Sackho, Lloris, Cabaye, Griezman, Mavuba, Landreau. I love all these players.','2014-07-03 14:51:32',0),(2254,2253,19,'sylvain','Sylvain','','0000-00-00','00:00:00','And do I have to remind you that the only thing the French hate more than the German are the English ?','2014-07-03 15:11:27',0),(2255,2248,1,'nicolas','Nico','','0000-00-00','00:00:00','I like the French team; I know I am French but that does not play in my favor: we jump on every opportunity to criticize our team. Pogba is SKILLED. I really like that. And they are trying to play like a team, not like the Zidane-goons that they previously were. And I like Deschamps, he\'s serious.','2014-07-03 16:00:18',0),(2256,2250,7,'etienne','Etienne','','0000-00-00','00:00:00','Of course we all want to go out with George Best, Maradona or Balotelli (an evening with Balotelli sounds like an incredible level of unexpected fun), but I don\'t see the French players as totally repelling - except Ribery for sure, and Evra to a certain extent, maybe...<br/><br/>But like Sylvain, I like many of them and I think an evening with them easily competes with an evening with Schweinsteiger, zil, Neuer, Khedira, Mertesacker and Lahm.<br/><br/>As for Ribery - yes he is not bright at all, pretty stupid, and his face is scary. Scarry? ;)<br/><br/>BUT all the players who have been in his team recall that he is constantly happy, fun, ties the shoelaces to annoy his mates, puts a lot of salt in the spaghetti to watch the face of his colleague... not bright, but constantly playing childish jokes and not taking himself seriously, so I don\'t really hate him and can find him cute, in a way...','2014-07-03 17:44:22',0),(2257,2255,39,'stephane','Stephane','','0000-00-00','00:00:00','Of course I laugh at Ribery when he likes the Velodrome Stadium full of fans in Marseille but also ouside the town...<br/>Of course I laugh at Ribery when he says about a player that \'\'la routourne va bientt tourner pour lui\'\' (untranslatable).<br/>But he played in many clubs very young (Galatasaray when he was 21), Marseille, Munich, and everywhere he has been successful.<br/>I strongly believe that it is more important to be able to succeed in several cultural environments than to speak  a right French as if he were a Ph.D','2014-07-03 19:19:13',0),(2258,0,39,'stephane','Stephane','George - really the - Best','0000-00-00','00:00:00','[Jul 03, 12:07] - Etienne, I\'m sure you know all of this, as you mentioned him, but I can\'t resist.<br/>This guy is amazing : talented, alcoholic, irish, charismatic<br/><br/>Some quotes, among thousands :<br/><br/>=&gt; In 1969 I gave up women and alcohol. It was the worst 20 minutes of my life.<br/><br/>=&gt; I spent a lot of money on booze, women and fast cars. The rest I just squandered.<br/><br/>=&gt; They say I slept with seven Miss Worlds. I didn\'t. It was only four. I didn\'t turn up for the other three<br/><br/>=&gt; People always say I shouldn\'t be burning the candle at both ends. Maybe they haven\'t got a big enough candle.<br/>(I add : the size doesn\'t matter...)<br/><br/>=&gt; I had a house by the sea, and one day I wanted to go to the sea, but I had to pass a pub to go to the sea, so I never saw the sea<br/><br/>Yes, George, really the Best<br/><br/>By the way who wants to have a beer (and fun) with Schweinsteiger....)','2014-07-03 19:47:49',0),(2259,0,38,'arnaud_c','Arnolito','Fashion police','0000-00-00','00:00:00','[Jul 03, 05:07] - So we have settled it, no one wants to hang out with the players of either France or Germany. How about watching them? On that, I will risk a little fashion opinion: I think tonight\'s game will be between the teams with the best outfits. The French\'s delicious vintage, yet slim fit jersey, with a button collar is really cool. The German\'s white jersey with the dark red v-shaped band on the chest is ber cool, not to mention the big circle with \'\'national mannshaft\'\' and the 3 stars.<br/><br/>Of course in that area, nothing beats a Netherlands - Germany in say 1990','2014-07-04 00:06:49',0),(2260,2257,8,'ranis','Ranis','','0000-00-00','00:00:00','Thanks for sharing some positive light on the French players. I will try to pick up some of those good vibes. It would be good to feeling good about France again, it was a while ago... I won\'t tonight though ;)<br/><br/>And just to clarify - I WOULD like to share some drinks with the German players. I think it would be a good bar-hang. Can\'t say that for many others though (Hazard, David Luiz, Iniesta... eeeew...) Of course, Balotelli is one of the favorites, Suarez of course, Cavani? Milner? Baines? Fred actually looks like a nice guy (Maybe that\'s why he don\'t score)<br/>','2014-07-04 11:14:20',0),(2261,0,8,'ranis','Ranis','Sympathy vote','0000-00-00','00:00:00','[Jul 04, 04:07] - What\'s the forum\'s sympathy vote for the play-offs? (please disregard betting) I start.<br/><br/>GER-FRA 1-0<br/>BRA-COL 0-1<br/>ARG-BEL 0.5-0.5<br/>NED-COS 0-1<br/><br/>I am mostly interested to see if anyone actually wants Brazil to win. In the beginning of the cup I decided (for the first time in my life) to be happy for any Brazilian success, but I am totally out of that steam now... Don\'t like the team, don\'t like the attitude, don\'t like to see them as winners. Just the picture of David Luiz holding Neymar pointing to the skies after the Chile-win is enough to make me wanna go out and puke a wild boar right in the face.<br/>','2014-07-04 16:56:06',8),(2262,2261,8,'ranis','Ranis','','0000-00-00','00:00:00','Anita has spoken...<br/><br/>GER-FRA 2-0<br/>BRA-COL 1-1<br/>ARG-BEL 1.5-0.5<br/>NED-COS 0-2<br/><br/>Adding to the Brazilian thread within the thread... Anita seems to have a somewhat similar approach to feeling sympathy for Brazil as I had in the beginning: Home country success = fun world cup. A difference between us is that she didn\'t watch any of Brazil\'s group games.','2014-07-04 12:07:18',0),(2263,2261,107,'przemek','Przemek','','0000-00-00','00:00:00','To be honest, Neymar looks a bit like a human wild boar.. doesn\'t he?<br/><br/>Ger-Fra 1-1<br/>Bra-Col 0-2<br/>Arg-Bel 0.5-1.5<br/>Ned-Cos 0-2','2014-07-04 12:17:38',0),(2264,2263,107,'przemek','Przemek','','0000-00-00','00:00:00','EDIT!!<br/><br/>Ger-Fra 2-1<br/>Bra-Col 1-2<br/>Arg-Bel 1.5-1.5<br/>Ned-Cos 0-3