h technical and mental abilities that their experience puts them slightly above many opponents at every game.<br/><br/>With national teams, composed of totally different players over the years, who do not play together very often, this is more a mystery. Some kind of unconscious collective superiority...','2014-07-05 16:22:06',0),(2343,0,7,'etienne','Etienne','Haircut alert','0000-00-00','00:00:00','[Jul 05, 10:07] - Palacio is THE worst haircut I have ever seen.','2014-07-05 17:36:53',0),(2344,0,1,'nicolas','Nico','Time','0000-00-00','00:00:00','[Jul 05, 10:07] - WHEN will we start stopping the watch when the ball is not in play? WHY do we not do that? Argentina\'s leading, so they take their time, feint cramps or injuries. <br/>I\'m so annoyed by this, this is so backwards. It\'s like we don\'t know how to stop the watch more than once in 90 minutes.','2014-07-05 18:23:06',1),(2345,2344,11,'kimbel','Kimbel','','0000-00-00','00:00:00','ugly futebol by Messi and his companions, pitty Di Maria is out, hope some more beauty will follow in next matches','2014-07-05 18:23:06',0),(2346,0,11,'kimbel','Kimbel','HOL vs COS','0000-00-00','00:00:00','[Jul 05, 11:07] - Costa Rica: coffee, tourism, bananas<br/><br/>Holland: marijuana, tulips, cheese','2014-07-05 23:25:56',2),(2347,2346,1,'nicolas','Nico','','0000-00-00','00:00:00','Lots of oranges in Costa Rica, but the NL have the richer coast.','2014-07-05 21:32:32',0),(2348,2342,37,'rico','Americo','','0000-00-00','00:00:00','Totally agree with you Etienne, amazing this 80 year history with the \'\'big teams\'\'.<br/><br/>I think there\'s something about the mental superiority you mention.<br/>I think it is about the objectives these teams set for themselves. Brazil and Germany, when they start a WC, it is always about going all the way to get a new title. Even when they don\'t have great players, they set a high ambition.<br/>For teams like Colombia and Belgium, it feels they already achieved a great performance by getting to the 1/4, somehow they didn\'t pretend to go all the way.<br/>So it doesn\'t happen...<br/><br/>Morale de l\'histoire : \'\'il faut regarder loin pour aller loin\'\'.<br/>','2014-07-05 22:22:36',0),(2349,2348,1,'nicolas','Nico','','0000-00-00','00:00:00','Costa Rica may prove you wrong Etienne.. their defense has been miraculous so far.','2014-07-05 22:35:07',0),(2350,2331,1,'nicolas','Nico','','0000-00-00','00:00:00','Could it be that the referees are influenced by history in the small decisions that can turn a match around? NL vs. Mexico, no penalty on Robben, yet one called. Had it been the other way around, would the referee have called it?<br/>On the BBC tonight, they were saying that there should have been a penalty for CRC. Imagine the scandal if CRC wins that way; not so if it\'s the other way around.','2014-07-05 22:39:48',0),(2351,2340,1,'nicolas','Nico','','0000-00-00','00:00:00','True but they\'re regulars still; they\'ve gone far in the competition so many times.','2014-07-05 22:40:50',0),(2352,2347,11,'kimbel','Kimbel','','0000-00-00','00:00:00','justice has been done, and this goalie substitute has never been done...geniality or belief in statistics','2014-07-05 23:25:56',0),(2353,2348,7,'etienne','Etienne','','0000-00-00','00:00:00','And with Van Gaal they have a \'\'plus\'\' as he is convinced that he is superior to all others - like many Dutch fellow citizens if I may add ;) - and that goalie substitution will not help his ego. Well done...<br/><br/>I am now rooting for Holland, who would have thought?? (and it probably means they will lose), as I think the country of Cruyff, Van Basten, Bergkamp, Van der Sar etc, deserves this trophy at last. Germany would also be an OK winner.','2014-07-06 08:01:11',0),(2354,2350,8,'ranis','Ranis','','0000-00-00','00:00:00','Man, the drama last night... phew... Costa Rica did not concede one goal in open play during the whole cup, right? And did not concede the last 8 hours of play. That is pretty awesome. Yet,