 a new haircut). That will certainly confuse the Argentinians.','2014-07-09 21:33:05',0),(2397,2396,8,'ranis','Ranis','','0000-00-00','00:00:00','78 min.<br/>Shots on goal: NED-ARG 0-2','2014-07-09 21:39:13',0),(2398,2397,8,'ranis','Ranis','','0000-00-00','00:00:00','The Swedish 4th referee just made a fool of himself, dropping the number board. Get a grip, Jonas, I am the one who has to face my neighbors with this tomorrow...<br/><br/>He was a lowsy 4th ref already earlier in the cup. He is so sloppy when showing the numbers, not really turning 90 degrees, more like 70-75 and then not staying long enough so the short side stadium crowd have enough time to read the numbers. I am ashamed.','2014-07-09 21:45:00',0),(2399,2398,8,'ranis','Ranis','','0000-00-00','00:00:00','Me and Anita already booked a hotel at Friedrichstrasse in Berlin on Saturday and Sunday. Here is the nightmare: That Holland beat Germany in the final. A loss against Argentina is something I could digest, but to Holland... no,no, no, NOOOOOOOOOOOO','2014-07-09 21:59:37',0),(2400,2399,8,'ranis','Ranis','','0000-00-00','00:00:00','Messi, for crying out loud, turn on the turbo!!! What\'s the wait... ?<br/><br/>Robben looked like 45 years old already when he was 20. Messi still looks like 13. It\'s got to mean something...','2014-07-09 22:01:38',0),(2401,2399,7,'etienne','Etienne','','0000-00-00','00:00:00','Kuyt is useless, but Van Gaal cannot replace him, he is keeping his last substitution for You-Know-Who','2014-07-09 22:03:06',0),(2402,2401,7,'etienne','Etienne','','0000-00-00','00:00:00','... and as I am writing this, Van Persie is replaced... no wonder I totally SUCK at predicting stuff in football. :)','2014-07-09 22:04:58',0),(2403,2402,7,'etienne','Etienne','','0000-00-00','00:00:00','... this also probably means that Kuyt will brilliantly score.','2014-07-09 22:07:51',0),(2404,2403,7,'etienne','Etienne','','0000-00-00','00:00:00','Messi - Aguero - Higuain - Lavezzi, that\'s, what, 100 goals p