aaaaaaaaaaaaaaaaaaaaaa','2014-07-09 22:49:54',0),(2415,2414,27,'augustin','Gugusse','','0000-00-00','00:00:00','AU LIT !','2014-07-09 22:51:43',0),(2416,2414,8,'ranis','Ranis','','0000-00-00','00:00:00','To give you an idea what it means for us Germany-fans to play a final without Holland, here is the best World Cup song ever - <a href=\'http://www.youtube.com/watch?v=j82VFs0NZY4\' target=\'new\'>http://www.youtube.com/watch?v=j82VFs0NZY4</a>','2014-07-09 22:51:57',0),(2417,2393,9,'karine','Karine','','0000-00-00','00:00:00','Well no. You can always comment and make subtilities, but sometimes you just want to be a good crowd , and then the like button is welcome. Clap clap clap would mean that you agree whereas a like only means that you like the wit, not that you agree!','2014-07-09 22:59:00',0),(2418,2395,9,'karine','Karine','','0000-00-00','00:00:00','That\'s why you\'re so precious! You should earn extra points for the king of comments!<br/>','2014-07-09 23:01:43',0),(2419,2380,11,'kimbel','Kimbel','','0000-00-00','00:00:00','correct!','2014-07-09 23:50:26',0),(2420,2384,11,'kimbel','Kimbel','','0000-00-00','00:00:00','cheese and cheap sausages','2014-07-09 23:51:30',0),(2421,2411,11,'kimbel','Kimbel','','0000-00-00','00:00:00','he said it again just now after the game live on radio','2014-07-09 23:56:00',0),(2422,2421,11,'kimbel','Kimbel','','0000-00-00','00:00:00','okay, well, finito... people moving around in the pitch black rainy night in Holland...silently...people walking on highways, without moving for fast speeding cars...they break the dykes now...they\'re melting cheese...they drown in it...they\'re hanging German shepherds on trees...strange fruit...and they\'re now raping our Argentinian Queen!<br/>enfin, Van Gaal was unlucky, Nigel de Jong teared up his loin, RVP was having gut problems, as was Janmaat, he thought Huntelaar would score the decisive, and after he lost with penalties he stated live on radio that penalties is a lottery, while he stated after the game of Costa Rica that penalties is not a lottery, that means he\'s totally psychotic, and I feel sorry for Manchester United!','2014-07-10 00:00:49',0),(2423,0,1,'nicolas','Nico','Ideas for Le Euro 2016','0000-00-00','00:00:00','[Jul 10, 03:07] - So, I\'ll fix the few things that need fixing; but I was thinking it was time to summarize what we want for Le championship De Euro 2016. I probably won\'t implement it all but it\'s good to think about it.<br/>- a kind of limit for the odds - 10 to 1 seems reasonable, I\'ll check the history of the public odds on this World Cup matches; or maybe I add dummy players who bet on each outcome, to dampen the variations. The coefficients would still apply: a 10 to 1 odd in semi-final would still be multiplied by 4 in this World Cup.<br/>- different point systems next to the main one, so that most of us have a chance to have a decent ranking in those.<br/>- a plus and minus sign for liking/disliking posts (for those of us who aren\'t American, we need a dislike button for our emotional balance)<br/>- Various presentation/bug fixes<br/><br/>Obviously the different point systems will require a lot of changes, so I may not be able to implement them. But I\'ll try.<br/><br/>So, if you want anything else, just list it here! I\'ll try not to ignore it. Or ideas for point systems.','2014-07-13 04:43:41',12),(2424,2423,8,'ranis','Ranis','','0000-00-00','00:00:00','Sounds fine. To modernize, we could do the money pool in some cryptocoin.<br/>I also like the old point system where one could bet 1 to 5 points on a bet, that was fun too.','2014-07-10 11:29:27',0),(2425,0,8,'ranis','Ranis','Cillesen-goes-home-to-mummy-pool','0000-00-00','00:00:00','[Jul 10, 04:07] - The pool after we got rid of Holland...<br/><br/>Nico, please let us know what the co-efficients are for 3rd place and final. It\'s gonna be very important. I would also like to have a confirmation that Luci did NOT choose a top scorer.<br/><br/>1	 Pawel (Aguero)	108.88<br/>2	 Derek (Neymar)	95.92<br/>3	 Lena	87.40<br/>4	 Kimbel	81.86<br/>5	 Luci (Germ)	80.55<br/>6	 Ranis	79.14<br/>7	 Etienne	77.49<br/>8	 Peter (Ger/Robben)	74.55<br/>9	 anita (Arg/Neymar)	68.64<br/>10	 Avi (Persie)	67.25<br/>11	 Clariochka (Persie)	65.59<br/>12	 Friberg	65.07<br/>13	 Nico (Ger/Schurrle)	64.77<br/>14	 JanP (Robben)	64.65<br/>15	 Karine (Arg/Fred)	60.35<br/>16	 Przemek (Arg/Messi)	35.72<br/>','2014-07-10 14:25:34',2),(2426,2425,1,'nicolas','Nico','','0000-00-00','00:00:00','Right she did pick Klose so it will be a Klose Kall.<br/>For the 3rd place match I had planned a coefficient of 2; it\'s not a really important match, compared to all other second round match; but\'s it\'s not a 1st round match either. I\'ll have to check that my code correctly handles it.','2014-07-10 13:31:18',0),(2427,2426,163,'pawel','Pawel','','0000-00-00','00:00:00','Boom shakalaka!','2014-07-10 14:25:34',0),(2428,2424,107,'przemek','Przemek','','0000-00-00','00:00:00','One system to rule them all! IMO 1-5 points on a bet is the most reasonable and fair system we\'ve ever had here, not as random as the new one at all. With regards to the current odds system, we could take the odds from any online bookie before the games so that could eliminate any sort of unpredictability. Just think of unreal Costa Rica\'s odds or several draw games.. blah!','2014-07-10 16:17:46',0),(2429,2428,107,'przemek','Przemek','','0000-00-00','00:00:00','Also, would be great if we could edit our posts :-)','2014-07-10 16:20:15',0),(2430,2428,1,'nicolas','Nico','','0000-00-00','00:00:00','Yes taking the odds from a current site is possible, it just costs $$ and time to plug in to that feed, or just time as I\'d need to enter them manually for each match. Maybe it won\'t cost that much in 2 years (getting scores cost me little two years ago but would have cost a lot now).<br/>','2014-07-10 16:43:20',0),(2431,2423,9,'karine','Karine','','0000-00-00','00:00:00','The comments system could be easier, now? I find it hard sometimes to see all the comments in a chronological order. What do you guys think? It could be simply chronological following one thread?','2014-07-10 20:33:14',0),(2432,2431,1,'nicolas','Nico','','0000-00-00','00:00:00','Sure; I was trying to make it in a way that we could reply to posts individually, in a tree-like fashion. But I agree that sometimes I can\'t really tell which post is being replied to. I\'ll see whether I can make it simpler.','2014-07-10 23:55:01',0),(2433,2432,8,'ranis','Ranis','','0000-00-00','00:00:00','I agree. A trollbox would also be good.','2014-07-11 04:59:58',0),(2434,2423,19,'sylvain','Sylvain','','0000-00-00','00:00:00','What about keeping the draw option for the knockout stage (so we bet on the score after extra-time and do not count the shoot-outs) ?','2014-07-11 17:36:14',0),(2435,2434,1,'nicolas','Nico','','0000-00-00','00:00:00','Yes - we could do that; that would make the odds a bit higher for each outcome, giving the chance to make a difference in the rankings...  I initially wanted \'what matters\', which is typically who wins, because the rest (winning 4-1 or 1-0) is much more random and so it adds noise. (though bets like \'more than 2 goals difference\' have more meaning). <br/>','2014-07-11 18:08:23',0),(2436,2419,11,'kimbel','Kimbel','','0000-00-00','00:00:00','<a href=\'https://vine.co/v/MxBLtbXX5P0\' target=\'new\'>https://vine.co/v/MxBLtbXX5P0</a>','2014-07-11 20:24:13',0),(2437,0,7,'etienne','Etienne','3rd place match','0000-00-00','00:00:00','[Jul 12, 05:07] - Nico, what is the weight of the 3rd place match? It\'s usually a match no one cares about and the coaches put all the substitutes on the field... so i believe the weight should be like a group match but that\'s just me.','2014-07-12 23:09:51',8),(2438,2435,7,'etienne','Etienne','','0000-00-00','00:00:00','I also liked the system when we all had a certain number of points at the beginning and we could allocate 1 to 5 points for each match. Then we all start the knockout stage with a new batch of points.','2014-07-12 12:26:26',0),(2439,0,163,'pawel','Pawel','3rd place &amp; the final match','0000-00-00','00:00:00','[Jul 12, 05:07] - Nico, could you please remind me the point counting system for the final game? Is it x4 or x5?','2014-07-12 19:53:40',1),(2440,0,8,'ranis','Ranis','Only place to be','0000-00-00','00:00:00','[Jul 12, 09:07] - We have landed in Berlin. Soon to be the new world capital of football.','2014-07-12 17:51:45',1),(2441,2440,107,'przemek','Przemek','','0000-00-00','00:00:00','Greetings from Buenos Aires dude!!','2014-07-12 17:51:45',0),(2442,0,1,'nicolas','Nico','marga','0000-00-00','00:00:00','[Jul 12, 12:07] - Marga has problems logging in so she sent me her picks. I\'m not at home so I won\'t be able to enter them but I\'ll make today\'s pick public in a few minutes','2014-07-12 20:00:03',1),(2443,2439,1,'nicolas','Nico','','0000-00-00','00:00:00','It\'s 6 for the final','2014-07-12 19:53:40',0),(2444,2437,1,'nicolas','Nico','','0000-00-00','00:00:00','It\'s two. ','2014-07-12 19:54:09',0),(2445,2444,1,'nicolas','Nico','','0000-00-00','00:00:00','Could have been one, but you still know that Hungary finished third in 66 (I think) so it\'s still counts more than a first round match. I agree it\'s debatable.','2014-07-12 19:55:52',0),(2446,2442,1,'nicolas','Nico','','0000-00-00','00:00:00','Marga picked the Oranje tonight.','2014-07-12 20:00:03',0),(2447,2445,7,'etienne','Etienne','','0000-00-00','00:00:00','Fine with me. Thanks :)','2014-07-12 20:10:01',0),(2448,2445,163,'pawel','Pawel','','0000-00-00','00:00:00','And Poland in \'74 and \'82. That DOES count for us.','2014-07-12 20:35:00',0),(2449,2448,1,'nicolas','Nico','','0000-00-00','00:00:00','Ok, it picked up a coefficient of 6 instead of 2; I\'ll look into the code and fix it.','2014-07-12 22:27:36',0),(2450,2449,1,'nicolas','Nico','','0000-00-00','00:00:00','ok - it computed the points correctly, it\'s just displaying the wrong bonus next to the match - I forgot to fix the code there. ','2014-07-12 22:38:43',0),(2451,2450,163,'pawel','Pawel','','0000-00-00','00:00:00','Just to clarify, Nico. The winner gets 60%, 2nd place 30% and 3rd 10%? Just asking since I miraculously outran Claire.','2014-07-12 22:55:15',0),(2452,2451,1,'nicolas','Nico','','0000-00-00','00:00:00','Correct!','2014-07-12 23:09:51',0),(2453,0,11,'kimbel','Kimbel','Van Persie vs Van Hooijdonk','0000-00-00','00:00:00','[Jul 12, 04:07] - after the match tonite a football polemic started live on TV between several sports journalists and RVP against Pierre van Hooijdonk, who\'s now the 44 year old commentator for Dutch TV, but he also wrote a very critical column recently stating that Van Persie was not playing good at all, now they have an old quarrel from back in the days at Feijenoord, and now they\'re fighting each other live on TV, anyhow everyone is proud on the Dutch squad, even the Brazilians, still all the top players lay awake of not getting to this bloody final... on September 4th Holland will play a friendly against Italy in Bari with their new coach Guus Hiddink, who will implement another system to win Euro16 in France','2014-07-12 23:49:42',0),(2454,2423,38,'arnaud_c','Arnolito','','0000-00-00','00:00:00','I think you guys know what I am going to say, but just to mention that neither Pawel not Tim had any Costa Rican extra help to get to 1st and 3rd place in current rankings. So I don\'t really see the point of modifying the odds arbitrarily. It is like human will wanting to change the rules of nature... :)<br/>','2014-07-13 00:27:06',0),(2455,2454,1,'nicolas','Nico','','0000-00-00','00:00:00','I do agree with the fact that without good guesses, no one can win; but at the same time I think of tennis, where top players may play better on certain surfaces. Here some may be good a estimating how confident they are in the outcome of a game (token system), others may be good at having a high number of correct picks; etc. It does not change the fact I would have failed in any point system in this World Cup.<br/><br/>In any case, it\'s unlikely I\'ll have much time to change anything for \'Le Euro 2016\': after every competition I\'m full of good intentions, then life happens and before I know it, the next tournament is coming up and it\'s a miracle if I can make it work again as it was before. ','2014-07-13 04:43:41',0),(2456,0,8,'ranis','Ranis','Second-pool pre final','0000-00-00','00:00:00','[Jul 13, 04:07] - It seems highly likely that Pawel will win and Derek will be No.2. It is a battle between four players on No.3 - Lena, Luci, Kimbel, Ranis. If Germany wins, Luci will be No.3 (provided that she bets GER in the normal betting). If Argentina wins, whoever of Lena, Kimbel, Ranis bets on ARG will be No.3 in that order. Even Luci can be No.3 with ARG win if she bets ARG and Lena &amp; Kimbel bets GER.<br/><br/>1	 Pawel (Aguero)	112.24<br/>2	 Derek	99.28<br/>3	 Lena	87.40<br/>4	 Kimbel	85.22<br/>5	 Luci (Germ/Klose)	80.55<br/>6	 Ranis	79.14<br/>7	 Peter (Germ)	77.91<br/>8	 Etienne	77.49<br/>9	 Avi	70.61<br/>10	 Clariochka	68.95<br/>11	 anita (Arg)	68.64<br/>12	 Nico (Ger/Schurrle)	68.13<br/>13	 JanP 	68.00<br/>14	 Friberg	65.07<br/>15	 Karine (Arg)	63.71<br/>16	 Przemek (Arg/Messi)	39.08<br/>','2014-07-13 21:03:49',11),(2457,2456,8,'ranis','Ranis','','0000-00-00','00:00:00','I guess also Etienne has chance if he bet Argentina and all the other bet Germany.<br/><br/>Przemek will be last even if Argentina wins and Messi will be top scorer. Maybe you want to share your betting tactics with the rest of us :) ?','2014-07-13 11:24:04',0),(2458,2457,163,'pawel','Pawel','','0000-00-00','00:00:00','Since it\'s \'\'highly likely\'\' that I\'ll win, I\'d like to thank The Academy, the producer, my manager and especially God...for making me an atheist.','2014-07-13 11:36:38',0),(2459,0,27,'augustin','Gugusse','paris corrects','0000-00-00','00:00:00','[Jul 13, 07:07] - Thank you Nicolas fo