INSERT INTO `forum2010` VALUES (373,0,27,'augustin','Gugusse','PREM\'S !','0000-00-00','00:00:00','hh !\ncomme pour souhaiter les anniversaires sur Facebook.\n\nBon MERCI NICOCO de crer ce nouvel espace virtuel d\'change et d\'expression libre non censur\n\n(Test : pipi couille fucking bastard sarkozy ben laden courgette)\n\nSinon comme dit dans le commentaire et ben a fait un drle d\'effet de retrouver son profil deux ans aprs, o on dcouvre que son quipe favorite c\'est le Brsil alors que n\'importe quoi c\'est pas a en fait.\n\nJe profite d\'crire en franais tant qu\'il y a pas trop d\'anglais d\'ailleurs let\'s quote here The Monty Python \"You don\'t frighten us, English pig-dogs! Go and boil your bottom, sons of a silly person. I blow my nose at you, so-called Arthur King, you and all your silly English k-nnnnniggets. Thpppppt! Thppt!Th\"\n\nbon si quelqu\'un crit aprs a ...\n\nBISES A TOUS  !','2010-05-19 12:00:55',3),(374,373,1,'nicolas','Nicolo','','0000-00-00','00:00:00','Merci Gugusse! Au moins a montre que les accents passent bien...tu n\'avais pas des collgues qui ont jou il y a deux ans ,tiens? Que sont-ils devenus? (mais peut-tre me goure-je)','2010-05-18 19:16:07',0),(375,0,39,'stephane','Stephane','Familles nombreuses','0000-00-00','00:00:00','Il y a des rductions pour familles nombreuses sur ce site de prono ? La prolifration continue de la famille Auvillain n\'est pas nette...','2010-05-19 09:41:20',0),(376,374,19,'sylvain','C\'est arriv prs ','','0000-00-00','00:00:00','Tiens, tant qu\'on est dans les tests techniques (accents et tout a), y a t\'il une taille max de caractres par message si l\'on utilise autre chose que IE ?','2010-05-19 10:02:20',0),(377,376,1,'nicolas','Nicolo','','0000-00-00','00:00:00','Normalement non...enfin j\'ai pas essay tous les navigateurs mais avec Firefox il n\'y a pas de restriction. Si a se trouve IE8 n\'a plus cette restriction, mais j\'ai la flemme de regarder. J\'ai juste envie de dcourager l\'utilisation de IE... abus de pouvoir, oui, oui!','2010-05-19 12:00:55',0),(378,0,19,'sylvain','Blame it on the Roon','Tactiques','0000-00-00','00:00:00','Ah, enfin lheure est venue !\nLheure des doutes et des espoirs, des joies et des frustrations\nLheure des paris de Nicoco.\n\nQuel parcours suivrez-vous durant ces 30 jours ? Un parcours grenoblois, ject ds les premiers matchs ? Un parcours bordelais, flamboyant au premier tour puis lamin lors des phases directes ? Un parcours barcelonais, brillant et implacable ?\n\nEt la vraie question, comment remplir cette satane grille ?\n\nOn peut faire diffrentes approches.\n- lapproche romantique : vous favorisez les rsultats de votre quipe de cur et des quipes africaines. Malheureusement pour vous  Le football est un jeu simple ; 22 hommes courent aprs un ballon pendant 90 minutes et,  la fin, les allemands gagnent toujours \n\n- lapproche scientifique : vous tes all voir sur un site slovneles stats de Aleksandar Rajcevic et vous savez trs exactement combien de tirs ont fait les honduriens au cours des liminatoires. Pas de bol, cette anne cest une fille qui ny connat rien qui gagnera le pactole\n\n- Lapproche masochiste :  Allez les bleus ! On est tous ensemble . Lquipe de France est une catin qui vous en a fait baver ces 4 dernires annes. Mais vous ne pouvez pas vous empcher de revenir vers elle. La France gagnera la finale 3  0.\n\n- Lapproche pragmatique : vous tes pour la France ? Misez pour lItalie : si la France gagne, ben cest la fte. Si la France perd, au moins vous aurez gagn de largent.\n\n- Lapproche de votre copine :  Cest pas le Brsil les plus forts au foot ?  Le pire, cest quelle aura peut-tre raison. De toute faon, sa meilleure amie se marie le 11 juillet alors bon\n\n- Lapproche tmraire : Honduras / RDP Core en finale. Honduras vainqueur 13 buts  7. Chaque joueur vous doit 1000 .\n\n\nAyant tent lapproche scientifique en 2006 (et termin environ 20me) puis lapproche masochiste en 2008 (et termin environ 20me), je crois quil ne me reste plus que lapproche tmraire. Go All Whites !!!','2010-05-27 14:36:58',4),(379,378,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Sorry for non french people, I did not have the talent to write this in english. I guess you can always try to use Google translate to get the general idea','2010-05-19 15:29:42',0),(380,379,1,'nicolas','Nicolo','','0000-00-00','00:00:00','I have tried the same approach every time, which is trusting my instinct, unless there are teams I don\'t like, and I have always failed miserably. Which means this time it is bound to work! (unscientific, narcissistic, and somewhat stubborn... categorize it all you want: I will win!)','2010-05-20 07:18:20',0),(381,0,53,'aliocha','FRANCE WILL WIN THE ','Tous&quot; derrire&quot; Zahia...','0000-00-00','00:00:00','Sincrement, tous les lments sont prsents pour que l\'on puisse affirmer que la France va gagner la Coupe du Monde: Joueurs en mauvais tat, quipe dteste, une qualification scandaleuse, un entraneur avec de gros sourcils... Je suis certain que la France va au moins arriver en final. Raymond jusqu\' la mort! ','2010-05-26 14:51:46',5),(382,381,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Cette quipe de France, c\'est comme Dieu ou le communisme : le coeur voudrait y croire, mais le cerveau sait que c\'est juste pas possible.','2010-05-21 21:50:24',0),(383,381,1,'nicolas','Nicolo','','0000-00-00','00:00:00','Dans mon scnario o la France gagne, il y a une srie de malencontreux accidents: Henry va en voiture  l\'entranement, percute Domenech, occup  noncer des lieux communs  une foule virtuelle sur le bas-ct. Henry drape ensuite et percute un arbre, se blesse; Domenech meurt sur le coup. Ciss voit la scne, dprime, et est forfait.','2010-05-22 07:45:00',0),(384,380,9,'karine','K\'rin K\'rin','','0000-00-00','00:00:00','ou l\'approche de ta copine ! Excellent cette intro. \nJe vais aller avec l\'approche romantique je pense, sachant que l\'allemagne gagnera. M\'enfin, c\'est au tour de l\'amrique du sud cette anne, non ? Donc l\'approche de ta copine risque fort de marcher. ARGH. ','2010-05-23 06:43:09',0),(385,383,9,'karine','K\'rin K\'rin','','0000-00-00','00:00:00','J\'adore la foi d\'Aliocha. C\'est beau ! Comment vais-je pouvoir enseigner en juin  mes lves? TIens je vais leur apprendre  lire des tableaux et  faire des stats. Bon ils sont un peu jeunes, mais c\'est p grave. ','2010-05-23 06:45:39',0),(386,385,53,'aliocha','FRANCE WILL WIN THE ','','0000-00-00','00:00:00','Je suppose que vous avez tous entendu des problmes gastriques et intestinaux de Diarra ( sans mauvais jeu de mot). Oui mon humour laisse vraiment a dsirer. C\'est un cadeau tomb du ciel. Mon ami Raymond va revoir sa stratgie ( 4-3-3). Nous allons assister  une quipe magique coach brillamment. Vive la France! Vive Raymond!','2010-05-25 22:37:12',0),(387,386,1,'nicolas','Nicolo','','0000-00-00','00:00:00','Puisqu\'on en est  l\'humour de bas-tage, voici ce que Jan (ici prsent) a dit concernant l\'quipe de France:\n\"D\'abord un coup de boule de Zidane, puis un coup de la main d\'Henry, puis un coup de queue de Ribry... a descend, ils vont enfin jouer avec leurs pieds! Cette fois c\'est sr, la France va gagner le mondial!\"','2010-05-26 14:51:46',0),(388,0,1,'nicolas','Nicolo','Domenech','0000-00-00','00:00:00','Domenech really wants a piano to fall on his head. Why does he place Mandanda as a keeper? Lloris is the established goalkeeper, he has done miracles during the qualification phase. Everyone agrees he should be our keeper for the World Cup. Mandanda isn\'t bad, but why change? To annoy everyone?','2010-05-28 06:58:10',2),(389,388,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','I\'ve read that Domenech wanted to test his other goalkeepers and that he wanted to replace Mandanda with Carasso at half-time. Finally, he decided to let Mandanda for givig him confidence after the Costarican goal.','2010-05-27 11:26:30',0),(390,384,27,'augustin','Gugusse','','0000-00-00','00:00:00','Superbe synthse de nos prises de ttes,\nje crois que je vais tenter l\'approche pragmatique une fois encore.\nTiens par exemple j\'ai mis 15  sur un autre site (oui i l y en a) sur les tats-unis dans le match Angleterre/Usa et ben je vais mettre tous mes points ici sur l\'Angleterre.','2010-05-27 14:36:58',0),(391,389,1,'nicolas','Nicolo','','0000-00-00','00:00:00','Great! That will give confidence to Lloris! \"You can be replaced\", \"We are preparing your substitutes because frankly, we don\'t trust you\"... First match he plays, he will be nervous, try impossible things, and make mistakes! \nOk, he is a pro, he knows better, but I hate Domenech, so that\'s that.','2010-05-28 06:58:10',0),(392,0,53,'aliocha','FRANCE WILL WIN THE ','France-Tunisie','0000-00-00','00:00:00','Juste pour vous informer que la France va battre la Tunisie 2  0 ce soir. C\'est une certitude. \r\nIl faut avoir confiance en Domenech, c\'est un grand entraineur, peut tre mme le plus grand que la France n\'ai jamais eu...certainement. Je posterai un nouveau message aprs la victoire franaise de ce soir. A tout  l\'heure.','2010-05-31 11:27:37',3),(393,392,1,'nicolas','Nicolo','','0000-00-00','00:00:00','Il a fallu un dpart forc de Diarra pour que Domenech, au lieu de jouer aux chaises musicales comme il aime le faire, change la tactique... Moi je dis 3-1.','2010-05-30 18:26:14',0),(394,393,53,'aliocha','FRANCE WILL WIN THE ','','0000-00-00','00:00:00','bon on s\'es loup... Mais il ne fallait surtout pas dmontrer notre grande supriorit avant la Coupe, au risque de limiter l\'effet de surprise.','2010-05-31 10:18:32',0),(395,394,1,'nicolas','Nico','','0000-00-00','00:00:00','J\'avais dit de ne pas jouer aux chaises musicales! Comment veut-on que les joueurs trouvent des automatismes si la compo change tout le temps?','2010-05-31 11:27:37',0),(397,0,17,'derek','','Mundial calendario','0000-00-00','00:00:00','http://www.marca.com/deporte/futbol/mundial/sudafrica-2010/calendario-english.html','2010-06-03 19:01:51',0),(398,0,1,'nicolas','Nico','forum issues','0000-00-00','00:00:00','Hey guys! Sorry about the forum being unavailable for new threads the last 24 hours..I erased all files by mistake, and copied them back from a backup folder. But, I had forgotten about the javascript files, essential for this forum... It\'s fixed now!','2010-06-03 19:03:48',0),(399,0,53,'aliocha','FRANCE WILL WIN THE ','Super calendrier...','0000-00-00','00:00:00','Voici un calendrier qui est plutot vraiment bien foutu ( le meilleur jusqu\'a maintenant):\r\nhttp://www.marca.com/deporte/futbol/mundial/sudafrica-2010/calendario-english.html','2010-06-05 21:14:23',2),(400,399,1,'nicolas','Nico','','0000-00-00','00:00:00','Derek a donn le mme lien hier...','2010-06-04 19:38:51',0),(401,0,9,'karine','K\'rin K\'rin','China !','0000-00-00','00:00:00','HA HAHAHAHAHHAHAH !','2010-06-05 08:36:14',1),(402,0,11,'kimbel','RoboCop','Les lphants','0000-00-00','00:00:00','Ladies &amp; Gentlemen... the World Cup has begun... as we all remember poor Djibril Ciss who so horrifically broke his leg just running along the sideline 4 years ago in a warmup against China, now poor Didier Drogba - un autre ivoirien - has broken his arm/elbow due to the fact that Ivorian djudju priests are working overtime... now as we all know about the ruthless Japanese suicide bombers, this Selbstopfer-technique has recently been incorporated in modern soccer play as we first knew it from the body-checks in icehockey... due to this fact the Dutch team doctors have swiftly consulted the best Swaziland village sorcerer men who will provide La Naranja Mecnica with invisible weightless casts around their arms when they play their second game against the Flowers of Yamazakura... We might be expecting some drama in the camp of Les Lions Indomptables over the next days... We cannot predict the outcome of the battles but you will be making a mistake if you should regard Special Attack operations as normal methods... ','2010-06-06 17:00:46',5),(403,401,1,'nicolas','Nico','','0000-00-00','00:00:00','What a surprise, the French forwards have trouble finding each other on the pitch! But no worries, they have a few days more to fine-tune their marvelous strategy.','2010-06-05 08:36:14',0),(404,402,1,'nicolas','Nico','','0000-00-00','00:00:00','It seems Drogba will play after all! I guess he\'ll play with an ivory forearm...','2010-06-05 08:40:07',0),(405,402,11,'kimbel','RoboCop','','0000-00-00','00:00:00','Arjen Robben, The Man of Glass, has just become victim of Magyar voodoo... hamstring... he will not be in Paris to catch his flight, he will be in hospital...','2010-06-05 14:40:28',0),(407,405,1,'nicolas','Nico','','0000-00-00','00:00:00','Tough for the Oranje! But such a silly injury, he didn\'t need to attempt that pass.','2010-06-05 19:26:06',0),(413,399,1,'nicolas','Nico','','0000-00-00','00:00:00','Je l\'ai ajout en haut de la page \'matches\', comme a c\'est plus pratique!','2010-06-05 21:14:23',0),(414,0,8,'ranis','Ranis','Swedish-French Connection','0000-00-00','00:00:00','My first note on the forum of Football World Cup will be about.... TENNIS!! Today, a great final, don\'t miss it! Robin Sderling against Nadal. Robin played extremely well against Federer and is the only person ever to have beaten nadal in Paris. Robin was the 6th swede in the last 30 years to make the final in the French Open and can be the 3rd to win it. It is a big game!!! Tomorrow I promise... football \"only\"...','2010-06-06 16:44:58',12),(415,414,8,'ranis','Ranis','','0000-00-00','00:00:00','After the game against Federer, where Robin was the outstandingly supreme player (even though Federer played well), Bjrn Borg said that \"this will be the new world no.1\". His serves reaches 250 km/h... and his forehand 9,5 MACH.','2010-06-06 12:45:24',0),(416,0,8,'ranis','Ranis','Euro 2012','0000-00-00','00:00:00','My second note on the forum of the 2010 Football World Cup will be about... EURO 2012!! My friends, as you know it plays in Poland, which is nowadays my home country. The nearest stadium in Wroclaw is only 100 km away. Our house is on the route from Western Europe to the host cities. This note is an open invitation to EVERYBODY (even you who I never met) to come and visit and stay at our house during Euro 2012. We have a huge house in the country side with lots of space, (last summer we had 40 people staying for midsummer without having to erect a single tent), and an even hugher screen to watch the games. Cold beer in the fridge and a pond to swim in and play with the leaf frogs. Sounds nice, huh??!! Well, IT IS NICE! So if you have any plans to visit Poland in 2012, feel free to use our location as a hub in between the host cities. Our house will be a crazy football camp where you come and go as you please and only talk about football will be allowed (and tennis of course :).','2010-06-11 16:18:19',7),(417,415,11,'kimbel','RoboCop','','0000-00-00','00:00:00','I met Bjrn Borg in 1980 during the Westland/Utrecht Hypotheekbank tournament in the sportscomplex then owned by my stepdad... His opponents like a young McEnroe (nicknamed Maccaroni), Guillermo Vilas, Ilie Nastase, Ion Tiriac, Eddie Dibbs, Roscoe Tanner, Tim Gullikson stood no chance... just before that final Borg\'s blond wify was constantly nagging about being hungry, when she banged the dressing room door suddenly a racket peeped out with two buns of bread on it...','2010-06-06 13:24:49',0),(418,414,8,'ranis','Ranis','','0000-00-00','00:00:00','6-4 6-2 4-2 to Nadal. I cant bare to watch this any longer. I am embarrassed. Robin gave up already half through the second set after losing his 7th break ball... sigh...<br/>I will try to find the friendly Nigeria  North Korea somewhere instead. Go North Korea!! Lagerbck  Die!!!','2010-06-06 15:17:45',0),(419,414,8,'ranis','Ranis','','0000-00-00','00:00:00','Actually found Nigeria  North Korea on some arabic online channe