at all)','2010-06-11 11:37:13',0),(454,0,8,'ranis','Ranis','Total prediction','0000-00-00','00:00:00','Part 1 - <br/><br/>Feel free to copy these total predictions as you wish. I have always ended up Top 40 in the betting each championship (except twice) so you are right to view me as an expert.<br/><br/>Since we don\'t bet on the whole tournament from the start as we once did, I am here applying for geniusship:<br/><br/>Final: Brazil-Argentina 2-0<br/><br/>It is a lot about the route of who meets who and when. I believe that Arg has an inferiority complex against Bra and that won\'t work in a final. Dunga\'s defense will remain disciplined while Maradona probably isn\'t familiar with neither terms defense nor discipline. It is rare that creativity and flair wins you a final, it is more about keeping it together (whatever that means).<br/><br/>Spain will lose to Argentina in the semis. Sonner or later, history will catch up with the Spaniards who in spite of winning Euro knows that they don\'t have what it takes to go all the way in WC. The curse will live on! Thing with Spain is that they can\'t handle pressure, being a goal down to an equal team. They will have an easy time through the group and be lucky to meet Ivory Coast and Cameroon in the 1/8 &amp;  finals so when there is finally a great team on the other side, Spain won\'t be prepared and Argentina will want it more, even though Torres &amp; Villa will score the roof on fire on their way there.<br/><br/>WC 2010 won\'t have a lot of surprises. All the favorites will win their groups except Italy who will be second to Slovakia (since Slovak beats Paraguay and Italy only draw). This doesn\'t matter since both of them will exit in the 1/8 final, Italy (who will be overall disappointing in good defending champion tradition) to a ferocious Holland (who as always will win their group games by 4-0, 5-0, 4-1  look out for van Persie for the Golden Boot!) and Slovakia to Cameroon, who will surprise most people by reaching the quarters, but how surprising is it really? They play in a shit group with Japan and Denmark which have looked like zombies in the last games. So, being on that high, of course Cam can go on to beat Slovakia and then lose big to Spain in the quarters.<br/><br/>Ivory Coast have the advantage of playing North Korea last and can keep pushing forward even if they lead 3-0, and since goal difference is on top of head-to-head meetings this time, and the fact that Svennis will go for a draw in the other games (and being successful as he usually is outside of Mexico), Ivory Coast will reach the 1/8ths where they lose to Spain. Adeus Portugal!<br/><br/>The other Swedish African - Lagerbck (oh, how we wish the Nigerians will adopt him and give him a nice hut on the savannah, VERY close to the lion den...) - will also reach the 1/8ths with Nigeria. All they need to do really is to explode against South Corea in the last game which is much more likely than the opposite. In the 1/8ths will they lose on penalties to Handce.... I mean France, who will play like shit but still reach the quarters and win their group, probably after scoring only one goal (1-0, 0-0, 0-0).<br/><br/>Handce.... I mean France, will get lucky tonight against Uruguay  1-0 in a totally boring game. One can only guess how the goal will happen... throw-in? Handsy... I mean Henry will accidentally steer a freekick with his ass? A passing pelican will score with a header (or perhaps a beaker)? 4th official  Swedish Martin Handson (surprise, surprise... he was NOT assigned any games as 1st official this WC, only as 4th...) - will add an extra 348 minutes injury time and all player will pass out except Gallas who will score by drooling on the ball. (sorry, my amis, no cheering for France this time around  the reason to why I have been drinking Guiness instead of red wine the past 8 months is NOT because it tastes better)<br/>','2010-06-11 12:09:03',2),(455,454,8,'ranis','Ranis','','0000-00-00','00:00:00','Part 2 - <br/><br/>In the premier South Africa will start very intense but since Mexico has more talent and none of the teams can afford to loose, it will be a draw. Expect all-out attack from whatever team is down, could be a fun game if there is an early goal. Uruguay will then beat South Africa in a very exciting and offensive game by 3-2, where Suarez will have some sort of international breakthrough, and reach the 1/8ths where they lose to Argentina.<br/><br/>Handce... I mean France, will lose the quarters to my only surprise package... Serbia, which will then run out of steam and lose the semis to Brazil. Don\'t be fooled by the start of the serbs, they will  look nervous and confused and terrified to be ridiculed as last time so they will draw in all their group games but still advance and suddenly realize that WC actually is now some sort of success for them, where upon they can finally relax, pressure is off, and just let the talent they have just roll out. Being on this high, they will comfortably beat England (which as always is ridiculously overhyped) in the 1/8ths and Handce.... I mean France in the quarters.<br/><br/>England will comfortably win their group but draw in the final match against the underestimated Slovenia, which will go 2nd in the group. Slovenia will then lose in a sleepy game to Germany in the 1/8th but Argentina will revenge Germany in the quarters.<br/><br/>Chile will be second in Group H and then lose to Brazil, who will have an surprisingly easy time breaking down the Netherlands offense in the quarters (as seen before).<br/><br/>If anyone is still reading this, don\'t you have better things to do??!! Anyway, I am mostly writing this to upgrade my reputation to being a genius, a football-Nostradamus, in case it all comes true... then this is for the record (NO, I have not done this before, if you think I have then... well then, boo you!).  If it doesn\'t come true my reputation will simply remain as being that weird guy over there