ar sport in South Africa, and the World Cup will increase interest in football in general! Combine this with the strong, proud Zulu culture, as personified by the Zulu King, His Majesty King Zwelithini Goodwill kaBhekuzulu, who has granted the Dutch to use the name Iwolintshi Amabhubesi! By this profound blessing they will become a fierceful squad that no-one can ignore! We thank our charming receptionist Nompendulo Chonco, without whom we could have never managed to bring you this Thanda Star Academy news!','2010-06-15 11:26:07',3),(543,541,9,'karine','Karinebou','','0000-00-00','00:00:00','Me too, I\'m a big fan of the Mannschaft ! They amazed me yesterday. Danke schn !','2010-06-14 17:28:31',0),(544,536,9,'karine','Karinebou','','0000-00-00','00:00:00','before CAM-JAP I was about to sell my bets to anyone who wanted to bribe me....Funny that you mentioned it too !','2010-06-14 17:29:14',0),(545,541,7,'etienne','Don Draper','','0000-00-00','00:00:00','Okay dude! Sorry about the misunderstanding ! ','2010-06-14 17:30:13',0),(546,0,1,'nicolas','Nico','Brownian motion?','0000-00-00','00:00:00','[Jun 14, 07:06] - To the innocent eye, my ranking (59th or 61th, depending on how you look at it - who created such a confusing point system?) would mean that I have abandoned all hopes of ever making it back to the top, and have accepted my fate at the bottom of the charts, like I did in all previous editions.<br/>\"Au contraire!\" I would print with font size 56 to that innocent eye. The first matches are but a round of observation to me. I have missed half of the matches, but that will not prevent me from predicting who will win once all first group matches have been played. I will rise like the sun on Phoenix, I will be re-born like Jason, and it will be the time of my supremacy!','2010-06-14 17:39:24',0),(547,0,8,'ranis','Ranis','Africans out of breath','0000-00-00','00:00:00','[Jun 14, 07:06] - After Nigerias game someone in the Nigeria team complained that they didnt pr