AAAAALLLLLLLLLLLLLLL MAICONNNNNNNNNNNNNNNNN THIS IS HISTORYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYYY!!!','2010-06-15 19:42:52',0),(593,592,8,'ranis','Ranis','','0000-00-00','00:00:00','If Ivory Coast &amp; Portugal draw against Brazil then Brazil will probably go out, or not?<br/><br/>Let\'s see who is brave enough to put 5 points on a draw in portugal - north korea... :)','2010-06-15 20:21:55',0),(594,586,25,'alex','Alex','','0000-00-00','00:00:00','not about betting ona started match, but you said it was possible to see the odds once the match had started... this I didnt figure out how...','2010-06-15 22:38:08',0),(595,593,25,'alex','Alex','','0000-00-00','00:00:00','havent seen the match but read online that the North Korean seem to not be an easy team to play...','2010-06-15 22:40:06',0),(596,590,7,'etienne','Don Draper','','0000-00-00','00:00:00','The person who told Victor that this was a Tae Kwendo competition did a bad joke. This is not what I call a friend.','2010-06-16 07:08:50',0),(597,596,8,'ranis','Ranis','','0000-00-00','00:00:00','true, true... change friends, victor! <br/>It can\'t be easy, I mean the official trademark for the tournament is - \"2010 FIFA World Cup South Africa\". It says nothing about \"football\".','2010-06-16 08:33:55',0),(598,595,8,'ranis','Ranis','','0000-00-00','00:00:00','Perhaps the era of \"easy\" teams are forever gone now.','2010-06-16 08:35:29',0),(599,0,8,'ranis','Ranis','The man that cried','0000-00-00','00:00:00','[Jun 16, 11:06] - You probably saw the japanese-born North Korean No.9 Jong Tae Se (?) cry during the national anthem. A special and touching picture that will come back in all the chronicles, which just makes you feel for the guy. A few bloggers are writing about it, that was he overcome by the big moment and so on.<br/><br/>During a period a few months ago I watched a bunch of documentaries on North Korea and I have never seen such an emotional bunch of people, they were often crying in all sorts of situations, and not in a miserable way (oppose to what most think, most north korean seems to truly love their country and their leader) but in an expressive way when things really matter, similar to the game yesterday.','2010-06-16 10:16:30',3),(600,599,8,'ranis','Ranis','','0000-00-00','00:00:00','Here\'s a funny anecdote:<br/>In February 1998, I was in Beijing with my girlfriend at the time. We wanted to go to North Korea and the only \"travel agency\" (owned by the NK government naturally) that could fix this had their office there.<br/><br/>We went there and found out that 4 days all included would cost around 1500 so we booked it and paid for it. It would have been a fully organized trip where a guide would guide our every step. <br/><br/>However, 2 days before departure, the guy from the travel agency calls our hotel and tells us: \"Sorry, you can\'t go, North Korea is close. Can you come back in April?\"<br/><br/>We didn\'t want to hang around Beijing for 2 months waiting for this opportunity so we declined and luckily got our money back.','2010-06-16 09:16:55',0),(601,600,8,'ranis','Ranis','','0000-00-00','00:00:00','Another funny thing... In Beijing there is a large area where all the embassies are next to each other and outside of each embassy is a billboard with promotional pictures of that country.<br/><br/>Outside North Koreas embassy were a lot of pictures, 90% of them showed someone with a gun or rifle, often families where even the kids head was next to the gun that the father held proudly, and heaps of military picture, some were drawn with a beautiful sunset behind a few tanks. But in the middle of it all was a big picture of .... an ESCALATOR!!!<br/><br/>As if to say, \"we are also a country of sophisticated high technology\".<br/><br/>Hope you don\'t mind this non-football story but I thought it was quite funny.','2010-06-16 09:23:04',0),(602,601,9,'karine','Karinebou','','0000-00-00','00:00:00','I love those anecdotes. Thank you Ranis !','2010-06-16 10:16:30',0),(603,596,9,'karine','Karinebou','','0000-00-00','00:00:00','hi hi...Now I need to find out who\'s victor, our hero !','2010-06-16 10:18:38',0),(604,0,25,'alex','Alex','CHI-CHI-CHI LE-LE-LE VIVA CHILE!! VAMOS!!!!','0000-00-00','00:00:00','[Jun 16, 01:06] - sorry... comes from the core of my heart :)','2010-06-16 22:43:24',8),(605,604,11,'kimbel','RoboCop','','0000-00-00','00:00:00','Best Anthem so far!!!','2010-06-16 11:28:47',0),(606,605,25,'alex','Alex','','0000-00-00','00:00:00','indeed!! :)','2010-06-16 11:35:27',0),(607,0,25,'alex','Alex','stats','0000-00-00','00:00:00','[Jun 16, 01:06] - can someone give us a good website where you had full stats about matches like<br/>ball possession<br/>time spent in which side of the pitch<br/>passes vs misses passes<br/>shot vs shots out of the frame<br/>etc <br/>that would be interesting especially when you can see the match (I missed Brazil North Korea and I want info ;))','2010-06-18 12:00:38',6),(608,606,11,'kimbel','RoboCop','','0000-00-00','00:00:00','RED HOT CHILE PEPPERS!!! Beausejour... the arm of God!','2010-06-16 12:08:55',0),(609,608,8,'ranis','Ranis','','0000-00-00','00:00:00','Was it arms/hands? The Swedish TV surprisingly didnt talk about it... awkward since the ref already made a few obvious mistakes. <br/><br/>They said that the ref from Seychelles had been on a course to learn some English phrases.... Great! It is good that he is prepared, however, the teams speak SPANISH!! Wouldn\'t have made more sense having a ref from Spain? Or at least someone that spoke the same language as the teams. Damn, I hate FIFA.<br/><br/>Anyway, should the goal have been disallowed?','2010-06-16 12:36:07',0),(610,0,8,'ranis','Ranis','Torres','0000-00-00','00:00:00','[Jun 16, 03:06] - Torres is not playing from start. then, tell me, how the hell is he suppose to be best scorer?? We are 8 people that have Torres as top scorer. Hope Villa gets injured early on...','2010-06-16 13:23:05',1),(611,610,25,'alex','Alex','','0000-00-00','00:00:00','hahaha nasty is that hey :D','2010-06-16 13:23:05',0),(612,606,8,'ranis','Ranis','','0000-00-00','00:00:00','Chile looks great, technically skilled, attack minded and so, but who will score the goals, their finishing is not that sharp and too complicated. Maybe Suazo is fit for next game?<br/>I had a feeling of NZ situation in the end of the game here.','2010-06-16 13:29:04',0),(613,612,25,'alex','Alex','','0000-00-00','00:00:00','yeah it was for me so far the most agreeable match to follow.. even if indeed in the end, the Chileans seemed to be waiting for the end of the match... ','2010-06-16 14:01:22',0),(614,0,25,'alex','Alex','Spain - Switzerland','0000-00-00','00:00:00','[Jun 16, 04:06] - what a boring first half!!<br/>Spanish players seem to not dare to play how they do... what the fuck is wrong with this world cup! So few goals, almost none during first half... #blah... whats the point in having a day off then!','2010-06-16 16:08:45',7),(615,614,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','hum hum, I wonder how a game can be exciting when Switzerland is playing...','2010-06-16 15:01:39',0),(616,615,25,'alex','Alex','','0000-00-00','00:00:00','seems the gods have heard you... The swiss are ahead.. it has to get exciting now!!','2010-06-16 15:10:24',0),(617,614,1,'nicolas','Nico','','0000-00-00','00:00:00','We all watched Inter defeat Barcelona.. this year\'s trend is to defend &amp; counter!','2010-06-16 15:14:41',0),(618,617,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Nico, you\'re perfectly right ! Now, for the beauty of the game (and my own interest), let\'s hope Villa will score !','2010-06-16 15:16:48',0),(619,0,7,'etienne','Swiss Army Knight','HOP SUISSE, HOP SUISSE !!','0000-00-00','00:00:00','[Jun 16, 05:06] - Go go go, Swiss Army Knights !!<br/><br/>Here in the streets of Geneva, the atmosphere is going totally wild : we heard someone whisper \"yes!\" and another person on his bike making \"gling gling\".','2010-06-16 21:40:53',3),(620,618,9,'karine','Karinebou','','0000-00-00','00:00:00','Go Benjip  ! the only one who bet Switzerland !','2010-06-16 15:33:43',0),(621,0,9,'karine','Karinebou','The ref is for Spain','0000-00-00','00:00:00','[Jun 16, 05:06] - Where did he count 5 minutes? <br/>Where did he see a hand? <br/>Could he just give a sympathy goal for Spain because he is disappointed??? What the fuck ! Thank god the Spanish players suck. ','2010-06-17 07:12:22',5),(622,621,9,'karine','Karinebou','','0000-00-00','00:00:00','COngratulations to Ben !','2010-06-16 15:53:02',0),(623,620,25,'alex','Alex','','0000-00-00','00:00:00','Honestly, hat off for Switzerland!! Bad luck for most of us who lost points... But at least, after that goal, it was PLEASANT to see!! ','2010-06-16 15:54:29',0),(624,622,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Ouais !!!!!! Bravo Benjip !!!!','2010-06-16 15:55:32',0),(625,624,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Et aussi vive la mafia Lerolle&amp;co pour truster les premires places !!!','2010-06-16 15:57:07',0),(626,619,8,'ranis','Ranis','','0000-00-00','00:00:00','Making you can send us pictures of that celebrating family bathing in the fountain?','2010-06-16 16:08:00',0),(627,623,8,'ranis','Ranis','','0000-00-00','00:00:00','This could be the highlight of the whole World Cup.','2010-06-16 16:08:45',0),(628,625,25,'alex','Alex','','0000-00-00','00:00:00','by the way, I wonder why I am on the first step... I mean I\'m not the football pro here...<br/><br/>@ranis: can I still join the pot? he he he (no I dont expect to stay first... ;))','2010-06-16 16:09:18',0),(629,626,25,'alex','Alex','','0000-00-00','00:00:00','I wanna see videos!! :) bring it on ;D','2010-06-16 16:35:32',0),(630,0,8,'ranis','Ranis','Luckyguay','0000-00-00','00:00:00','[Jun 16, 10:06] - It might have looked like a comfortable win for Uruguay and sure they were a slightly stronger team until the first goal, but 1-0 was an average shot that was deflected, it wasn\'t near as good as it first seemed , hadn\'t it been touched by Mokoenas back/shoulder (?) then Kuhne would have been able to keep it out. And 2-0 was offside on Suarez before he got tripped by Kuhne, not sure if this was shown during the game but was clear when they showed it afterwards, so a mistake by the ref robbed South Africa a chance of getting back in the end of the game.','2010-06-17 21:39:51',4),(631,630,25,'alex','Alex','','0000-00-00','00:00:00','still.. the first shot was maybe the first goal from outside the box...<br/>the penalty, according to BBC analysis was that Suarez was onside... I didnt see enough slow motion to judge... But the BBC I like for the seriousness of their analysis.<br/><br/>Overall, South Africa was too weak... I was betting for a draw... but after the first half, I knew this wouldnt happen...','2010-06-16 20:48:20',0),(632,629,11,'kimbel','RoboCop','','0000-00-00','00:00:00','VUVUCOWBELLS!!!','2010-06-16 21:40:53',0),(633,631,11,'kimbel','RoboCop','','0000-00-00','00:00:00','Suarez has collected a bunch of yellow cards with Ajax over the last season! All refs are instructed to keep their eyes on him! He\'s known for his famous Schwalbes! This was one of the best, because no one really noticed how well it was acted! South America is known for its magic-realism theatre play, and Luis earned his Golden Globe here!','2010-06-16 21:46:10',0),(634,609,11,'kimbel','RoboCop','','0000-00-00','00:00:00','is it his hip, shoulder or arm?... <a href=\'http://sportsillustrated.cnn.com/multimedia/photo_gallery/1006/soccer.world.cup.day6/content.7.html...\' target=\'new\'>http://sportsillustrated.cnn.com/multimedia/photo_gallery/1006/soccer.world.cup.day6/content.7.html...</a> <a href=\'http://www.fifa.com/worldcup/highlights/video/video=1247091/index.html\' target=\'new\'>http://www.fifa.com/worldcup/highlights/video/video=1247091/index.html</a>','2010-06-16 22:15:10',0),(635,634,39,'stephane','StephAfrico','','0000-00-00','00:00:00','He scored with his ass (technically his left buttock)','2010-06-16 22:43:24',0),(636,624,24,'benjamin','Benjip','','0000-00-00','00:00:00','whispered: \"yes !\"','2010-06-17 07:12:21',0),(637,0,8,'ranis','Ranis','The one and only Diego','0000-00-00','00:00:00','[Jun 17, 02:06] - I must say that Maradona is growing on me. I love his totally uncompromising communication and attitude (\"Pele belongs in a museum\"...) which lacks any sort of fake politeness and still he acts with great passion and warmth. It is refreshing in contrast to all the customized FIFA-men.<br/><br/>But best of all, he is so cute when he is celebrating a goal, clinging on to the others in the squad like a fat suckerfish or like an overweight monkeybaby clinging on to gorilla-mama...<br/><br/>I decided during last World Cup that during next WC I will stop hating Argentina and start to cheer for them and it feels good :) Viva! (or whatever they say...?)','2010-06-17 13:46:21',3),(638,637,11,'kimbel','RoboCop','','0000-00-00','00:00:00','We are witnessing The Johannesburg Massacre! Korean blood will flow excessively through the streets of Jo\'burg! Audience cheering like at a bullfight! Argentina can win this WC pure on attitude, on mentality, with Diego Bonaparte in sober grey and Messi magico! Maradona on the French: We know how they are. They think they\'re better than us... oops, fatal flaw is arrogance, Lee says gracias!','2010-06-17 12:20:18',0),(639,0,39,'stephane','StephAfrico','Top scorer','0000-00-00','00:00:00','[Jun 17, 03:06] - Only one picked Higuain as top scorer. Well done, Nico !','2010-06-17 13:10:14',0),(640,637,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','Totally agree ! The Maradona press conferences (\"the journalists can suck my dick\") are a delight, and remind us that some of them can be human - I\'m not even mentioning the robotic press conferences by Domenech, even though I kind of like their surrealistic ambiance.<br/><br/>Viva Maradona (\"gorilla-mama\"... that image will stay with me ;-)) ','2010-06-17 13:20:57',0),(641,631,8,'ranis','Ranis','','0000-00-00','00:00:00','The offside on 2-0 was not on the first pass towards Suarez but on the touch on the uruguyan player in between the passing player and Suarez','2010-06-17 13:42:04',0),(642,0,7,'etienne','Swiss Army Knight','Learn the difference','0000-00-00','00:00:00','[Jun 17, 03:06] - I went down my office for 10 minutes to watch Argentina-Korea in a bar, and the impression given by their attack was strong.<br/><br/>In fact, watching France on a regular basis, I am not accustomed to such a philosophy. Here, the attack seemed to constantly follow a motto :<br/>- FAST!<br/>- INTENSIVE!<br/>- FASTER!<br/>- FORWARD!<br/>- THE MORE THE MERRIER!<br/><br/>So when watching France tonight, be prepared for a totally different philosophy. The mottos could be :<br/>- SHOULD I REALLY MAKE THIS PASS ? LET\'S THINK.<br/>- MMH I\'D BETTER WAIT AND GIVE THE BALL BACK TO MIDFIELD<br/>- IS THE GIRL ON ROW 42 IN THE EAST CURVE REALLY 18 ALREADY ??<br/>- I AM NOW GOING TO ATTACK ALONE. DON\'T FOLLOW ME, GUYS.<br/>- I SHOULD STOP RUNNING. IT\'S EXHAUSTING.<br/>- WOW, WE ARE PLAYING REALLY BAD BUT WE HAVE NOT CONCEDED ANY GOAL YET! WOOHOO!<br/><br/>I can\'t wait.','2010-06-17 21:41:30',4),(643,640,39,'stephane','StephAfrico','','0000-00-00','00:00:00','Amazing to see how you can be indulgent to this despitable guy(drug, mafia,...), just because of some talent shown long ago...<br/><br/>I refuse to give my louses to Diego-gorilla ;-)','2010-06-17 13:46:21',0),(644,642,8,'ranis','Ranis','','0000-00-00','00:00:00','or...<br/><br/>THE FRENCH HANDBALL TEAM DID PRETTY GOOD, LET\'S GET INSPIRED BY THEIR TECHNIQUE<br/>','2010-06-17 14:04:30',0),(645,0,8,'ranis','Ranis','b','0000-00-00','00:00:00','[Jun 17, 04:06] - What I dont like with Group B is that I like all the teams. I was hoping to hate Nigeria for all miserable moments Lagerbck caused my country, but I just can\'t... Lagerbck looks too much like my dad - walking around on the pitch with arms crossed on his big belly where he has a pocket with a notebook (pocket on the belly...) and scratching his ear between every sentence he speaks with a bad accent on the press conference. Somehow feel for him. He looks so small and vulnerable and out of place in between all the giant Africa Bambatas. I hope he succeeds so he wont get thrown out in the jungle and eaten up by any hungry hyenas. Go Nigeria!!!','2010-06-17 14:10:41',0),(646,0,1,'nicolas','Nico','Gonzalo!','0000-00-00','00:00:00','[Jun 17, 04:06] - YES Higuain top scorer so far! I knew it: they all go on Messi like flies on Domenech\'s eyebrows, and Higuain is free to score at will.','2010-06-17 14:49:24',0),(647,0,8,'ranis','Ranis','niggre','0000-00-00','00:00:00','[Jun 17, 04:06] - For all you workaholics that thought Nig-Gre was worth passing on, you might wanna re-think. After Nigeria scored 1-0, they had a player on red card and Greece started pushing forward in great Argentine fashion. After 4 clear chances they scored 1-1. Nigerian goalie Enyeama is fantastic and the second half should be quite action-packed. None of the teams can afford to loose (or possibly even draw)<br/><br/>If you can\'t watch the games on TV at work, you can watch it online here - <a href=\'http://myp2p.eu/competition.php?competitionid=&amp;part=sports&amp;discipline=worldcup2010\' target=\'new\'>http://myp2p.eu/competition.php?competitionid=&amp;part=sports&amp;discipline=worldcup2010</a> <br/>(you might need to download Sopcast or similar but it is easy and smooth)','2010-06-17 19:24:00',5),(648,647,8,'ranis','Ranis','','0000-00-00','00:00:00','Holy mother! The miss of the century by Nigeria in the 60th minute, my grandma would have scored on that opportunity by just looking at the ball, my oh my ....','2010-06-17 15:23:27',0),(649,644,9,'karine','Karinebou','','0000-00-00','00:00:00','I have a problem with it too. It\'s not enjoyable watching France play. I don\'t know what to bet, I don\'t know what to feel. I think I will stil root for les Bleus, but it\'s a weird feeling. I am kinda hoping that France will finish in second position so that we can see a France-Argentina. That\'d be a game we haven\'t seen in a while.  ','2010-06-17 16:19:31',0),(650,642,1,'nicolas','Nico','','0000-00-00','00:00:00','I almost want France to lose so that they stop annoying me and they are out of my sight. Or they start playing well. Or a piano falls on Domenech. That\'d make my day still.','2010-06-17 16:35:37',0),(651,0,17,'derek','','Cinco de Mayo','0000-00-00','00:00:00','[Jun 17, 07:06] - Cinco de Mayo (\"fifth of May\") is a holiday held on May 5 that commemorates the Mexican army\'s victory over French forces at the Battle of Puebla on May 5, 1862.','2010-06-17 18:00:53',2),(652,651,1,'nicolas','Nico','','0000-00-00','00:00:00','Today is the 17th of June.','2010-06-17 17:36:32',0),(653,652,17,'derek','','','0000-00-00','00:00:00','It was also no holiday for me.  I had to work today.','2010-06-17 18:00:53',0),(654,648,8,'ranis','Ranis','','0000-00-00','00:00:00','Only 5 people predicted a Greece win and all of them put 1 or 2 points except.... BENJIP!!! He put 5 points. Who is this betting magician?? :) He was also the only predicting the Swiss win...','2010-06-17 18:04:23',0),(655,648,11,'kimbel','RoboCop','','0000-00-00','00:00:00','how old is your grandma? mine is 89!','2010-06-17 18:42:03',0),(656,0,39,'stephane','StephAfrico','PLEASE: GOVOU OUT','0000-00-00','00:00:00','[Jun 17, 09:06] - My grandma runs faster...','2010-06-18 06:16:05',14),(657,655,9,'karine','Karinebou','','0000-00-00','00:00:00','Two different persons. THe swiss guy was Benjip and the Greek one is Benny. Or am I wrong?','2010-06-17 19:20:23',0),(658,657,9,'karine','Karinebou','','0000-00-00','00:00:00','You\'re right ! It is Benjip !! Congrats \'cous !','2010-06-17 19:24:00',0),(659,656,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','PLEASE ANELKA OUT !!<br/><br/>My mother-in-law shows more interest in the game.','2010-06-17 19:24:40',0),(660,659,39,'stephane','StephAfrico','','0000-00-00','00:00:00','Yes, let\'s put our family (in law) on the ground','2010-06-17 19:29:41',0),(661,659,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','Aaaaaah Gignac for Anelka. At last.','2010-06-17 19:37:35',0),(662,661,39,'stephane','StephAfrico','','0000-00-00','00:00:00','and Gourcuff for Govou, with Ribry on the right side<br/>Your mother in law could replace Toulalan for the last game against South Africa ?','2010-06-17 19:39:45',0),(663,662,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','The last game will be just for fun, so yes my mother in law could play. Mexico and Uruguay deserve to qualify. France did not deserve to be here - Irish fans must be so angry... they would have shown better than that for sure.','2010-06-17 20:00:53',0),(664,0,1,'nicolas','Nico','Look at Domenech','0000-00-00','00:00:00','[Jun 17, 10:06] - His team is down 1-0, he\'s not moving an inch. He\'s watching the match like he\'s waiting for bus number 36 towards the Eastern district. Oh, penalty. Make it quick, please.','2010-06-18 07:57:46',7),(665,663,39,'stephane','StephAfrico','','0000-00-00','00:00:00','Can\'t wait Laurent Blanc, with Henry, Govou, Anelka retired and Gourcuff as key player with Nasri, Ben Arfa, Benzema,...<br/>And Ribry will have to choose between football and hores','2010-06-17 20:04:32',0),(666,665,39,'stephane','StephAfrico','','0000-00-00','00:00:00','OLE ! OLE !','2010-06-17 20:10:45',0),(667,666,39,'stephane','StephAfrico','','0000-00-00','00:00:00','The only good news: Soth Africa will ba the last game for Domenech','2010-06-17 20:14:31',0),(668,667,39,'stephane','StephAfrico','','0000-00-00','00:00:00','I\'ve already lived that in 2002: unable to score against anyone','2010-06-17 20:17:32',0),(669,664,9,'karine','Karinebou','','0000-00-00','00:00:00','It really looks like a team that has no strategy , no organization, nothing. I\'m happy for Mexico and happy for my bet. I Just wished I had given more points (just won 1). My problem now is South Africa: will France really retain their dignity and win against them (like Malouda hopes?)??? Will South Africa retain their dignity and win in their own country? Tough....','2010-06-17 20:26:09',0),(670,662,1,'nicolas','Nico','','0000-00-00','00:00:00','I think Toulalan played quite well...','2010-06-17 20:29:17',0),(671,664,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','The amazing thing is that the bookmakers still had France as a favorite against Mexico. When you look at all the French matchs since 2007, how can you bet for France ?<br/><br/>The painful thing is to watch a team that has absolutely zero opportunities against Uruguay, zero opportunities against Mexico, that is not able to correctly shoot a free-kick... It could not be worse.<br/><br/>At least now we can focus on the other teams and their fighting spirit !','2010-06-17 20:31:32',0),(672,0,14,'peter','Peter','it was worth 4 points','0000-00-00','00:00:00','[Jun 17, 10:06] - aaa ... it was worth losing 4 point in the bet to watch Mexico win. Handce did not no what to do, again. Watch Domenechs coaching makes Lagebck look Mouhirino by the side. Domenech was leaning against the bench and whising upon the stars that the goal would just drop in. <br/>Why didnt he put in Henry, he have made a final goal before, so way dont try thath again?<br/>I can only say like Earl, Karma baby Karma. ','2010-06-17 21:15:35',2),(673,671,8,'ranis','Ranis','','0000-00-00','00:00:00','You have all my sympathies, my friends. The should have ditched the idiot 4 years ago. Blanc looks promising so things should be fine for next time.','2010-06-17 20:55:59',0),(674,672,8,'ranis','Ranis','','0000-00-00','00:00:00','Yep, Mexico and Argentina looks fabulous. <br/><br/>on swedish TV today they discussed what coaches can really do during a game. An expert said - \"not much\"... yeah , right... Today\'s game (and several of the games this WC) should be the final proof that they (or at least some leader of the team) is absolutely essential.<br/><br/>next up for a shave is Capello...','2010-06-17 21:01:06',0),(675,674,14,'peter','Peter','','0000-00-00','00:00:00','Dont touch Capello, they are so gonna win with 1-0 tomorrow, algerian defender is gonna do an own goal, all becuse of Capellos shouting on the side. <br/>Promise  ...','2010-06-17 21:15:35',0),(676,641,25,'alex','Alex','','0000-00-00','00:00:00','true...','2010-06-17 21:39:51',0),(677,650,25,'alex','Alex','','0000-00-00','00:00:00','totally on with Nico!! I want beautiful games and France doesnt deliver.. out then!!','2010-06-17 21:41:30',0),(678,673,25,'alex','Alex','','0000-00-00','00:00:00','Etienne is so right.. since the final of 2006 France never delivered a great performance that you would be ENJOYING to see... it\'s boring as fuck... and Domenech.. I mean come on, last time he asked hsi GF to marry.. I wonder what he\'s gonna pull of his sleeve this time, probably he will say \"now I\'m off on vacation with my 800k\"','2010-06-17 21:46:48',0),(679,678,11,'kimbel','RoboCop','','0000-00-00','00:00:00','C\'est terribleu! Un entraneur national can be fired during a tournament! A Jameson Gold Reserve anyone?','2010-06-17 23:00:19',0),(680,670,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Yes, only three french players on the field tonight : Toulalan, Malouda and Sagna. The others were lost tourists.','2010-06-17 23:11:05',0),(681,670,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Can anybody tell Ribery that football is a team sport ? Can\'t believe that almost every french prefers him than Gourcuff...','2010-06-17 23:19:43',0),(682,681,9,'karine','Karinebou','','0000-00-00','00:00:00','I found that Lloris was quite good as well.','2010-06-18 04:44:36',0),(683,679,9,'karine','Karinebou','','0000-00-00','00:00:00','But here as well, Still more peuple bet for France than Mexico. So strange. Go USA !','2010-06-18 04:48:54',0),(684,682,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Lloris is OK, but he doesn\'t look that he is the boss of his defender','2010-06-18 06:16:05',0),(685,0,39,'stephane','StephAfrico','Vuvuzelas...','0000-00-00','00:00:00','[Jun 18, 09:06] - are better trumpets than French players (French sport newspaper L\'Equipe, this morning)','2010-06-18 07:10:18',0),(686,683,27,'augustin','Gugusse','','0000-00-00','00:00:00','Why did I change my bet from 5 points for Mexico to 2 points ?<br/>I must have a trace of patriotism...<br/>Poor Raymond ! I feel sad for him !','2010-06-18 07:57:46',0),(687,0,17,'derek','','Froggy fans are as bad as froggy players','0000-00-00','00:00:00','[Jun 18, 11:06] - Does anybody even care that France can still make the next round?  Doesn\'t it matter that the World Cup is not over for them yet? <br/><br/>You all did the same thing last time around when France did not win all of its matches before advancing and making it to the final.  <br/><br/>French players give up because they do not believe they can win, just like French \"supporters\" who give up before it is even over. ','2010-06-18 11:58:07',4),(688,687,8,'ranis','Ranis','','0000-00-00','00:00:00','I think that this time around it is more a matter of w a n t i n g to give up. If you are not proud of your team, it\'s better they go home. A total failure is good so things won\'t repeat itself. The harder the fall is, the longer will it take until another Domenech mistake is made. Hopefully the french will for a long time remind themselves: \"not another Domenech\" and for this to happen, it has got to hurt and the humiliation has got to be big, so I totally understand them.','2010-06-18 09:33:50',0),(689,688,8,'ranis','Ranis','','0000-00-00','00:00:00','We had the same situation in Sweden where Lagerbck failed every time but never really badly since he had such great players at his disposal, so what happened is that he never got fired and we had to be stuck with him for 8 (!) years with the same situation repeating itself until he finally failed bad. My conclusion is that it is better for the French the worse this WC gets, a total war and mutiny in the end would probably be quite healthy in the long run.','2010-06-18 09:38:07',0),(690,607,8,'ranis','Ranis','','0000-00-00','00:00:00','FIFA has a little bit but far from all you want. I would also very much like to get tips on where to read about the World Cup, tips anyone???<br/><br/>Especially with good analysis and statistics on the game. I read ESPN and CNN which are ok newswise but they don\'t run deep. Aftonbladet.se is a good tabloid for football gossip (can be read with translate.google.com), but so far I didn\'t find a great site.','2010-06-18 09:44:04',0),(691,690,8,'ranis','Ranis','','0000-00-00','00:00:00','On Swedish TV they said that Switzerland was the team that ran the most in the first round - 11 km per player. South Korea was 7th with 7 km. Where can you access that kind of stats, that\'s what I would like to know???','2010-06-18 09:45:37',0),(692,691,8,'ranis','Ranis','','0000-00-00','00:00:00','Oh, you can find this at FIFA. Here for instance - <a href=\'http://www.fifa.com/worldcup/statistics/teams/distance.html\' target=\'new\'>http://www.fifa.com/worldcup/statistics/teams/distance.html</a><br/><br/>You can read that Germany ran 112073 (m?) and serbia ran 94150 in their first games.','2010-06-18 09:50:51',0),(693,692,8,'ranis','Ranis','','0000-00-00','00:00:00','More stats:<br/>In their first games, Germany made 13 attacks - 1 from the left &amp; 9 from the right, Serbia made 8 attacks - 1 from the left &amp; 4 from the right.<br/>Germany didn\'t suffer any tackles where they lost possession, neither did Japan, NZ, USA and Cameroon.<br/>The most attacking team so far is ... Greece :)<br/>The teams that made most clearances without completion was - England &amp; Algeria, they did not complete any clearances.<br/>Serbia has 0% completion on crosses (9) and corners (4), interesting since they had so many interesting free kick tricks.<br/><br/>I better stop now...','2010-06-18 10:02:13',0),(694,689,39,'stephane','StephAfrico','','0000-00-00','00:00:00','French supporters could have believed in this team if this team had believed in itself and if some better players had played (Gourcuff, Benzema, Nasri, Squillacci, Mexes...). Look at yesterday\'s game: Anelka played again as a midfield, Govou did not run, Ribry forget (once again) to give the ball to ther players from time to time)<br/>They did not played well in the last 4 years.<br/>Yes, they can be qualified if they won 3-0 or 4-0 against SAF and if there\'s a winner between Uruguay and Mexico. I am quite sure that those 2 teams will play and try to win to be sure to avoid Argentina next round, but how could we score more in 1 game than the last 4 or 5 games...<br/><br/>Please note that mathematically speaking, Argentina could be out this WC (If defeated by Greece 3-0 or more and South Korea defeats Nigeria 3-0 or more): but it will not happen...<br/>Nigeria could also be qualified and this is an option that be considered: victory 2-0 against South Korea and Greece defeated by Argentina','2010-06-18 10:30:41',0),(695,692,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','To me, more important is : HOW DO THEY KNOW THAT ?<br/>Do they put sensors in the players shorts ? Or shoes ? How does the \"thing\" (gps tool ? camera senstive to movements ?) know which player from the other ? This is absolute mystery to me, and I find it too bad they do not explain.<br/><br/>It\'s like we could have on the screen \"this player lost 0.787 liters of water and 0.876 mg of mineral acids in the last 13 minutes\" and people would just acknowledge the information without even wondering how they calculate that.<br/><br/>So, I do not really care about how much they run because I don\'t know what to think of this information, but if anyone knows the technology behind that, I am curious... thanks.','2010-06-18 11:17:14',0),(696,0,107,'przemek','Przemek','just a joke','0000-00-00','00:00:00','[Jun 18, 01:06] - Germany.. year 2045.. roadside inspection.. police officers check the documents:<br/><br/>\"See Ahmed, what a strange name: Mller\".','2010-06-18 11:36:01',0),(697,694,9,'karine','Karinebou','','0000-00-00','00:00:00','I have not given up on the French team. I don\'t want them to win after this demonstration. Other teams deserve it better, that\'s all.','2010-06-18 11:58:07',0),(698,695,9,'karine','Karinebou','','0000-00-00','00:00:00','I love stats !! AND I am as curious as my brother on how they gather it. Amazing !<br/>I am at school. I gave exercices to the pupils and they come to the computer every time they\'re done. I can follow the game....I\'m happy !','2010-06-18 12:00:38',0),(699,0,11,'kimbel','RoboCop','GERMAN O MAN O MAN O MANY','0000-00-00','00:00:00','[Jun 18, 02:06] - so gay;))))))))))))))))))))','2010-06-18 12:31:22',3),(700,699,9,'karine','Karinebou','','0000-00-00','00:00:00','don\'t let me down !','2010-06-18 12:20:32',0),(701,699,8,'ranis','Ranis','','0000-00-00','00:00:00','When I saw the serbian line-up 5 minutes before the game, I quickly changed my 1 point for germany to 5... I had the feeling serbs had too much respect for the germans and had the idea that they could only win against them inthe same way the swiss won. hrrmmmm... bad call','2010-06-18 12:22:32',0),(702,699,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00',':-))','2010-06-18 12:31:22',0),(703,0,7,'etienne','Swiss Army Knight','Die Mannschaft !','0000-00-00','00:00:00','[Jun 18, 02:06] - The German coach and his assistant have the exact same outfit. They are a team, definitely. :)<br/><br/>One player less, one goal behind : perfect scenario for a fantastic second half.<br/><br/>Yes I am \"working\" at home today.','2010-06-18 13:02:49',1),(704,703,107,'przemek','Przemek','','0000-00-00','00:00:00','btw. really good ref!','2010-06-18 13:02:49',0),(705,0,8,'ranis','Ranis','Zizuo &amp; matterazzi','0000-00-00','00:00:00','[Jun 18, 03:06] - Finally we know what he said before the knock...<br/><a href=\'http://media.riemurasia.net/albumit/m25139/718822152.gif\' target=\'new\'>http://media.riemurasia.net/albumit/m25139/718822152.gif</a>','2010-06-18 13:39:38',0),(706,0,8,'ranis','Ranis','England','0000-00-00','00:00:00','[Jun 18, 09:06] - Am I seeing this through my one-sided hate-england eyes? But, don\'t they totally suck??? They seem to have taken inspiration from Handce, it\'s like they want to be somewhere else...<br/>if I would have seen this first half not knowing who the teams were, I would have thought that the green team seems more technically skilled, the white more physical and that it will probably be a draw unless the green team can turn their ball possession into goal chances.','2010-06-18 21:33:14',7),(707,706,8,'ranis','Ranis','','0000-00-00','00:00:00','Capello must be a complete idiot. How can he fail in turning one of the most talented squads into zombies. England looks like players in a board game, \"as long as you keep your positions...\". ','2010-06-18 19:28:56',0),(708,707,8,'ranis','Ranis','','0000-00-00','00:00:00','1st half:<br/>ball possession - Algeria-england 51-49<br/>Shots on target - Algeria-england 5-4','2010-06-18 19:33:14',0),(709,706,1,'nicolas','Nico','','0000-00-00','00:00:00','I like England, and yet I have to agree that they aren\'t very enthusiastic. Maybe this is the fate of teams with star players? These players are too busy with their clubs &amp; the premiere league, and don\'t play enough with their national team. Hence the \'corporate\' instructions that apply to any standard \'star\' player, no local customization.<br/>Less pompous teams... look more like real teams.','2010-06-18 19:50:10',0),(710,709,8,'ranis','Ranis','','0000-00-00','00:00:00','Argentina, Brazil and Germany looks fine and fresh to me. This is a result of Capello, the media pressure and the general english mentality.<br/>Today was Capellos birthday :) Cakeparty tonight!!! ... oh yeah, i guess not, cake is forbidden in the english camp','2010-06-18 20:23:39',0),(711,707,8,'ranis','Ranis','','0000-00-00','00:00:00','Capello has been coach for Milan, Roma, Juventus, Real Madrid and England. In terms of playing style and player mentality, notice any team that is different from the bunch?','2010-06-18 20:34:19',0),(712,706,8,'ranis','Ranis','','0000-00-00','00:00:00','I am reading an article/interview with Svennis (Sven-Gran Eriksson). Here is an answer that he gives that somehow points to what I have been trying to point out about England for a few championships now:<br/>Q - The (English) players seem to be surprised that you treat them as adult individuals, \"even though\" they are football players...?<br/>Sven - But isn\'t it a bit old-fashion to not treat senior players as adults? Especially here in England (he lives in London). I think it is going away. Before, the players were seen as school boys but it doesn\'t work having such a leadership style anymore. You can\'t threaten the players to perform. I think that was one of the reasons to why the english players liked me.','2010-06-18 20:42:32',0),(713,712,11,'kimbel','RoboCop','','0000-00-00','00:00:00','everything that has been said about this tournament can go straight into the dustbin... The Battle of Waterloo was fought on June 18th... Swiss will be champions eventually against drunken Chileans... France is out, Spain is out, Germany is out, England go home, Brazil go out, maybe Holland because they all have a cold and can\'t breathe... or... on July 11th the phrase \'In God We Trust\' was added to all U.S. currency, and Andr Antonius Maria Ooijer will be celebrating his birthday with the in 1983 stolen and never recovered Jules Rimet Trophy!','2010-06-18 21:33:14',0),(714,0,8,'ranis','Ranis','30m to No.1','0000-00-00','00:00:00','[Jun 19, 08:06] - The total prize money on offer for the tournament was confirmed by FIFA as $420 million, a 60 percent increase on the 2006 tournament. Before the tournament, each participating team would receive $1 million, for preparation costs. Once at the tournament, teams exiting at the group stage would receive $8 million. Thereafter, the prize money would be distributed as follows:[37]<br/><br/>    * $9 million  Round of 16<br/>    * $18 million  Quarter-finals<br/>    * $20 million  Semi-finals<br/>    * $24 million  Runners up<br/>    * $30 million  Winners<br/><br/>(from Wikipedia)','2010-06-19 06:58:39',0),(715,0,8,'ranis','Ranis','Lots','0000-00-00','00:00:00','[Jun 19, 09:06] - If the results will be - England-Slovenia 2-2 &amp; USA-Algeria 0-0, then there will be drawing of lots by FIFA between England &amp; USA :)','2010-06-19 13:46:30',3),(716,715,17,'derek','','','0000-00-00','00:00:00','That\'s boring.  They should have a breakdance battle instead:<br/><br/><a href=\'http://www.youtube.com/watch?v=PYma9jaszTE\' target=\'new\'>http://www.youtube.com/watch?v=PYma9jaszTE</a>','2010-06-19 10:46:00',0),(717,0,7,'etienne','Swiss Army Knight','Durban stadium','0000-00-00','00:00:00','[Jun 19, 02:06] - One of my favorite stadiums to date. Love this arch.','2010-06-19 13:57:15',4),(718,717,8,'ranis','Ranis','','0000-00-00','00:00:00','Yes, the stadium is beautiful.<br/>The grass looks also to be in really great shape, strong and durable.','2010-06-19 12:19:19',0),(719,717,11,'kimbel','RoboCop','','0000-00-00','00:00:00','another fine mess... will these KamikazeKillers bomb HamstringHolland to smithereens???','2010-06-19 12:20:28',0),(720,719,11,'kimbel','RoboCop','','0000-00-00','00:00:00','some Dutch players complained about the grass beforehand!','2010-06-19 12:21:20',0),(721,0,39,'stephane','StephAfrico','Anelka...','0000-00-00','00:00:00','[Jun 19, 02:06] - Has anyone seen how Anelka had insulted Domenech at FRA-MEX half-time ?<br/>I believe non-French speaking people can understand also...<br/><a href=\'http://www.lequipe.fr/Football/breves2010/20100619_085031_le-gros-clash-anelka-domenech.html\' target=\'new\'>http://www.lequipe.fr/Football/breves2010/20100619_085031_le-gros-clash-anelka-domenech.html</a><br/>','2010-06-20 18:18:28',22),(722,716,11,'kimbel','RoboCop','','0000-00-00','00:00:00','It goes something like this: <a href=\'http://www.youtube.com/watch?v=KoQb8vb4blA\' target=\'new\'>http://www.youtube.com/watch?v=KoQb8vb4blA</a>','2010-06-19 12:26:50',0),(723,722,17,'derek','','','0000-00-00','00:00:00','You\'re right.  The US is lucky they will not face the Slovene power breakdance.','2010-06-19 13:46:30',0),(724,720,11,'kimbel','RoboCop','','0000-00-00','00:00:00','Lucky Lions! 1-0... O, they won?! It is completely silent in the streets of Amsterdam?!?!?!?!','2010-06-19 13:57:15',0),(725,721,1,'nicolas','Nico','','0000-00-00','00:00:00','Domenech has been repeating the same message for 2 years... not in the same words, of course, which makes all the difference. I hope Laurent Blanc will forgive Anelka. I would.','2010-06-19 14:10:24',0),(726,725,39,'stephane','StephAfrico','','0000-00-00','00:00:00','Hope Anelka will not wear anymore a French jersey, even for a training and that he will be asked to leave the Group.<br/>Laurent Blanc will ask Gourcuff to be his key player, which is not compliant with Anelka\'s presence','2010-06-19 14:23:10',0),(727,725,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','I would not. Someone who does not show passion for a match when wearing the national jersey, that is lucky enough to be listed among the 23 players when other would die to be in his position, and that tells the coach to fuck off when he is being told to respect the tactics, he can just go to hell, as far as I am concerned. It\'s true that Domenech is a lousy coach with no authority and no charisma - but Anelka is just a spoiled child with no education.','2010-06-19 14:23:25',0),(728,727,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','Tope-l, Steph ;)','2010-06-19 14:24:13',0),(729,0,1,'nicolas','Nico','Handball','0000-00-00','00:00:00','[Jun 19, 04:06] - This red card is ridiculous.','2010-06-19 17:45:50',2),(730,729,17,'derek','','','0000-00-00','00:00:00','The second match for Australia and their second undeserved red card.  No luck at all.','2010-06-19 14:30:49',0),(731,727,1,'nicolas','Nico','','0000-00-00','00:00:00','..says Etienne who also supports Maradona for his honest language :)<br/>Anelka knows perfectly well how to speak to the media, and he does not go out of line there. I believe that what he told Domenech was not supposed to be leaked to the media. If he is doing his best, and does not agree with the coach, then he should say so. The phrasing depends on a lot of things, like the tone of Domenech, which we do not know about. <br/>By the way, Anelka should sue L\'Equipe for slander. If all the other players wear the French jersey proudly, and want the image of the French team to remain clean, they should say Anelka did not say that. Let us all speak like Domenech and live in fear of being ratted out...that should be fun.','2010-06-19 14:36:17',0),(732,725,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','I remember players (Roy Keane, maybe ?) who had the balls to refuse the selection as long as the coach they hated was there. Anelka could have said \"I refuse to be in this list\" and let someone else go to South Africa. I sincerely hope Laurent Blanc will not accept him.','2010-06-19 14:37:56',0),(733,728,17,'derek','','','0000-00-00','00:00:00','Anelka only said what everybody thinks about Domenech.  Classless, but honest.','2010-06-19 14:39:09',0),(734,731,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','Maradona was speaking to journalists.<br/><br/>If Higuain says \"fuck off, you son of a bitch\" to Maradona, I believe he will be on the next plane to Buenos Aires.<br/><br/>Of course a player can disagree, show anger about being replaced during the game, start an intense discussion about tactics... but being directly insulting cannot be authorized. Especially from a player who does not give 100% on the pitch and does not follow the tactic...<br/><br/>One one point I agree, though : we do not know exactly what happened, what is the source, is it 100% reliable, etc. And the way L\'Equipe put this sentence on the headline is totally ridiculous, they are now down to the \"Bild\" level - probably in desperate need to sell papers, now that the French team is out.<br/>','2010-06-19 14:46:29',0),(735,0,39,'stephane','StephAfrico','YEAH... ANELKA OFFICIALLY EXCLUDED','0000-00-00','00:00:00','[Jun 19, 05:06] - Unbelievable ! I\'m defending Domenech<br/>(Etienne, you\'re my man ;-)','2010-06-19 17:44:18',2),(736,735,7,'etienne','Swiss Army Knight','','0000-00-00','00:00:00','Well, I am not really defending Domenech (I would like him to be suspended by his intestines and covered with honey so that he is slowly eaten by red ants), I am more supporting the \"team spirit\" and the agreed internal rules in such a top level competition.<br/><br/>Tonight : Cameroon-Denmark. We are going to the cinema ! :)<br/>\"Too much football kills football.\" (Nietzsche)','2010-06-19 15:37:41',0),(737,0,17,'derek','','Tendency','0000-00-00','00:00:00','[Jun 19, 06:06] - Nico, there\'s something wrong with the formula you use to calculate \"tendency.\"  It shows you ending up at 22nd, and we all know you will end up in the lower third of the final results.','2010-06-19 16:37:54',1),(738,737,1,'nicolas','Nico','','0000-00-00','00:00:00','Only 22nd! I have never followed the trend anyway.','2010-06-19 16:37:54',0),(739,736,11,'kimbel','RoboCop','','0000-00-00','00:00:00','or the so-called \'Hom-Dai\'... first cutting the person\'s tongue out, the embalmers tilting the victim\'s head back so that he or she would not drown in their