n this despitable Paraguay team. This is a pity that Japan did not play as they did in the first round','2010-06-29 20:57:33',0),(1003,0,8,'ranis','Ranis','When Tevez was offside','0000-00-00','00:00:00','[Jun 29, 11:06] - If you are not already bored with more FIFA/ref scandals, you have got to read this.<br/><br/>On the offside 1-0 goal in Argentina-Mexico it turns out that the linesman Ayroldi (who was suppose to see the offside but didn\'t) immediately afterwards saw on the stadium big screen that Tevez was offside on the replay. Probably the Mexicans also saw it as they rushed straight to him. When this happens chief referee Rosetti runs to Ayroldi, they both know that it is offside at this time, BUT the rule says that the refs are NOT allowed to use the screens as help for this, so they HAVE to allow the goal even though both of them know they did a mistake. How absurd can it get??!!','2010-06-30 07:26:39',2),(1004,1001,11,'kimbel','RoboCop','','0000-00-00','00:00:00','he got it from 2PAC... <a href=\'http://www.youtube.com/watch?v=rOTqs1z9WVI\' target=\'new\'>http://www.youtube.com/watch?v=rOTqs1z9WVI</a>','2010-06-29 21:22:00',0),(1005,998,42,'mache','Mache','','0000-00-00','00:00:00','I think the whole \"no referee mistake\" is a reflection of the pathetic status of football today. When you play football with your friends, you don\'t mind one little mistake from the referee (if you even have a referee). So why this big fuss about the referees? If you don\'t win by a couple of goals difference, it is anyway most likely a question of luck rather than being better than the other team. You can also consider the referee not seeing your goal as bad luck like hitting the pole.<br/>It\'s just a sport, isn\'t it?<br/>You know that the winner of the first modern-day Olympic marathon, stopped by to some inn to drink a glass of wine and chat with the locals? That\'s the spirit. Not the bloody Portuguese falling in the penalty area although nobody was closer than 20cm f