d people betting on Ivory Coast, or even... France, but no one on Germany.','2010-07-08 21:05:37',1),(1084,0,7,'etienne','Scoobidoo','Controversial ball','0000-00-00','00:00:00','[Jul 08, 09:07] - <a href=\'http://g.sports.yahoo.com/soccer/world-cup/blog/dirty-tackle/post/NASA-piles-on-the-Jabulani-hate?urn=sow,254182\' target=\'new\'>http://g.sports.yahoo.com/soccer/world-cup/blog/dirty-tackle/post/NASA-piles-on-the-Jabulani-hate?urn=sow,254182</a><br/>','2010-07-08 21:03:37',1),(1085,1081,7,'etienne','Scoobidoo','','0000-00-00','00:00:00','I thought you said that sports was not about \"who can beat\" but rather about \"who beats\" ?<br/><br/>In soccer, it\'s Europe who beats the other continents. Punkt schluss.','2010-07-08 07:52:17',0),(1086,1085,39,'stephane','StephAfrico','','0000-00-00','00:00:00','Et toc !','2010-07-08 10:21:54',0),(1087,1081,7,'etienne','Scoobidoo','','0000-00-00','00:00:00','That being said without anything personal against the US team, who played one of the most enjoyable soccer among the games I\'ve watched (along with South Korea, or Japan).','2010-07-08 12:30:03',0),(1088,1077,27,'augustin','Gugusse','','0000-00-00','00:00:00','You may find a random system for those (I know some) who have forget to make their bets ?<br/>Otherwise I like this system.','2010-07-08 15:08:22',0),(1089,1074,27,'augustin','Gugusse','','0000-00-00','00:00:00','ah oui pardon.<br/>Kessquispasse si y a plusieurs top scorer (genre galit Villa/Sneijder) ?','2010-07-08 15:12:08',0),(1090,1089,1,'nicolas','Nico','','0000-00-00','00:00:00','Ceux qui ont pari sur Villa &amp; Sneijder ont 5 points! C\'est dj pas facile d\'avoir un top scorer, si en plus on commence  chipoter...','2010-07-08 15:16:47',0),(1091,1088,1,'nicolas','Nico','','0000-00-00','00:00:00','I will implement an email reminder system (for those willing to participate) which sends a reminder if a match is without bet for a certain user. Next time, next time...','2010-07-08 15:17:51',0),(1092,1084,1,'nicolas','Nico','','0000-00-00','00:00:00','It does not surprise me that professionals can tell subtle changes in a football\'s dynamics, after years of training.<br/>But yes, this is an appalling ball. Van Bronckhorst\'s goal is somewhat of a miracle; most teams refrained from shooting from a distance. African teams, as usual, did not - we see that this time they were less successful than previous times. <br/>FIFA is appalling in all aspects. Here is an ultra powerful organization that cannot even improve refereeing, or ball dynamics. They are still in the 1950\'s.','2010-07-08 21:03:37',0),(1093,1083,25,'alex','Alex','','0000-00-00','00:00:00','Vuvuzela bet on Germany... ;)','2010-07-08 21:05:37',0),(1094,0,1,'nicolas','Nico','Best looking teams','0000-00-00','00:00:00','[Jul 08, 11:07] - ..are Brazil, Denmark, France, Italy, Spain and the U.S. <br/><br/><a href=\'http://g.sports.yahoo.com/soccer/world-cup/blog/dirty-tackle/post/Wayne-Rooney-voted-ugliest-footballer-in-the-wor?urn=sow,254333\' target=\'new\'>http://g.sports.yahoo.com/soccer/world-cup/blog/dirty-tackle/post/Wayne-Rooney-voted-ugliest-footballer-in-the-wor?urn=sow,254333</a>','2010-07-08 21:07:26',0),(1095,0,27,'augustin','Gugusse','waf waf','0000-00-00','00:00:00','[Jul 09, 10:07] - <a href=\'http://www.dailymotion.com/video/xdy71c_les-selectionneurs-du-mondial-parle_sport#from=embed\' target=\'new\'>http://www.dailymotion.com/video/xdy71c_les-selectionneurs-du-mondial-parle_sport#from=embed</a>','2010-07-09 08:34:14',0),(1096,0,8,'ranis','Ranis','The Final - and all of it (yuck)','0000-00-00','00:00:00','[Jul 09, 11:07] - The final will probably make the football world disappointed. It will be a static and passive game where your position on the pitch will be more important than becoming a hero (similar to Germany\'s brilliant tactic in the semi). Rather 100 times careful than 1 time careless. 0-0 and penalties?<br/><br/>Some people have been writing here that there is no such thing as deserving to win a game or the WC title, but this is nonsense. Regardless of whatever team you cheer for, everyone wants the winner to be the best team, a team that we can show at least some sort of admiration for, a team that we will remember after many years as a great team. So far, the previous WC winners has been that team, Italy did it with the slightest of margins last time, but looking back, they were worth winning as all the other previous champions in recent memory.<br/><br/>But this time, Spain (the new Italy) is a total joke, they score 6 goals in 6 games, one fluke after another with tons of crappy ref calls on the way. Tici-taca... what\'s so goddamn entertaining to watch a team pass the ball around sidaways for 90 minutes? Imagine if Spain wins the final by 1-0 and afterwards we watch a chronicle of Spain\'s amazing path to the title, it is gonna be outright embarrassing. <br/><br/>Holland hasn\'t really been too good either and had a few lucky breaks to say the least (1-1 to Brazil, offside goal 2-1 to Uruguay), but at least they have the chance of becoming winners by pride by making a super final and crushing Spain. Though this seems unlikely and whoever wins will not be remembered as a great WC winner. <br/><br/>All in all, this has been my lowsiest World Cup experience so far, and I don\'t like that we have a new country to win it. What\'s new with Holland and/or Spain? It what way does that feel fresh? booooooooring... Ghana, Chile or Japan would have been new and fun, even Uruguay would have been newer.<br/><br/>It\'s been a disappointment. It started already with the vuvuzelas that messed up the sound and atmosphere (I only remember hearing one single chant in some USA game). Handce made complete fools of themselves but they shouldn\'t even have been there from the start, but most of all the ref/FIFA sitaution has been shameful and turned much of this into a lottery leading teams into organizing their diving skills.<br/><br/>Of course my favorite teams (Germany, Italy &amp; Argentina) has let me down and teams I hate (Spain, Holland) has progressed. But I also hate Brazil and in the past Argentina &amp; Germany and it has always felt ok anyway when one of them has won since it was obvious they were the best teams. <br/><br/>Well, this pretty much sums it up. Thanks for listening to my whining. Thanks Nico &amp; Co for organizing the betting and forum, it truly enhances the whole thing. Now I cheer for Holland, but mostly because Kimbel can win the betting and get to experience a WC win in his home town and because Sneijder &amp; Robben are the only players who could hold the trophy with accurate pride.','2010-07-11 12:29:49',6),(1097,1096,7,'etienne','Scoobidoo','','0000-00-00','00:00:00','I would like Netherlands to win because :<br/>- I have bet on them and I would be very proud to be right a second time<br/>- They have already been in a final twice, and it\'s a bit cruel to wish they have another defeat at that stage<br/><br/>But I also would like Spain to win because :<br/>- My friend Johnny on the Spot will win the jackpot ! Alan you rule !<br/>- Carlos Puyol\'s haircut<br/>- The whole country might go bankrupt soon, at least they will have something to help them forget<br/>- Someone like Marco Van Bommel should work in a slaughterhouse, he should not be lifting a football trophy<br/><br/>WHO will watch Uruguay - Germany ?? I think I have never watched the game for the 3rd place. I wonder why they keep that. Nobody cares. Germany will have their substitutes play, while the others read a book on the bench. I mean, listen to their hip-hop crap music. Counting the minutes before they can go on holidays.<br/><br/>I agree with Ranis on Sneijder and Robben : key players until the Champions League final, and key players to lead their team to the WC final... impressive season ! Sneijder golden ball in December ?','2010-07-09 11:40:48',0),(1098,1096,1,'nicolas','Nico','','0000-00-00','00:00:00','I agree that this was a disappointing World Cup. I blame it mostly on FIFA: players and coaches only use the tactics that will lead them as far as possible. Faking injuries, using offside tactics until one of them is not called, being expert in committing fouls that don\'t get you booked, while killing the scoring opportunity, these are skills that still help them get through.<br/>I still think Spain is a great team. Keeping the ball like they do is really difficult. I also liked Brazil, but they were not consistent enough. Yes Japan&amp;Co had a refreshing style, but they need to learn the FIFA tricks before hoping for any win. England had the FIFA tricks, and might have gone further with their boring game, had it not been for a FIFA screw-up. Sometimes bad guys kill each other.<br/>Last, I am disappointed because I still did not win this damn contest. I need to find a point system that makes me win!<br/>','2010-07-09 15:55:06',0),(1099,1096,39,'stephane','StephAfrico','','0000-00-00','00:00:00','Spain will explode Holland 1-0','2010-07-09 16:00:17',0),(1100,0,1,'nicolas','Nico','Top World Cup Players','0000-00-00','00:00:00','[Jul 10, 09:07] - <a href=\'http://www.nytimes.com/interactive/2010/07/02/sports/soccer/facebook-worldcup.html\' target=\'new\'>http://www.nytimes.com/interactive/2010/07/02/sports/soccer/facebook-worldcup.html</a>','2010-07-10 07:30:41',0),(1101,1097,8,'ranis','Ranis','','0000-00-00','00:00:00','WHAT!!?? NO ONE CARES ABOUT 3rd PLACE GAME ???!!!<br/>The 3rd place game of 94 is the most legendary football game of all time !!! Still in these times and this WC ... the 94 3rd place game had on Facebook - 582% (!) - more mentions than Germany-England on the night after that very game.<br/>You big country-boys are spoiled. <br/><br/>While one tv-channel will show this years final, there are 4 others that show a re-run of the 94 3rd place game and I know what I am watching!<br/><br/>Don\'t care about this years 3rd place game though...','2010-07-10 15:24:53',0),(1102,0,8,'rani