fighters for the next 65 years at least... I will never again drink orange juice, and Howard Webb is dead for sure... thank you Vilnico as well... OLE!','2010-07-12 21:29:00',3),(1123,1115,11,'kimbel','RoboCop','','0000-00-00','00:00:00','NO! Forlan has been awarded the Golden Boot! the assists count! Otherwise Mueller has won it! David Villa is not counted right!','2010-07-11 22:43:59',0),(1124,0,39,'stephane','AfricoSteph','Kuyt (really) said:','0000-00-00','00:00:00','[Jul 12, 12:07] - \"We are angry because we were so close. The referee was slightly more for them than for us. That ultimately cost us the cup.\"<br/><br/>Unbelievable...','2010-07-11 22:44:30',0),(1125,1123,11,'kimbel','RoboCop','','0000-00-00','00:00:00','<a href=\'http://www.fifa.com/worldcup/awards/goldenboot/index.html\' target=\'new\'>http://www.fifa.com/worldcup/awards/goldenboot/index.html</a>','2010-07-11 22:48:33',0),(1126,1119,39,'stephane','AfricoSteph','','0000-00-00','00:00:00','As expected, Spain exploded Holland 1-0, and Dutch players exploded Spanish ones 6 karate kicks to 0','2010-07-11 23:08:41',0),(1127,0,25,'alex','Alex','Howard Webb is a faggot!','0000-00-00','00:00:00','[Jul 12, 04:07] - Not only he gave two yellow cards for imaginary fouls... but then he refuses a corner that was obvious and that lead to a dogy goal...<br/>If he hasnt been bribed by the fifa, then I dont know... queen sofia\'s blowjob was probably decisive...<br/><br/>I dont say the Dutch played better... far from that but this game should have ended 11 against 11 with a shoot out session... <br/><br/>ho and yeah Webb is a fag!','2010-07-14 19:54:37',10),(1128,1123,1,'nicolas','Nico','','0000-00-00','00:00:00','hm the contest was to find the top scorer... I did not know about this golden boot contest...in all languages I used \'top scorer\' and not \'golden boot\' or its equivalent...','2010-07-12 06:31:59',0),(1129,1127,39,'stephane','AfricoSteph','','0000-00-00','00:00:00','If the referee was good, he should have dismissed 5 Dutch and 1 Spanish.<br/>Unbelievable: Dutch football \"fans\" think the referee was for Spain... Are you blind and can\'t you be fair ?????','2010-07-12 07:27:56',0),(1130,0,94,'alan','Johnny on the Spot','Muchisimas gracias, merci beaucoup, thanks....','0000-00-00','00:00:00','[Jul 12, 09:07] - Thanks to everyone for a fun and memorable World Cup! I really enjoyed this one and look forward to 2012.','2010-07-12 22:26:24',9),(1131,1122,94,'alan','Johnny on the Spot','','0000-00-00','00:00:00','Thanks, man! It was an exciting cup. Hasta pronto, amigo mio.','2010-07-12 07:59:10',0),(1132,1130,1,'nicolas','Nico','','0000-00-00','00:00:00','Thanks Ranis for organizing the money bit! It does spice the game quite much!','2010-07-12 07:59:37',0),(1133,1132,15,'vincent','Vin\'s','','0000-00-00','00:00:00','Thank you Nicolas, you\'re the best, I\'m your brother...<br/>See ya in BRRRRAZIL !','2010-07-12 08:22:22',0),(1134,1130,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','Yeah, thanks Nico and Ranis for organizing this and making me lose 10 ;)<br/>Nico, well done for the site, it goes better and better every time !<br/>','2010-07-12 08:47:33',0),(1135,1129,8,'ranis','Ranis','','0000-00-00','00:00:00','The ref was crap and made several huge errors. The corner and Elias no-free kick was the most obvious which had major consequences. Sure, de Jong should have had a red card and possibly van Bommel too but so should Puyol. Heitingas second yellow was strange and how come I havn\'t seen one single picture of the offside sitaution on Torres cross to Iniesta before the goal?? Looked pretty much offside to me. <br/><br/>','2010-07-12 09:13:16',0),(1136,0,39,'stephane','AfricoSteph','Sport\'s values: fair, respect, friendship, accept the defeat...','0000-00-00','00:00:00','[Jul 12, 11:07] - Dutch taekwondo players and fans should recover the original values of sport.<br/>If Holland had won, I don\'t know how I could have explained that to my 7-years old son who just began to play football and whose  coach teaches these values...','2010-07-12 16:41:16',2),(1137,1134,55,'casper','MidTableAnguish','','0000-00-00','00:00:00','Definitely! Thanks Nicolas. This site makes even lousy football matches worth watching. If you make changes to keep idiots like me closer to the top after the second round, I will be happy, but if you don\'t I will still keep coming back like a foolish masochist.','2010-07-12 09:55:30',0),(1138,1137,9,'karine','Karinebou','','0000-00-00','00:00:00','Hasta la vista and see you in Poland !!!!!!!!! Hvala lepa.','2010-07-12 11:17:02',0),(1139,1135,9,'karine','Karinebou','','0000-00-00','00:00:00','Game sucked. Ref bad. Dutch coach completely nuts for allowing his players to be so violent. Spanish boring. Loved the Dutch goalee though !','2010-07-12 11:19:11',0),(1140,1126,9,'karine','Karinebou','','0000-00-00','00:00:00','The Dutch were simply defending themselves against  their Spanish colonial oppressors.  All tactics are justified in the liberation struggle!','2010-07-12 11:42:55',0),(1141,1135,1,'nicolas','Nico','','0000-00-00','00:00:00','The worst of it is that when Spain learned about who would be the referee for the final, they complained, saying that he was the one for Spain Switzerland, and did a very bad job there as well (the Swiss goal being offside, I think). So everyone knew he was bad.','2010-07-12 12:09:12',0),(1142,1130,7,'etienne','Scoobidoo','','0000-00-00','00:00:00','Congrats, dude ! Beer is on you when I visit Paris next time ! ;)<br/><br/>And big up to Nico, the opposite of FIFA : daily innovations to the site, fun, respect, fair-play... always a pleasure.<br/><br/>See you all in 2012, for the German victory at the Euro !','2010-07-12 13:02:13',0),(1143,1141,25,'alex','Alex','','0000-00-00','00:00:00','If I totally agree on the most of the yellow cards... there are still 2 where cards were given while there was NO contact...<br/>and the last unjustified yellow is given while the ref didnt whistle anything (and that was no advantage rule, he thought the player had taken the ball in a fair way...).<br/><br/>I\'m quite surprised to see how the French press is focussing on the hard play by the Dutch and leaves out the theatre by the Spanish... The worst being Didier Roustand\'s video-blog... he probably had a bad Dutch joint before he started his diatribe...<br/>','2010-07-12 13:29:28',0),(1144,1132,70,'andreas','Andy','','0000-00-00','00:00:00','Thank you Nico for the organisation and brilliant homepage! It made the WC an even greater pleasure! And that goes for you too Ranis! See y\'all in two years!','2010-07-12 14:12:25',0),(1145,0,19,'sylvain','Blame it on the Roon','Pissed off','0000-00-00','00:00:00','[Jul 12, 04:07] - In the end, this World Cup pissed me off. A lot. I even preferred spending time with non-football fans to watching the final last night.<br/>Two reasons :<br/><br/>1) French Medias spent more time talking about French players attitude than talking about the World Cup and analyzing the game. This and a lame first round, I had the impression that the tournament began with the round of 16.<br/><br/>2) Everybodys pointing referees mistakes, but no one really thinks about the real consequences :<br/>   Explain to me how a refused corner for Holland can lead to a Spanish goal (a non-sense as stupid as Ginola is the cause of Kostadinov goal in 1993). Why do you blame Howard Webb and not Arjen Robben when he lamely missed his face to face with Casillas ? Maybe because its easier to blame others (referees, FIFA, Jews) than yourself...<br/>    Explain to me how Mexico and England could have win against Argentina and Germany ? Again its really easier to say it was referees fault...<br/><br/>Well Im glad to find my old PSG back (supporting this team gives you a huge sense of humour) and also curious to see what Canadian think of football (as I move to Montreal in September) !<br/>See you Caribou !!!','2010-07-12 16:03:04',2),(1146,1143,39,'stephane','AfricoSteph','','0000-00-00','00:00:00','Don\'t try to argue about the yellow cards.<br/><br/>After 30 mn, Dutch butchers should have been nine: red card for Van Bommel (tackle from behind, with feet 30 cm above the ground), red card for De Jong for a Taekondo kick on Xabi Alonso\'s chest.<br/><br/>2nd half: Van Persie and Snejder should have been dismissed (2nd yellow card for scoring long after the ref stopped the off-side position)<br/><br/><br/>Let me see how you loose, I\'ll tell who you are...<br/><br/>','2010-07-12 14:25:02',0),(1147,1145,19,'sylvain','Blame it on the Roon','','0000-00-00','00:00:00','D\'ailleurs, je crois que j\'adore dj ce pays (trouv en cherchant des infos sur les clubs amateurs de Montral) :<br/><a href=\'http://www.elitemtlconcordia.ca/devoirs.htm\' target=\'new\'>http://www.elitemtlconcordia.ca/devoirs.htm</a>','2010-07-12 15:52:51',0),(1148,1147,39,'stephane','AfricoSteph','','0000-00-00','00:00:00','Il semble malgr tout que les coups de taekwondo sur la poitrine ne sont pas spcfiquement interdits ','2010-07-12 16:03:04',0),(1149,1142,94,'alan','Johnny on the Spot','','0000-00-00','00:00:00','With pleasure! Stay thirsty, my friend....','2010-07-12 16:13:41',0),(1150,0,39,'stephane','AfricoSteph','Some positive things about this WC','0000-00-00','00:00:00','[Jul 12, 06:07] - <br/>- A brand new winner<br/><br/>- Confirmation of some promising countries: USA, South Korea, Japan<br/><br/>- Some good teams were not an addition of some stars, but real teams, with a generation living &amp; working together for years : Ghana (and the great Gyan), Chile, Mexico<br/><br/>- Germany played well (hard to say for me but true)<br/><br/>- Some teams played so badly that they are obliged to change : Italy, France (let\'s hope...), Nigeria, Cameroun, Ivory Coast<br/><br/>- Confirmation or appearance of some great players: Mller, Forlan, Gyan<br/><br/>- In a football game, a referee is necessary but not sufficient ;-)<br/><br/>- Defensive teams did not win: Switzerland, Greece (but Paraguay did)<br/>','2010-07-12 16:25:29',0),(1151,1136,11,'kimbel','RoboCop','','0000-00-00','00:00:00','...last remark, just before I drown myself in the yellowpissed canals... Rinus \'The General\' Michels, who coached the 1974 squad and won the 1988 EC, died in 2005... He is responsible for raising Dutch football players with his epic remark: \"Football is War!\"... \"Football at the top is like war. Those who are too polite are lost.\"... Madrid Cabron! Salut El Campion!','2010-07-12 16:26:35',0),(1152,1151,39,'stephane','AfricoSteph','','0000-00-00','00:00:00','From 1988 EC, I\'d rather remember Van Basten, his behaviour, his goals, than Rinus Michels\' remark<br/>Footbal is sport and game not war. A defeat is not serious...','2010-07-12 16:41:16',0),(1153,1128,11,'kimbel','RoboCop','','0000-00-00','00:00:00','Forlan has been chosen Best Player and wins Golden Ball, Mueller has won Golden Boot as Top Scorer due to most assists!','2010-07-12 17:35:44',0),(1154,1127,37,'rico','Americo','','0000-00-00','00:00:00','Come on Alex, the whole world agrees: Mr Webb sucked yesterday night, but come on, only Dutch people think it went against them... ','2010-07-12 21:16:44',0),(1155,1122,37,'rico','Americo','','0000-00-00','00:00:00','Yes, you should be sick, in Orange Country, just like French people have been sick 4 years ago. But I remember well the sensation, we were sick not because we lost the title, but because Zidane did something very wrong and gave a poor image of France around the world. This made me sick at that time, and as a Dutch citizen, the ugly behaviour of MM. Van Bommel and De Jong should make you sick today...','2010-07-12 21:24:00',0),(1156,1155,37,'rico','Americo','','0000-00-00','00:00:00','And the goal was not off-side, perfectly valid... even though Spain had been expected to be more brilliant in this WC, this Iniesta goal pleased EVERY football fan in the world except in Holland... Just read the international press, for example J. Cruyff\'s column in El Periodico...','2010-07-12 21:29:00',0),(1157,1130,147,'paul','POOOOOOOOOOOOOLLLLLL','','0000-00-00','00:00:00','Thanks, everyone, for making this so fun and well run. I look forward to next time.','2010-07-12 22:26:24',0),(1158,0,39,'stephane','AfricoSteph','A Clockwork Orange','0000-00-00','00:00:00','[Jul 13, 01:07] - <br/><br/>I saw this final a second time, with no sound except Ludwig van\'s Ninth Symphony.<br/><br/>It took another dimension<br/>','2010-07-12 23:00:17',0),(1159,1154,25,'alex','Alex','','0000-00-00','00:00:00','Nope... I know some non Dutch people who thinks the same...<br/>And even a French guy compared the headbutt by Zidane with the foul by De Jong... I dont excuse the gesture, but it wasnt doen on purpose to hit Alonse while Zidane did it intentionally, therefore the first one got yellow and the second one got red...<br/>If all the fouls had been whisled and booked properly, there would have been much more yellows and reds through the whole competition, not including Dutch players only...','2010-07-14 12:20:34',0),(1160,1159,1,'nicolas','Nico','','0000-00-00','00:00:00','I disagree: when you play at that level, and you raise your foot like that, believe me you know the risks. A Sunday-league player, maybe it\'s not a purpose. A pro knows. You don\'t do that in the middle of the field - there are always players there, it\'s a hot zone, you rarely have time to control the ball. I played Sunday leagues and I was not even doing that! <br/>And Zidane\'s headbutt was not dangerous at all: De Jong\'s move was, very. ','2010-07-14 16:18:40',0),(1161,1160,39,'stephane','AfricoSteph','','0000-00-00','00:00:00','Laisse tomber Nicolas. Alex, il lchera pas l\'affaire pendant 4 ans. Apprendre  perdre, surtout quand on a tort, c\'est pas donn  tout le monde','2010-07-14 19:54:37',0),(1162,0,1,'nicolas','Nico','test','0000-00-00','00:00:00','[Apr 14, 09:04] - test','2012-04-15 04:30:25',0),(1163,0,1,'nicolas','Nico','lve','0000-00-00','00:00:00','[Apr 14, 09:04] - lve','2012-04-15 04:30:52',0);
